B.MV=new A.h("      Kh\xf4ng ch\u1ec9 xu\u1ea5t hi\u1ec7n trong h\u1ecdc \u0111\u01b0\u1eddng, m\xe0 ng\xe0y nay chi\u1ebfc \xe1o d\xe0i c\xf2n \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng l\xe0m \u0111\u1ed3ng ph\u1ee5c cho nh\xe2n vi\xean \u1edf m\u1ed9t s\u1ed1 ng\xe2n h\xe0ng l\u1edbn trong n\u01b0\u1edbc nh\u01b0 Vietcombank, Agribank, Eximbank. \u0110\u1eb7c bi\u1ec7t, h\xe3ng h\xe0ng kh\xf4ng n\u1ed5i ti\u1ebfng Vietnam Airline \u0111\xe3 s\u1eed d\u1ee5ng \xe1o d\xe0i l\xe0m \u0111\u1ed3ng ph\u1ee5c cho c\xe1c n\u1eef ti\u1ebfp vi\xean, v\xec \u0111\u1eb7c tr\u01b0ng c\xf4ng vi\u1ec7c n\xean \u0111\u1ed9 d\xe0i t\xe0 \xe1o trong trang ph\u1ee5c c\u1ee7a ti\u1ebfp vi\xean h\xe0ng kh\xf4ng \u0111\u01b0\u1ee3c c\xe1ch t\xe2n l\u1ea1i ng\u1eafn h\u01a1n quy c\xe1ch may \xe1o d\xe0i truy\u1ec1n th\u1ed1ng.",null,B.i,null,null)
