B.N8=new A.h("      Mang cho m\xecnh n\xe9t \u0111\u1eb9p sang tr\u1ecdng, duy\xean d\xe1ng chi\u1ebfc \xe1o d\xe0i ng\xe0y c\xe0ng \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi l\u1ef1a ch\u1ecdn l\xe0 trang ph\u1ee5c m\u1ed7i d\u1ecbp l\u1ec5 h\u1ed9i, \u0111\u1eb7c bi\u1ec7t l\xe0 m\u1ed7i \u0111\u1ed9 Xu\xe2n v\u1ec1. H\xecnh \u1ea3nh c\xe1c gia \u0111\xecnh, c\xe1c m\u1eb9, c\xe1c ch\u1ecb th\u01b0\u1edbt tha di chuy\u1ec3n trong t\xe0 \xe1o d\xe0i th\u1ea3nh th\u01a1i du Xu\xe2n d\u1ea1o ph\u1ed1 ch\u1ee5p h\xecnh, l\u1ec5 ch\xf9a d\u01b0\u1eddng nh\u01b0 \u0111\xe3 tr\u1edf th\xe0nh bi\u1ec3u t\u01b0\u1ee3ng \u0111\u1eb7c tr\u01b0ng b\xe1o hi\u1ec7u mang xu\xe2n \u0111ang v\u1ec1 tr\xean mi\u1ec1n qu\xea ta.",null,B.i,null,null)
