B.Ne=new A.h("     \xdd ngh\u0129a c\u1ee7a t\xe0 \xe1o d\xe0i Hu\u1ebf",null,B.E,null,null)
B.Nf=new A.h("      Hu\u1ebf l\xe0 \u0111\u1ecba danh n\u1ed5i ti\u1ebfng v\u1edbi nhi\u1ec1u c\u1ea3nh \u0111\u1eb9p, di t\xedch l\u1ecbch s\u1eed, l\xe0 v\xf9ng \u0111\u1ea5t kinh k\u1ef3 v\xe0ng son. B\u1ea1n \u0111\xe3 d\u1ef1 \u0111\u1ecbnh g\xec cho chuy\u1ebfn du l\u1ecbch c\u1ed1 \u0111\xf4 Hu\u1ebf s\u1eafp t\u1edbi ch\u01b0a? N\u1ebfu b\u1ea1n c\xf3 \xfd \u0111\u1ecbnh ch\u1ee5p \u1ea3nh check in t\xe0 \xe1o d\xe0i duy\xean d\xe1ng mang \u0111\u1eadm phong c\xe1ch c\u1ee7a nh\u1eefng ch\xe0ng trai c\xf4 g\xe1i Hu\u1ebf d\u1ecbu d\xe0ng th\xec \u0111\u1eebng b\u1ecf qua b\xe0i vi\u1ebft n\xe0y nh\xe9!",null,B.aE,B.j,null)
B.Ng=new A.h("      T\u1eeb l\xe2u ph\u1ee5 ki\u1ec7n \u0111\xe3 l\xe0 m\u1ed9t m\xf3n \u0111\u1ed3 kh\xf4ng th\u1ec3 thi\u1ebfu khi ph\u1ed1i \u0111\u1ed3. V\xe0 \xe1o d\xe0i c\u0169ng kh\xf4ng ngo\u1ea1i l\u1ec7, ph\u1ee5 ki\u1ec7n \xe1o d\xe0i s\u1ebd gi\xfap t\u1ed5ng th\u1ec3 set \xe1o d\xe0i c\u1ee7a b\u1ea1n tr\u1edf n\xean n\u1ed5i b\u1eadt v\xe0 thu h\xfat h\u01a1n. Nh\u01b0ng ph\u1ee5 ki\u1ec7n \u0111i k\xe8m v\u1edbi \xe1o d\xe0i bao g\u1ed3m nh\u1eefng g\xec l\xe0 m\u1ed9t trong th\u1eafc m\u1eafc c\u1ee7a h\u1ea7u h\u1ebft c\xe1c ch\u1ecb em ph\u1ee5 n\u1eef. C\u0169ng b\u1edfi, vi\u1ec7c mang th\xeam nh\u1eefng ph\u1ee5 ki\u1ec7n a\u0301o da\u0300i n\xe0y s\u1ebd gi\xfap b\u1ed9 trang ph\u1ee5c tr\u1edf n\xean n\u1ed5i b\u1eadt v\xe0 th\u1eddi trang h\u01a1n r\u1ea5t nhi\u1ec1u.",null,B.aE,B.j,null)
B.Nh=new A.h("      Trong giai \u0111o\u1ea1n t\u1eeb 1802-1945 khi tri\u1ec1u \u0111\xecnh Nguy\u1ec5n mu\u1ed1n th\u1ed1ng nh\u1ea5t y ph\u1ee5c. \u0110\xe2y ch\xednh l\xe0 th\u1eddi \u0111i\u1ec3m ng\u01b0\u1eddi ph\u1ee5 n\u1eef c\u1ed1 \u0111\xf4 n\xf3i ri\xeang v\xe0 ph\u1ee5 n\u1eef Vi\u1ec7t th\u01b0\u1eddng xuy\xean mang t\xe0 \xe1o d\xe0i nh\u1ea5t. Th\u1eddi \u0111\xf3, \xe1o d\xe0i \u0111\u01b0\u1ee3c chuy\xean d\u1ee5ng trong c\u1ea3 tri\u1ec1u \u0111\xecnh l\u1eabn ng\u01b0\u1eddi d\xe2n. Tuy nhi\xean, \xe1o d\xe0i cung \u0111\xecnh Hu\u1ebf v\u1eabn mang n\xe9t cao sang h\u01a1n h\u1eb3n. D\u1ea7n d\u1ea7n th\xec t\xe0 \xe1o d\xe0i \u0111\xe3 \u0103n s\xe2u v\xe0o ti\u1ec1m th\u1ee9c c\u1ee7a ng\u01b0\u1eddi d\xe2n v\xe0 tr\u1edf th\xe0nh m\u1ed9t b\u1ed9 trang ph\u1ee5c chuy\xean d\u1ee5ng nh\u1ea5t \u1edf c\u1ed1 \u0111\xf4 v\xe0 c\u1ea3 n\u01b0\u1edbc ta. ",null,B.i,B.j,null)
B.Ni=new A.h("      2. C\xe1ch ch\u1ecdn m\xe0u s\u1eafc",null,B.a5,B.j,null)
B.Nj=new A.h("      N\u1ebfu b\u1ea1n kh\xf4ng th\xedch s\u1eed d\u1ee5ng m\u1ea5n \u0111\xea\u0309 la\u0300m phu\u0323 ki\xea\u0323n \u0111i k\xe8m a\u0301o da\u0300i th\xec h\xe3y ngh\u0129 \u0111\u1ebfn nh\u1eefng nh\xe1nh hoa c\xe0i \u0111\u1ea7u v\xf4 c\xf9ng nh\u1eb9 nh\xe0ng v\xe0 tinh t\u1ebf.",null,B.i,B.j,null)
B.Nk=new A.h("      V\xe2\u0323y Nh\xe2\u0323t Bi\u0300nh kha\u0301c Phi Phong nh\u01b0 th\xea\u0301 na\u0300o?",null,B.a0,null,null)
B.Nl=new A.h("Tr\xecnh di\u1ec5n \xe1o d\xe0i \u1edf \u0111\u01b0\u1eddng \u0111i b\u1ed9 g\u1ed7 lim",null,B.v,B.G,null)
B.Nm=new A.h("      Ngu\u1ed3n g\u1ed1c \xe1o Nh\u1eadt B\xecnh la\u0300 lo\u1ea1i trang ph\u1ee5c Phi Phong cu\u0309a Minh tri\xea\u0300u Trung Hoa, r\u1ed3i \u0111\u01b0\u01a1\u0323c nha\u0300 Nguy\xea\u0303n pha\u0301t tri\xea\u0309n l\xean. \u0110\xe2y l\xe0 lo\u1ea1i \xe1o t\u1ee9 th\xe2n d\xf9ng \u0111\u1ec3 kho\xe1c ngo\xe0i, c\u1ed5 h\xecnh ch\u1eef nh\u1eadt ch\u1ea1y d\u1ecdc \u0111\u1ebfn ng\u1ef1c. C\u1ed5 \xe1o Nh\u1eadt B\xecnh \u0111\u01b0\u1ee3c th\xeau r\u1ea5t c\u1ea7u k\u1ef3, tinh x\u1ea3o, \u0111i k\xe8m l\xe0 ph\u1ee5 ki\u1ec7n c\xfac \xe1o \u0111\u01b0\u1ee3c l\xe0m b\u1eb1ng v\xe0ng ho\u1eb7c ng\u1ecdc. D\u01b0\u1edbi c\u1ed5 \xe1o c\xf3 th\xeam 2 d\u1ea3i d\xe2y bu\xf4ng xu\u1ed1ng, g\u1ecdi l\xe0 d\u1ea3i th\xf9y l\u01b0u.",null,B.i,B.j,null)
B.Nn=new A.h("Vua Kh\u1ea3i \u0110\u1ecbnh trong trang ph\u1ee5c th\u01b0\u1eddng tri\u1ec1u, \u0111\u1ea7u \u0111\u1ed9i kh\u0103n x\u1ebfp, \u0111ang l\xe0m vi\u1ec7c trong \u0111i\u1ec7n C\u1ea7n Ch\xe1nh.",null,B.v,null,null)
B.vq=new A.o(!0,B.a2,null,null,null,null,16,B.aW,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.No=new A.h("       Kh\xe1i ni\u1ec7m:",null,B.vq,B.bE,null)
B.Np=new A.h("      - N\u1ebfu b\u1ea1n l\xe0 m\u1ed9t c\xf4 n\xe0ng \u0111i\u1ec7u \u0111\xe0 th\xec c\xf3 th\u1ec3 k\u1ebft h\u1ee3p th\xeam m\u1ed9t s\u1ed1 lo\u1ea1i trang s\u1ee9c kh\xe1c nh\u01b0 v\xf2ng tay, \u0111\u1ed3ng h\u1ed3, v\xf2ng c\u1ed5 ho\u1eb7c khuy\xean tai. Tuy nhi\xean, t\u1ea5t c\u1ea3 nh\u1eefng ph\u1ee5 ki\u1ec7n \u0111i k\xe8m \xe1o d\xe0i n\xe0y n\xean c\xf3 ki\u1ec3u d\xe1ng \u0111\u01a1n gi\u1ea3n, nh\u1eb9 nh\xe0ng, ph\xf9 h\u1ee3p v\u1edbi l\u1ee9a tu\u1ed5i h\u1ecdc sinh.",null,B.i,B.j,null)
B.Nq=new A.h("      Nh\u01b0ng n\xf3 v\u1eabn theo l\u1ed1i \u201c\u0111\u1ea1i \u0111\u1ed3ng ti\u1ec3u d\u1ecb\u201d, t\u1ee9c l\xe0 h\u1ecdc h\u1ecfi v\u0103n h\xf3a v\xe0 c\xf3 s\u1ef1 c\u1ea3i c\xe1ch s\xe1ng t\u1ea1o, kh\xf4ng ph\u1ea3i b\xea nguy\xean m\u1eabu. Ch\xfang v\u1eabn mang n\xe9t \u0111\u1eb7c tr\u01b0ng ri\xeang, cho th\u1ea5y s\u1ef1 ti\u1ebfn b\u1ed9 v\u1ec1 ngh\u1ec7 thu\u1eadt thi\u1ebft k\u1ebf ph\u1ee5c trang c\u1ee7a n\u01b0\u1edbc \u0110\u1ea1i Vi\u1ec7t ta.",null,B.i,B.j,null)
B.Nr=new A.h("      - Ng\xe0y nay ph\u1ee5 ki\u1ec7n \u0111i k\xe8m \xe1o d\xe0i l\xe0 m\u1ea5n \u0111\u1ed9i \u0111\u1ea7u \u0111\u01b0\u1ee3c thi\u1ebft k\u1ebf v\u1edbi nhi\u1ec1u ki\u1ec3u dang kh\xe1c nhau, \u0111i\u1ec1u b\u1ea1n c\u1ea7n l\xe0m l\xe0 l\u1ef1a ch\u1ecdn cho m\xecnh m\u1ed9t chi\u1ebfc m\u1ea5n ph\xf9 h\u1ee3p v\u1edbi m\xe0u s\u1eafc v\xe0 thi\u1ebft k\u1ebf c\u1ee7a \xe1o d\xe0i. Ph\u1ee5 ki\u1ec7n n\xe0y ph\xf9 h\u1ee3p v\u1edbi nh\u1eefng m\u1eabu \xe1o d\xe0i c\xe1ch t\xe2n th\u1eddi th\u01b0\u1ee3ng.",null,B.i,B.j,null)
B.Ns=new A.h("      M\u1ea5n \u0111\u1ed9i \u0111\u1ea7u ch\xednh l\xe0 m\u1ed9t trong nh\u1eefng ph\u1ee5 ki\u1ec7n \xe1o d\xe0i \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi y\xeau th\xedch. N\u1ebfu nh\u1eefng chi\u1ebfc kh\u0103n x\u1ebfp khi\u1ebfn b\u1ea1n c\u1ea3m th\u1ea5y n\u1eb7ng n\u1ec1 th\xec m\u1ea5n v\u1ea3i mang \u0111\u1ebfn cho b\u1ea1n m\u1ed9t c\u1ea3m gi\xe1c nh\u1eb9 nh\xe0ng v\xe0 kh\xf4ng n\u1eb7ng \u0111\u1ea7u.",null,B.i,B.j,null)
B.Nt=new A.h("      B\xean c\u1ea1nh \u0111\xf3, nh\u1eefng hoa v\u0103n ph\u1ee5 c\xf3 \xfd ngh\u0129a c\xe1t t\u01b0\u1eddng, may m\u1eafn nh\u01b0 ch\u1eef ph\xfac, ch\u1eef th\u1ecd, hoa l\u1ef1u, hoa d\xe2y, b\xe1t b\u1eedu,\u2026 c\u0169ng \u0111\u01b0\u1ee3c th\xeau \u1edf ch\xe2n \xe1o r\u1ea5t tinh x\u1ea3o. Ch\xfang c\xf3 s\u1ef1 s\u1eafp x\u1ebfp, thay \u0111\u1ed5i t\xf9y theo danh ph\u1eadn v\xe0 \u0111\u1ecba v\u1ecb c\u1ee7a ng\u01b0\u1eddi m\u1eb7c \xe1o.",null,B.i,B.j,null)
B.Nu=new A.h("      Trang ph\u1ee5c c\u1ee7a c\xe1c b\u1eadc vua ch\xfaa nh\xe0 Nguy\u1ec5n c\u0169ng c\xf3 nhi\u1ec1u lo\u1ea1i v\xe0 m\u1ed7i lo\u1ea1i l\u1ea1i c\xf3 t\xean g\u1ecdi ri\xeang, m\xe0u s\u1eafc ri\xeang v\xe0 ch\u1ec9 m\u1eb7c trong nh\u1eefng d\u1ecbp c\u1ee5 th\u1ec3: trang ph\u1ee5c \u0111\u1ea1i tri\u1ec1u; trang ph\u1ee5c th\u01b0\u1eddng tri\u1ec1u; trang ph\u1ee5c nghi l\u1ec5, th\u01b0\u1eddng ph\u1ee5c; trang ph\u1ee5c xu\xe2n h\u1ea1; trang ph\u1ee5c thu \u0111\xf4ng\u2026",null,B.i,B.j,null)
B.Nv=new A.h("      Gi\xe1 tr\u1ecb l\u1ecbch s\u1eed v\xe0 v\u0103n h\xf3a v\u1ec1 \xe1o Nh\u1eadt B\xecnh \u0111\u01b0\u1ee3c th\u1ec3 hi\u1ec7n qua nh\u1eefng thay \u0111\u1ed5i v\u1ec1 ph\u1ee5c trang c\u1ee7a c\xe1c th\u1eddi vua. Xuy\xean su\u1ed1t l\u1ecbch s\u1eed Vi\u1ec7t Nam, ph\u1ea9m ph\u1ee5c tri\u1ec1u nghi n\u01b0\u1edbc ta t\u1eeb c\xe1c \u0111\u1eddi L\xfd \u2013  Tr\u1ea7n \u2013 L\xea \u0111\u1ebfn th\u1eddi Nguy\u1ec5n \u0111\u1ec1u x\xe2y d\u1ef1ng tr\xean c\u01a1 s\u1edf c\xf9ng c\xe1c tri\u1ec1u \u0111\u1ea1i Trung Hoa nh\u01b0 H\xe1n \u2013 \u0110\u01b0\u1eddng \u2013 T\u1ed1ng \u2013 Minh.",null,B.i,B.j,null)
B.Nw=new A.h("     \xc1o d\xe0i trong ng\xe0y c\u01b0\u1edbi  ",null,B.E,null,null)
B.Nx=new A.h("      Kho\xe1c l\xean m\xecnh chi\u1ebfc \xe1o d\xe0i tr\u1eafng nh\u01b0 nh\u1eafc nh\u1edf m\u1ed7i b\u1ea1n n\u1eef sinh ph\u1ea3i bi\u1ebft ki\u1ec1m ch\u1ebf l\u1eddi n\xf3i, h\xe0nh \u0111\u1ed9ng, b\u1ed3ng b\u1ed9t \u1edf c\xe1i tu\u1ed5i m\u1edbi l\u1edbn sao cho ph\xf9 h\u1ee3p v\u1edbi n\u1ebfp s\u1ed1ng khu\xf4n kh\u1ed5 tr\u01b0\u1eddng h\u1ecdc hay n\xe9t v\u0103n h\xf3a truy\u1ec1n th\u1ed1ng d\u1ecbu d\xe0ng c\u1ee7a ng\u01b0\u1eddi con g\xe1i Vi\u1ec7t Nam.",null,B.i,null,null)
B.Ny=new A.h("      V\u1edbi nh\u1eefng ho\u1ea1 ti\u1ebft hoa v\u0103n \u0111\u01b0\u1ee3c d\u1ec7t tr\u1ef1c ti\u1ebfp l\xean v\u1ea3i, v\u1ea3i g\u1ea5m r\u1ea5t \u0111a d\u1ea1ng v\u1ec1 m\xe0u s\u1eafc c\u0169ng nh\u01b0 thi\u1ebft k\u1ebf l\xe0m cho t\xe0 \xe1o d\xe0i lu\xf4n n\u1ed5i b\u1eadt v\xe0 s\u1eafc n\xe9t.",null,B.i,B.j,null)
B.Nz=new A.h("      V\u1ea3i chiffon kh\xe1 m\u1ecfng n\xean th\u01b0\u1eddng ph\u1ea3i may th\xeam l\u1edbp l\xf3t b\xean trong. \u0110i\u1ec1u n\xe0y s\u1ebd kh\xf4ng ti\u1ec7n \u0111\u1ed1i v\u1edbi nh\u1eefng ng\u01b0\u1eddi th\xedch m\u1eb7c k\xedn \u0111\xe1o hay s\u1eed d\u1ee5ng \u1edf nh\u1eefng bu\u1ed5i l\u1ec5 trang tr\u1ecdng.",null,B.i,B.j,null)
B.NA=new A.h("      M\u1ea5n \u0111\u1ed9i \u0111\u1ea7u",null,B.a5,null,null)
B.NB=new A.h("\xc1o Nh\u1eadt B\xecnh \u2013 Ngu\u1ed3n g\u1ed1c, \xfd ngh\u0129a, gi\xe1 tr\u1ecb l\u1ecbch s\u1eed v\xe0 v\u0103n h\xf3a",null,B.aT,null,null)
B.NC=new A.h("      NH\u1eeeNG PH\u1ee4 KI\u1ec6N \u0110I K\xc8M \xc1O D\xc0I KH\xd4NG TH\u1ec2 THI\u1ebeU",null,B.a0,null,null)
B.bg=new A.h("      a. \u01afu \u0111i\u1ec3m",null,B.a5,B.j,null)
B.ND=new A.h("      \xc1o Nh\u1eadt B\xecnh c\xe0ng v\u1ec1 sau th\xec c\xe0ng c\xf3 nhi\u1ec1u s\u1ef1 thay \u0111\u1ed5i, ch\u1ee7 y\u1ebfu l\xe0 h\u01b0\u1edbng t\u1edbi s\u1ef1 t\u1ed1i gi\u1ea3n. C\xf3 m\u1ed9t s\u1ed1 b\u1ee9c \u1ea3nh \u0111\u01b0\u1ee3c l\u01b0u l\u1ea1i cho th\u1ea5y \xe1o t\u1eeb th\u1eddi vua \u0110\u1ed3ng Kh\xe1nh tr\u1edf \u0111i \u0111\u01b0\u1ee3c t\u0129nh l\u01b0\u1ee3c \u0111i nhi\u1ec1u chi ti\u1ebft v\xe0 ph\u1ee5 ki\u1ec7n. ",null,B.i,B.j,null)
B.NE=new A.h("      V\u1ea3i tuy\u1ebft m\u01b0a l\xe0 lo\u1ea1i v\u1ea3i nh\xe2n t\u1ea1o d\u1ec7t kim \u0111\xf4i, \u0111\u01b0\u1ee3c l\u1ea5y \xfd t\u01b0\u1edfng d\u1ec7t t\u1eeb chi\u1ebfc c\u1ea7u La M\xe3 c\u1ed5 \u0111i\u1ec3n. \u0110\xe2y kh\xf4ng h\u1eb3n l\xe0 ch\u1ea5t li\u1ec7u \u0111\u01b0\u1ee3c nhi\u1ec1u b\u1ea1n s\u1eed d\u1ee5ng \u0111\u1ec3 may \xe1o d\xe0i, tuy nhi\xean v\xec v\u1ea3i c\xf3 \u0111\u1ed9 b\u1ec1n kh\xe1 cao, gi\xe1 r\u1ebb v\xe0 c\xf3 nhi\u1ec1u \u01b0u \u0111i\u1ec3m n\xean v\u1ea3i tuy\u1ebft m\u01b0a c\u0169ng l\xe0 ch\u1ea5t li\u1ec7u n\u1eb1m trong danh s\xe1ch \u01b0u ti\xean khi ch\u1ecdn may \xe1o d\xe0i.",null,B.i,null,null)
B.NF=new A.h("C\xf9ng nhau nh\u1ea3y nh\u1eefng \u0111i\u1ec7u nh\u1ea3y trong trang ph\u1ee5c \xe1o d\xe0i \u1edf \u0111\u01b0\u1eddng \u0111i b\u1ed9 g\u1ed7 lim",null,B.v,B.G,null)
B.NG=new A.h("C\xe1c b\u1ea1n g\xe1i m\u1eb7c \xe1o d\xe0i b\u01b0ng qu\u1ea3",null,B.v,B.G,null)
B.NH=new A.h("      \u01afu \u0111i\u1ec3m \u0111\u1ed1i v\u1edbi v\u1ea3i organza ch\xednh l\xe0 s\u1ef1 tho\xe1ng m\xe1t. V\u1ea3i \u0111\u01b0\u1ee3c d\u1ec7t th\u01b0a, m\u1ecfng n\xean c\xf3 r\u1ea5t nhi\u1ec1u l\u1ed7 nh\u1ecf gi\xfap ng\u01b0\u1eddi m\u1eb7c c\u1ea3m th\u1ea5y kh\xf4ng b\u1ecb b\u1ee9c b\xed c\u0169ng nh\u01b0 m\u1ed3 h\xf4i c\xf3 th\u1ec3 d\u1ec5 d\xe0ng tho\xe1t \u0111\u01b0\u1ee3c ra b\xean ngo\xe0i. V\u1ea3i c\xf3 m\xe0u s\u1eafc r\u1ea5t phong ph\xfa n\xean chi\u1ebfm tr\u1ecdn \u0111\u01b0\u1ee3c t\xecnh c\u1ea3m c\u1ee7a ch\u1ecb em khi s\u1eed d\u1ee5ng \u0111\u1ec3 may \xe1o d\xe0i.",null,B.i,B.j,null)
B.NI=new A.h("      - Nh\u1eefng chi\u1ebfc v\xf2ng \xf4m s\xe1t ph\u1ea7n c\u1ed5 \xe1o s\u1ebd l\xe0 ph\u1ee5 ki\u1ec7n cho \xe1o d\xe0i c\u1ed5 tr\xf2n gi\xfap b\u1ea1n tr\u1edf n\xean tr\u1ebb trung h\u01a1n r\u1ea5t nhi\u1ec1u. C\xf2n v\u1edbi nh\u1eefng \u01b0a th\xedch s\u1ef1 gi\u1ea3n d\u1ecb, c\u1ed5 \u0111i\u1ec3n th\xec c\xf3 th\u1ec3 l\u1ef1a ch\u1ecdn cho m\xecnh m\u1ed9t chi\u1ebfc ki\u1ec1ng b\u1ea1c ho\u1eb7c v\xe0ng \u0111\u1ec1u r\u1ea5t ph\xf9 h\u1ee3p. B\u1ea1n c\xf3 th\u1ec3 t\xecm mua c\xe1c v\xf2ng c\u1ed5 n\xe0y t\u1ea1i c\xe1c c\u1eeda h\xe0ng ph\u1ee5 ki\u1ec7n v\u1edbi m\u1ee9c gi\xe1 ph\xf9 h\u1ee3p.",null,B.i,B.j,null)
B.NJ=new A.h("      Kh\xf4ng ch\u1ec9 l\xe0 m\u1ed9t \u0111i\u1ec3m \u0111\u1ebfn trong l\u1ecbch s\u1eed, L\u0103ng Minh M\u1ea1ng c\xf2n c\xf3 nhi\u1ec1u g\xf3c ch\u1ee5p \u1ea3nh \u0111\u1eb9p ng\xe2y th\u01a1. L\u0103ng Minh M\u1ea1ng l\xe0 ng\u01b0\u1eddi ch\u1ee5p \u1ea3nh \xe1o d\xe0i \u1edf Hu\u1ebf g\xe2y \u1ea5n t\u01b0\u1ee3ng v\u1edbi l\u1ed1i ki\u1ebfn \u200b\u200btr\xfac l\u1ed1i ki\u1ebfn \u200b\u200btr\xfac c\u1ed5 k\xednh, \u0111\u1eadm \u0111\xe0 b\u1ea3n s\u1eafc Nho gi\xe1o. T\u1ed5ng th\u1ec3 ki\u1ebfn \u200b\u200btr\xfac L\u0103ng B\xe1c v\u1edbi quy m\xf4 kh\xe1 l\u1edbn bao g\u1ed3m 40 c\xf4ng tr\xecnh b\xean trong, kh\u1eafp n\u01a1i s\u1ebd l\xe0 g\xf3c check in, s\u1ed1ng \u1ea3o c\u1ef1c l\xfd t\u01b0\u1edfng v\u1edbi \xe1o d\xe0i. C\xf9ng \u0111i\u1ec3m qua m\u1ed9t s\u1ed1 g\xf3c s\u1ed1ng \u1ea3o c\u1ef1c \u0111\u1eb9p t\u1ea1i L\u0103ng nh\u01b0 c\u1ed5ng ch\xednh \u0110\u1ea1i H\u1ed3ng M\xf4n, B\xe1i \u0110\xednh (sau \u0110\u1ea1i H\u1ed3ng M\xf4n), L\u1ea7u Minh L\xe2u, khu Tam \u0110i\u1ec7n hay h\u1ed3 T\xe2n Nguy\u1ec7t,\u2026 C\xf2n ch\u1ea7n ch\u1eeb g\xec n\u1eefa, h\xe3y ch\u1ecdn cho m\xecnh m\xecnh m\u1ed9t chi\u1ebfc \xe1o d\xe0i \u0111\u1eb9p v\xe0 s\u1ea1c \u0111\u1ea7y \u0111i\u1ec7n tho\u1ea1i/m\xe1y \u1ea3nh \u0111\u1ec3 ch\u1ee5p nh\u1eefng b\u1ee9c \u1ea3nh v\u1ec1 chi\u1ebfc \xe1o d\xe0i \u0111\u1eb9p nh\u1ea5t t\u1ea1i \u0111\u1ecba \u0111i\u1ec3m ch\u1ee5p n\xe0y nh\xe9!",null,B.i,B.j,null)
B.NK=new A.h("Ho\xe0ng b\xe0o c\u1ee7a vua, m\u1eb7c l\xfac thi\u1ebft th\u01b0\u1eddng tri\u1ec1u.",null,B.v,null,null)
B.NL=new A.h("      Nh\u01b0\u1ee3c \u0111i\u1ec3m l\u1edbn nh\u1ea5t c\u1ee7a v\u1ea3i tuy\u1ebft m\u01b0a khi may \xe1o d\xe0i \u0111\xf3 ch\xednh l\xe0 \u0111\u1ed9 b\xe1m m\xe0u k\xe9m. Ch\xfang s\u1ebd r\u1ea5t d\u1ec5 ra m\xe0u n\u1ebfu nh\u01b0 b\u1ea1n kh\xf4ng bi\u1ebft c\xe1ch v\u1ec7 sinh hay b\u1ea3o qu\u1ea3n ch\xfang. V\xe0 n\u1ebfu nh\u01b0 \xe1o d\xe0i \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng li\xean t\u1ee5c th\xec c\xf3 kh\u1ea3 n\u0103ng \xe1o s\u1ebd r\u1ea5t nhanh b\u1ecb c\u0169 v\xe0 phai m\xe0u.",null,B.i,B.j,null)
B.NM=new A.h("      \xc1o Nh\u1eadt B\xecnh L\xe0 G\xec ?",null,B.a0,null,null)
B.NN=new A.h("      \xc1o d\xe0i c\u1ed5 thuy\u1ec1n l\xe0 m\u1ed9t trong nh\u1eefng m\u1eabu \xe1o d\xe0i \u0111\u01b0\u1ee3c kh\xe1 nhi\u1ec1u ng\u01b0\u1eddi l\u1ef1a ch\u1ecdn. V\u1edbi thi\u1ebft k\u1ebf tinh t\u1ebf, nh\u1eb9 nh\xe0ng che \u0111\u01b0\u1ee3c khuy\u1ebft \u0111i\u1ec3m c\u01a1 th\u1ec3, \xe1o d\xe0i c\u1ed5 thuy\u1ec1n ch\xednh l\xe0 l\u1ef1a ch\u1ecdn h\xe0ng \u0111\u1ea7u cho nh\u1eefng c\xf4 n\xe0ng c\xf3 th\xe2n h\xecnh h\u01a1i m\u0169m m\u0129m.",null,B.i,B.j,null)
B.NO=new A.h("      V\u1ea3i organza r\u1ea5t d\u1ec5 b\u1ecb x\u01b0\u1edbc ch\u1ec9 n\u1ebfu nh\u01b0 kh\xf4ng c\u1ea9n th\u1eadn \u0111\u1ec3 c\xe1c v\u1eadt nh\u1ecdn v\u01b0\u1edbng v\xe0o. V\xe0 \u0111\u01b0\u01a1ng nhi\xean \u0111\u1ed1i v\u1edbi nh\u1eefng lo\u1ea1i v\u1ea3i m\u1ecfng nh\u01b0 th\u1ebf n\xe0y th\xec c\u1ea7n thi\u1ebft ph\u1ea3i s\u1eed d\u1ee5ng l\u1edbp l\xf3t b\xean trong \u0111\u1ec3 kh\xf4ng t\u1ea1o ra s\u1ef1 ph\u1ea3n c\u1ea3m cho ng\u01b0\u1eddi \u0111\u1ed1i di\u1ec7n.",null,B.i,B.j,null)
B.NP=new A.h("      C\xe1c chi\u1ebfc \xe1o d\xe0i c\u01b0\u1edbi \u0111\u1ec1u l\u1ea5y m\xe0u s\xe0ng l\xe0m t\xf4n ch\u1ee7 \u0111\u1ea1o nh\u01b0 m\xe0u \u0111\u1ecf, m\xe0u v\xe0ng, m\xe0u h\u1ed3ng, m\xe0u tr\u1eafng. Kh\xf4ng ph\u1ea3i ng\u1eabu nhi\xean m\xe0 chi\u1ebfc \xe1o d\xe0i c\u01b0\u1edbi l\u1ea1i c\xf3 s\u1ef1 \u0111a d\u1ea1ng v\u1ec1 m\xe0u s\u1eafc nh\u01b0 th\u1ebf m\xe0 trong m\u1ed7i m\xe0u \u0111\u1ec1u mang m\u1ed9t \xfd ngh\u0129a kh\xe1c nhau. V\u1eady \xfd ngh\u0129a c\u1ee7a m\xe0u s\u1eafc d\xe0i trong ng\xe0y c\u01b0\u1edbi l\xe0 g\xec? ",null,B.i,null,null)
B.NQ=new A.h("      Th\u1eddi \u0111\u1ea1i hi\u1ec7n nay, nhi\u1ec1u nh\xe0 may t\u1ea1i c\xe1c th\xe0nh ph\u1ed1 l\u1edbn chuy\xean may, b\xe1n v\xe0 cho thu\xea \xe1o Nh\u1eadt B\xecnh. Nh\u1eefng h\xecnh \u1ea3nh c\u1ed5 ph\u1ee5c Vi\u1ec7t Nam ng\xe0y c\xe0ng g\u1ea7n h\u01a1n v\u1edbi th\u1ebf h\u1ec7 tr\u1ebb \u0111\u1ec3 c\xf3 th\u1ec3 gi\u1eef g\xecn nh\u1eefng n\xe9t \u0111\u1eb9p v\u0103n h\xf3a d\xe2n t\u1ed9c.",null,B.i,B.j,null)
B.NR=new A.h("      \u0110\u1ec3 b\u1ed9 trang ph\u1ee5c th\xeam ph\u1ea7n sang tr\u1ecdng, thanh l\u1ecbch, ph\u1ee5 ki\u1ec7n \u0111i k\xe8m \xe1o d\xe0i kh\xf4ng th\u1ec3 b\u1ecf qua \u0111o\u0301 la\u0300 nh\u1eefng \u0111\xf4i gi\xe0y \u0111i k\xe8m. M\u1ed7i m\u1ed9t thi\u1ebft k\u1ebf hay ki\u1ec3u d\xe1ng \xe1o d\xe0i l\u1ea1i mang \u0111\u1ebfn cho b\u1ea1n l\u1ef1a ch\u1ecdn gi\xe0y d\xe9p kh\xe1c nhau.",null,B.i,B.j,null)
B.NS=new A.h("Long c\u1ed5n c\u1ee7a vua, m\u1eb7c l\xfac t\u1ebf Nam giao.",null,B.v,null,null)
B.NT=new A.h("      Xem video \u0111\u1ec3 t\xecm hi\u1ec3u th\xeam v\u1ec1 \xc1o Nh\u1eadt B\xecnh:",null,B.i,null,null)
B.NU=new A.h("      N\u1ebfu ch\u1ec9 m\u1eb7c m\u1ed9t ch\xfat th\xec b\u1ea1n c\xf3 th\u1ec3 thu\xea, n\u1ebfu mu\u1ed1n s\u1edf h\u1eefu trong t\u1ee7 \u0111\u1ed3 c\u1ee7a m\xecnh chi\u1ebfc \xe1o d\xe0i th\xec b\u1ea1n c\xf3 th\u1ec3 may ho\u1eb7c mua t\u1ea1i shop. C\xe1c th\u1ee3 may \xe1o d\xe0i Hu\u1ebf  th\u01b0\u1eddng s\u1ebd ch\xfa t\xe2m v\u1ec1 ph\u1ea7n \u0111\u01b0\u1eddng vi\u1ec1n t\xe0. Kh\xe1c v\u1edbi nh\u1eefng n\u01a1i kh\xe1c, ch\u1ec9 kh\xe2u m\xe9p vi\u1ec1n quanh t\xe0 \xe1o s\u1ebd \u0111\u01b0\u1ee3c r\xfat t\u1eeb m\u1ea3nh v\u1ea3i c\u1ee7a chi\u1ebfc \xe1o \u0111\xf3. V\xec th\u1ebf n\xean r\u1ea5t \u0111\u1ed3ng \u0111i\u1ec7u, khi m\u1eb7c l\xean ng\u01b0\u1eddi, t\xe0 \xe1o r\u1ea5t bay v\xe0 kh\xf4ng h\u1ec1 l\u1ed9 ch\u1ec9 hay \u0111\u01b0\u1eddng may. C\u0169ng ch\xednh v\xec th\u1ebf m\xe0 \xe1o d\xe0i \u0111\xe3 tr\u1edf th\xe0nh m\u1ed9t s\u1ea3n ph\u1ea9m du l\u1ecbch Hu\u1ebf, khi\u1ebfn nhi\u1ec1u du kh\xe1ch gh\xe9 \u0111\u1ebfn \u0111\u1ec1u mu\u1ed1n s\u1edf h\u1eefu. ",null,B.i,B.j,null)
