B.NW=new A.h(u.k,null,B.aE,B.j,null)
B.NX=new A.h("      \xc1o ng\u0169 th\xe2n c\xf3 n\u0103m n\xfat, 5 n\xfat n\xe0y l\xe0 nh\u1eb1m t\u01b0\u1ee3ng tr\u01b0ng cho ng\u0169 th\u01b0\u1eddng (nh\xe2n \u2013 ngh\u0129a \u2013 l\u1ec5 \u2013 tr\xed \u2013 t\xedn) v\xe0 ng\u0169 lu\xe2n (qu\xe2n th\u1ea7n: vua \u2013 t\xf4i, ph\u1ee5 t\u1eed: cha \u2013 con, phu ph\u1ee5: ch\u1ed3ng \u2013 v\u1ee3, huynh \u0111\u1ec7: anh \u2013 em, b\u1eb1ng h\u1eefu: b\u1ea1n b\xe8).     ",null,B.i,B.j,null)
B.NY=new A.h("\xc1o \u0111o\xe0n loan nh\u1eadt b\xecnh c\u1ee7a c\xf4ng ch\xfaa.",null,B.v,null,null)
B.NZ=new A.h("      Tr\u01b0\u1eddng Qu\u1ed1c h\u1ecdc Hu\u1ebf \u2013 n\u01a1i th\xedch h\u1ee3p \u0111\u1ec3 ch\u1ee5p \u1ea3nh \xe1o d\xe0i tr\u1eafng ",null,B.E,null,null)
B.O_=new A.h("      Tuy nhi\xean, nh\u01b0 ch\xfang t\xf4i \u0111\xe3 n\xf3i \u1edf tr\xean, Phi Phong kh\xf4ng c\xf3 s\u1ef1 quy \u0111i\u0323nh ro\u0303 r\xe0ng v\xea\u0300 ti\xeau chu\xe2\u0309n may m\u0103\u0323c c\u01a1 ba\u0309n. V\xec v\u1eady, ng\u01b0\u1eddi ta c\xf3 th\u1ec3 bi\u1ebfn t\u1ea5u vi\u1ec1n c\u1ed5, pha tay ng\u0169 s\u1eafc,\u2026\u0111\u1ec1u \u0111\u01b0\u1ee3c.",null,B.i,B.j,null)
B.O0=new A.h("      V\u1ea3i nhung l\xe0 m\u1ed9t trong nh\u1eefng ch\u1ea5t li\u1ec7u \u0111\u01b0\u1ee3c ng\u01b0\u1eddi l\u1edbn tu\u1ed5i th\u01b0\u1eddng ch\u1ecdn \u0111\u1ec3 may \xe1o d\xe0i. B\u1edfi ch\u1ea5t li\u1ec7u gi\xfap ng\u01b0\u1eddi m\u1eb7c \u0111\u01b0\u1ee3c ch\u1eefng ch\u1ea1c h\u01a1n. V\u1ea3i nhung c\xf3 b\u1ec1 m\u1eb7t m\u1ecbn, t\xf4n l\xean \u0111\u01b0\u1ee3c v\u1ebb \u0111\u1eb9p ti\u1ec1m \u1ea9n c\u1ee7a ng\u01b0\u1eddi m\u1eb7c",null,B.i,null,null)
B.O1=new A.h("     5. V\u1ea3i \u0111\u0169i",null,B.E,null,null)
B.O2=new A.h("      T\u1eebng chi ti\u1ebft c\u1ee7a \xc1o Nh\u1eadt B\xecnh \u0111\u01b0\u1ee3c thi\u1ebft k\u1ebf r\u1ea5t ch\u1ec9nh chu, t\u1ec9 m\u1ec9. C\xe1c h\u1ecda ti\u1ebft hoa v\u0103n s\u1eafc s\u1ea3o v\xe0 tinh t\u1ebf, to\xe1t l\xean v\u1ebb \u0111\u1eb9p trang nh\xe3 v\xe0 qu\xfd ph\xe1i khi m\u1eb7c. Ch\xfang \u0111\u01b0\u1ee3c chia th\xe0nh nhi\u1ec1u lo\u1ea1i, ch\u1ea5t li\u1ec7u v\u1ea3i, ki\u1ec3u d\xe1ng, h\u1ecda ti\u1ebft,\u2026kh\xe1c nhau \u0111\u1ec3 ph\xe2n bi\u1ec7t \u0111\u01b0\u1ee3c c\u1ea5p b\u1eadc.",null,B.i,B.j,null)
B.O3=new A.h("      V\u1ea3i voan c\xf3 \u0111\u1eb7c \u0111i\u1ec3m nh\u1eadn d\u1ea1ng t\u01b0\u01a1ng t\u1ef1 nh\u01b0 v\u1ea3i chiffon, tuy nhi\xean v\u1ea3i voan ho\xe0n to\xe0n \u0111\u01b0\u1ee3c d\u1ec7t t\u1eeb s\u1ee3i t\u1ed5ng h\u1ee3p. Voan c\u0169ng m\u1ecfng v\xe0 nh\u1eb9 t\u1ea1o \u0111\u01b0\u1ee3c s\u1ef1 m\u1ec1m m\u1ea1i th\u01b0\u1edbt tha cho t\xe0 \xe1o d\xe0i. Nh\u1eefng ch\u1ecb em ph\u1ee5 n\u1eef n\xe0o th\xedch s\u1ef1 \u0111\u1eb1m th\u1eafm v\xe0 nh\u1eb9 nh\xe0ng th\xec v\u1ea3i voan s\u1ebd l\xe0 m\u1ed9t s\u1ef1 l\u1ef1a ch\u1ecdn s\xe1ng gi\xe1.",null,B.i,null,null)
B.O4=new A.h("Th\u1eddi gian may m\u1ed9t chi\u1ebfc \xe1o d\xe0i c\u1ee7a ti\u1ec7m k\xe9o d\xe0i t\u1eeb 2-3 tu\u1ea7n, trong tr\u01b0\u1eddng h\u1ee3p b\u1ea1n mu\u1ed1n l\u1ea5y g\u1ea5p th\xec anh ch\u1ee7 c\u0169ng... kh\xf4ng \u0111\u1ed3ng \xfd. M\u1eb7c d\xf9 kh\xf4ng th\u1ec3 \u201cmay ph\xe1t l\u1ea5y li\u1ec1n,\u201d nh\u01b0ng b\u1ea1n c\xf3 th\u1ec3 \u0111\u1ec3 l\u1ea1i \u0111\u1ecba ch\u1ec9, khi may xong, ti\u1ec7m s\u1ebd g\u1eedi chuy\u1ec3n ph\xe1t nhanh \u0111\u1ebfn cho b\u1ea1n.",null,B.v,B.G,null)
B.O5=new A.h("      L\xe0 m\u1ed9t ch\u1ea5t li\u1ec7u \u0111\u01b0\u1ee3c d\u1ec7t theo nhi\u1ec1u ph\u01b0\u01a1ng ph\xe1p, c\u0169ng nh\u01b0 nhi\u1ec1u ch\u1ea5t li\u1ec7u kh\xe1c nhau. V\u1ea3i ren c\xf3 nh\u1eefng l\u1ed5 h\u1ed5ng nh\u1ecf v\xe0 nh\u1eefng h\xecnh hoa v\u0103n kh\xe1c nhau tr\xean b\u1ec1 m\u1eb7t gi\xfap cho ch\u1ea5t li\u1ec7u \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi \u01b0a chu\u1ed9ng b\u1edfi s\u1ef1 kh\xe1c l\u1ea1 c\u1ee7a n\xf3. V\u1ea3i ren th\u01b0\u1eddng \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi s\u1eed d\u1ee5ng \u0111\u1ec3 may \xe1o d\xe0i trong c\xe1c d\u1ecbp l\u1ec5 h\u1ecfi, c\u01b0\u1edbi hay nh\u1eefng l\u1ec5 h\u1ed9i quan tr\u1ecdng.",null,B.i,null,null)
B.cz=new A.o(!0,null,null,null,null,null,14,B.aW,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.O6=new A.h("\xc1o d\xe0i Ng\u0169 Th\xe2n",null,B.cz,null,null)
B.O7=new A.h("      B\u1ec1 m\u1eb7t v\u1ea3i m\u1ec1m m\u1ecbn n\xean s\u1ebd kh\xf4ng g\xe2y ra nh\u1eefng c\u1ea3m gi\xe1c th\xf4 r\xe1p hay kh\xf3 ch\u1ecbu khi s\u1eed d\u1ee5ng. Ngo\xe0i ra ch\xfang c\u0169ng kh\xe1 ph\xf9 h\u1ee3p v\u1edbi nhi\u1ec1u l\xe0n da.",null,B.i,B.j,null)
B.O8=new A.h("      \u0110\u01b0\u1ee3c l\u1ea5y t\u1eeb nh\u1eefng nguy\xean li\u1ec7u thi\xean nhi\xean n\xean v\u1ea3i \u0111\u0169i r\u1ea5t th\xe2n thi\xean v\u1edbi m\xf4i tr\u01b0\u1eddng. V\xe0 c\xf2n l\xe0 ch\u1ea5t li\u1ec7u th\xedch h\u1ee3p m\xe0 \u0111\u1ed1i v\u1edbi lo\u1ea1i da n\xe0o c\u0169ng c\xf3 th\u1ec3 s\u1eed d\u1ee5ng. V\u1ea3i \u0111\u0169i c\xf2n c\xf3 \u0111\u1ed9 tho\xe1ng m\xe1t v\xe0 h\xfat \u1ea9m r\u1ea5t cao, \u0111\xe2y l\xe0 l\u1ee3i th\u1ebf khi s\u1eed d\u1ee5ng v\u1ea3i \u0111\u0169i may \xe1o d\xe0i v\xe0o m\xf9a h\xe8.",null,B.i,B.j,null)
B.O9=new A.h("     \u0110\u1eb7c \u0111i\u1ec3m, \xfd ngh\u0129a c\u1ee7a \xe1o ng\u0169 th\xe2n",null,B.E,B.bE,null)
B.Oa=new A.h("      C\u1ea3nh \u0111\u1eb9p nh\u01b0 trong phim H\xe0n l\xe0m bao tr\xe1i tim xao xuy\u1ebfn. V\xe0o nh\u1eefng ng\xe0y n\u1eafng \u0111\u1eb9p, \u0111\u1ed3i Thi\xean An hi\u1ec7n l\xean nh\u01b0 m\u1ed9t n\xe0ng ti\xean trong truy\u1ec7n c\u1ed5 t\xedch.",null,B.i,B.j,null)
B.Ob=new A.h("      Hoa c\xe0i \u0111\u1ea7u",null,B.a0,null,null)
B.Oc=new A.h("     \xc1o d\xe0i \u0111\xf3n T\u1ebft \u2013  \u0111\xe1nh th\u1ee9c ni\u1ec1m t\u1ef1 h\xe0o t\u1ef1 t\xf4n d\xe2n t\u1ed9c:  ",null,B.E,null,null)
B.Od=new A.h("      N\u1eb1m tr\xean \u0111\u01b0\u1eddng Mai Th\xfac Loan, m\u1ed9t tuy\u1ebfn \u0111\u01b0\u1eddng t\u1ea5p n\u1eadp, t\u1eadp trung kh\xe1 nhi\u1ec1u ti\u1ec7m \xe1o d\xe0i Hu\u1ebf, nh\u01b0ng d\u1eabu v\u1eady, H\xf9ng v\u1eabn l\xe0 m\u1ed9t \u0111\u1ecba ch\u1ec9 uy t\xedn \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi t\xecm \u0111\u1ebfn b\u1edfi kinh nghi\u1ec7m cha truy\u1ec1n con n\u1ed1i. T\u1eeb l\xfac ba ch\xfa H\xf9ng m\u1edf ti\u1ec7m t\u1edbi \u0111\u1eddi ch\xfa ti\u1ebfp qu\u1ea3n c\u0169ng \u0111\xe3 ng\xf3t ngh\xe9t h\u01a1n 50 n\u0103m.",null,B.i,null,null)
