B.Og=new A.h("      \u0110\u1ecba ch\u1ec9: 35 Mai Th\xfac Loan, Ph\u01b0\u1eddng Thu\u1eadn Th\xe0nh, Th\xe0nh ph\u1ed1 Hu\u1ebf ",null,B.i,null,null)
B.Oh=new A.h("   Trang ch\u1ee7",null,B.bf,null,null)
B.Oi=new A.h("      N\u1ebfu s\u1eed d\u1ee5ng v\xe0o nh\u1eefng ng\xe0y tr\u1eddi n\u1eafng c\xf3 nhi\u1ec7t \u0111\u1ed9 cao th\xec c\xf3 l\u1ebd v\u1ea3i s\u1ebd h\u01a1i d\xe0y. \u0110i\u1ec1u n\xe0y l\xe0m cho ng\u01b0\u1eddi m\u1eb7c s\u1ebd c\u1ea3m th\u1ea5y b\xed b\xe1ch. V\u1ea3i g\u1ea5m gi\u1eb7t c\u0169ng s\u1ebd kh\xf3 kh\xf4 h\u01a1n l\u1ee5a n\xean kh\xf4ng \u0111\u01b0\u1ee3c ph\u01a1i \xe1o d\xe0i \u1edf nh\u1eefng n\u01a1i kh\xf4ng c\xf3 n\u1eafng hay nh\u1eefng n\u01a1i c\xf3 \u0111\u1ed9 \u1ea9m cao.",null,B.i,B.j,null)
B.Oj=new A.h("      - N\u1ebfu c\xf3 \u0111i\u1ec1u ki\u1ec7n th\xec \u0111\u1eebng ng\u1ea7n ng\u1ea1i l\u1ef1a ch\u1ecdn cho m\xecnh m\u1ed9t chi\u1ebfc t\xfai x\xe1ch h\xe0ng hi\u1ec7u \u0111\u1ec3 to\xe1t l\xean v\u1ebb \u0111\u1eb3ng c\u1ea5p v\xe0 sang tr\u1ecdng nh\u01b0 fashionista ch\xednh hi\u1ec7u. Ch\u1eafc ch\u1eafn n\xf3 s\u1ebd mang \u0111\u1ebfn cho b\u1ea1n nh\u1eefng h\xecnh \u1ea3nh kh\xe1c bi\u1ec7t v\xe0 thu h\xfat \u0111\u01b0\u1ee3c m\u1ecdi \xe1nh nh\xecn \u0111\u1ea5y!",null,B.i,B.j,null)
B.Ok=new A.h("      - B\u1ea1n c\xf3 th\u1ec3 l\u1ef1a ch\u1ecdn cho m\xecnh b\u1ea5t c\u1ee9 ph\u1ee5 n\u1eef n\xe0o m\xecnh y\xeau th\xedch, ch\u1ec9 c\u1ea7n ch\xfang ph\xf9 h\u1ee3p v\u1edbi m\xe0u s\u1eafc v\xe0 ki\u1ec3u d\xe1ng c\u1ee7a chi\u1ebfc \xe1o d\xe0i nh\u01b0 \u0111\u1ed3ng h\u1ed3, t\xfai x\xe1ch, m\u1ea5n, b\u0103ng \u0111\xf4, v\xf2ng c\u1ed5\u2026",null,B.i,B.j,null)
B.Ol=new A.h("So s\xe1nh \xe1o tay ch\u1ebdn v\xe0 \xe1o T\u1ea5c",null,B.v,null,null)
B.Om=new A.h("      Long b\xe0o ho\xe0ng \u0111\u1ebf, Ho\xe0ng b\xe0o ho\xe0ng h\u1eadu, M\xe3ng b\xe0o ho\xe0ng t\u1eed\u2026, l\xe0 nh\u1eefng trang ph\u1ee5c cung \u0111\xecnh nh\xe0 Nguy\u1ec5n \u0111\u01b0\u1ee3c ph\u1ee5c ch\u1ebf, \u0111ang tr\u01b0ng b\xe0y t\u1ea1i \u0111i\u1ec7n Long An.",null,B.i,B.j,null)
B.On=new A.h("     \u0110\xf4i n\xe9t v\u1ec1 chi\u1ebfc \xe1o d\xe0i Vi\u1ec7t Nam: ",null,B.E,null,null)
B.Oo=new A.h("      Khi m\u1eb7c \xe1o ng\u0169 th\xe2n l\xe0 mang tr\xean m\xecnh \u0111\u1ea1o l\xe0m ng\u01b0\u1eddi, kh\xf4ng \u0111\u01b0\u1ee3c l\xe0m tr\xe1i v\u1edbi lu\xe2n th\u01b0\u1eddng \u0111\u1ea1o l\xfd.     ",null,B.i,B.j,null)
B.Op=new A.h("      \u0110\xe2y l\xe0 m\u1ed9t tri\u1ec1u ph\u1ee5c n\xean trong c\xe1ch m\u1eb7c s\u1ebd c\xf3 s\u1ef1 ph\xe2n bi\u1ec7t th\u1ee9 b\u1eadc. C\xe1c th\u1ee9 b\u1eadc n\xe0y c\u0103n c\u1ee9 v\xe0o \u0111\u1ecba v\u1ecb c\u1ee7a ng\u01b0\u1eddi \u0111\xf3 trong tri\u1ec1u ho\u1eb7c d\u1ef1a v\xe0o ph\u1ea9m c\u1ea5p c\u1ee7a ch\u1ed3ng. Kh\xe2m \u0110\u1ecbnh \u0110\u1ea1i Nam h\u1ed9i \u0111i\u1ec3n s\u1ef1 l\u1ec7 \u0111\xe3 ghi ch\xe9p v\u1ec1 \xe1o Nh\u1eadt B\xecnh \u2013 ph\xe2n theo th\u1ee9 b\u1eadc sau:",null,B.i,B.j,null)
B.Oq=new A.h("Long c\u1ed5n c\u1ee7a vua, m\u1eb7c l\xfac t\u1ebf l\u1ec5 \u1edf c\xe1c mi\u1ebfu.",null,B.v,B.G,null)
B.Or=new A.h("      Gi\xe0y d\xe9p",null,B.a0,null,null)
B.Os=new A.h("Ph\u01b0\u1ee3ng b\xe0o c\u1ee7a ho\xe0ng h\u1eadu, m\u1eb7c l\xfac thi\u1ebft \u0111\u1ea1i tri\u1ec1u.",null,B.v,null,null)
B.Ot=new A.h("      \xc1o d\xe0i kh\xf4ng ch\u1ec9 gi\xfap h\xecnh t\u01b0\u1ee3ng ng\u01b0\u1eddi con g\xe1i \u0111\u01b0\u1ee3c gi\u1eef m\xe3i trong n\xe9t duy\xean d\xe1ng, \u0111\u1eb1m th\u1eafm. M\xe0 c\xf2n l\xe0 trang ph\u1ee5c truy\u1ec1n th\u1ed1ng g\u1eafn b\xf3 v\u1edbi v\u0103n h\xf3a d\xe2n t\u1ed9c n\xf3i chung v\xe0 \u0111\u1eddi s\u1ed1ng ng\u01b0\u1eddi d\xe2n x\u1ee9 Hu\u1ebf n\xf3i ri\xeang. C\u0169ng ch\xednh v\xec th\u1ebf m\xe0 trong bao nhi\xeau k\u1ef3 Festival t\xe0 \xe1o d\xe0i v\u1eabn g\u1eafn b\xf3 m\xe3i. \u0110\u1eb7c bi\u1ec7t l\xe0 Festival Hu\u1ebf n\u0103m 2018 v\u1edbi ch\u1ee7 \u0111\u1ec1 \u201cHu\u1ebf v\xe0ng son\u201d. \u0110\xe3 \u0111\u1ec3 l\u1ea1i nhi\u1ec1u c\u1ea3m x\xfac trong l\xf2ng ng\u01b0\u1eddi d\xe2n Hu\u1ebf c\u0169ng nh\u01b0 nh\u1eefng du kh\xe1ch khi \u0111\u01b0\u1ee3c ch\u1ee9ng ki\u1ebfn s\u1ef1 bi\u1ec3u di\u1ec5n c\u1ee7a h\u01a1n 400 m\u1eabu \xe1o d\xe0i tinh x\u1ea3o. ",null,B.i,B.j,null)
B.Ou=new A.h("      \xc1o Nh\u1eadt B\xecnh c\u1ee7a Ho\xe0ng H\u1eadu",null,B.a5,null,null)
B.Ov=new A.h("      Ch\u1ea5t li\u1ec7u c\u1ee7a \xe1o nh\u1eadt b\xecnh",null,B.a0,null,null)
B.Ow=new A.h("Trang Ph\u1ee5c Cung \u0110\xecnh Tri\u1ec1u Nguy\u1ec5n",null,B.cz,null,null)
B.Ox=new A.h("M\u1eabu \xe1o d\xe0i ng\u0169 th\xe2n n\u1eef",null,B.v,null,null)
B.Oy=new A.h("      \u0110\u1eb7c bi\u1ec7t, ch\xf9a n\u1ed5i b\u1eadt v\u1edbi th\xe1p mang t\xean Ph\u01b0\u1edbc Duy\xean, s\u1eebng nh\xecn ra m\u1eb7t n\u01b0\u1edbc H\u01b0\u01a1ng Giang. N\u1ed5i b\u1eadt gi\u1eefa kh\xf4ng gian c\xe2y c\u1ed1i xanh t\u01b0\u01a1i l\xe0 ng\xf4i th\xe1p c\xf3 ki\u1ebfn \u200b\u200btr\xfac \u0111\u1ed9c \u0111\xe1o, th\xe1p 7 t\u1ea7ng cao 21m do \u0111\xedch th\xe2n vua Thi\u1ec7u Tr\u1ecb thi\u1ebft k\u1ebf. T\u1ea1i \u0111\xe2y, b\u1ea1n c\xf3 th\u1ec3 ch\u1ee5p to\xe0n b\u1ed9 khung \u1ea3nh t\u1eeb ch\xe2n th\xe1p l\xean th\xe1p \u0111\u1ec3 b\u1ee9c \u1ea3nh t\u1ed5ng th\u1ec3 \u0111\u01b0\u1ee3c nguy\xean v\u1eb9n v\xe0 \u0111\u1eb9p nh\u1ea5t.",null,B.i,B.j,null)
B.Oz=new A.h(u.W,null,B.aT,null,null)
B.OA=new A.h("      Ph\u1ee5 ki\u1ec7n \u0111i k\xe8m v\u1edbi \xe1o d\xe0i, \u0111\u1eb7c bi\u1ec7t l\xe0 \xe1o d\xe0i c\xe1ch t\xe2n ch\xednh l\xe0 nh\u1eefng chi\u1ebfc v\xf2ng tay, \u0111\u1ed3ng h\u1ed3 s\xe0nh \u0111i\u1ec7u. C\u0169ng b\u1edfi, nh\u1eefng m\u1eabu \xe1o d\xe0i c\xe1ch t\xe2n hi\u1ec7n nay \u0111\u1ec1u \u0111\u01b0\u1ee3c thi\u1ebft k\u1ebf ki\u1ec3u tay l\u1eedng n\xean vi\u1ec7c l\u1ef1a ch\u1ecdn nh\u1eefng chi\u1ebfc v\xf2ng tay \u0111i\u1ec7u \u0111\xe0 s\u1ebd r\u1ea5t ph\xf9 h\u1ee3p.",null,B.i,B.j,null)
B.OB=new A.h("      \xc1o d\xe0i \u0111\u01b0\u1ee3c thi\u1ebft k\u1ec1 v\u1eeba v\u1eb7n theo t\u1ec9 l\u1ec7 c\u01a1 th\u1ec3 c\u1ee7a t\u1eebng ng\u01b0\u1eddi, nh\u1eb1m t\xf4n vinh l\xean n\xe9t \u0111\u1eb9p \u0111\u01b0\u1eddng cong c\u1ee7a ng\u01b0\u1eddi con g\xe1i Vi\u1ec7t Nam. Ph\u1ea7n th\xe2n \xe1o bao g\u1ed3m th\xe2n tr\u01b0\u1edbc v\xe0 sau, \u0111\u01b0\u1ee3c thi\u1ebft k\u1ebf theo chi\u1ec1u d\xe0i t\u1eeb b\u1ea3 vai xu\u1ed1ng \u0111\u1ebfn m\u1eafc c\xe1 ch\xe2n, \u1edf ph\u1ea7n h\xf4ng \u0111\u01b0\u1ee3c x\u1ebb d\u1ecdc t\u1eeb eo d\xe0i \u0111\u1ebfn h\u1ebft t\xe0 \xe1o v\u1eeba g\u1ee3i c\u1ea3m, quy\u1ebfn r\u1ee7, v\u1eeba k\xedn \u0111\xe1o trang nh\xe3. \xc1o \u0111\u01b0\u1ee3c m\u1eb7c k\xe8m m\u1eb7c k\u1ebft h\u1ee3p v\u1edbi chi\u1ebfc qu\u1ea7n c\xf3 \u0111\u1ed9 d\xe0i \u0111\u1ebfn ch\u1ea5m g\xf3t ch\xe2n, ph\u1ea7n \u1ed1ng qu\u1ea7n kh\xe1 r\u1ed9ng \u0111\u01b0\u1ee3c t\u1ea1o ra b\u1eb1ng nh\u1eefng lo\u1ea1i v\u1ea3i m\u1ec1m, v\u1ea3i l\u1ee5a.",null,B.i,null,null)
B.OC=new A.h("   Trang ch\u1ee7 > L\u1ecbch s\u1eed \xe1o d\xe0i",null,B.bf,null,null)
B.OD=new A.h("B\xe0i vi\u1ebft m\u1edbi nh\u1ea5t",null,B.E,null,null)
B.OE=new A.h("      Tu\u1ea7n l\u1ec5 \xc1o d\xe0i c\u1ed9ng \u0111\u1ed3ng Hu\u1ebf c\u0169ng s\u1ebd di\u1ec5n ra h\u1ed9i th\u1ea3o v\u1edbi ch\u1ee7 \u0111\u1ec1 \u201cH\u01b0\u1edbng ph\xe1t tri\u1ec3n c\u1ee7a \xc1o d\xe0i Hu\u1ebf trong \u0111\u1eddi s\u1ed1ng \u0111\u01b0\u01a1ng \u0111\u1ea1i\u201d. H\u1ed9i th\u1ea3o s\u1ebd c\xf3 s\u1ef1 tham d\u1ef1 c\u1ee7a nh\u1eefng chuy\xean gia, nh\xe0 nghi\xean c\u1ee9u, nh\xe0 thi\u1ebft k\u1ebf, ngh\u1ec7 nh\xe2n c\xf3 uy t\xedn nh\u1eb1m \u0111\u1ec1 xu\u1ea5t nh\u1eefng gi\u1ea3i ph\xe1p, h\u01b0\u1edbng \u0111i cho vi\u1ec7c ph\xe1t tri\u1ec3n \xe1o d\xe0i Hu\u1ebf trong \u0111\u1eddi s\u1ed1ng \u0111\u01b0\u01a1ng \u0111\u1ea1i t\u1ea1i S\u1edf V\u0103n h\xf3a v\xe0 Th\u1ec3 thao.",null,B.i,B.j,null)
B.OF=new A.h("\xc1o d\xe0i ng\u0169 th\xe2n tay ch\u1ebdn d\u1ea7n tr\u1edf th\xe0nh xu h\u01b0\u1edbng c\u1ee7a th\u1eddi \u0111\u1ea1i m\u1edbi",null,B.v,null,null)
B.OG=new A.h("      V\u1ea3i nhung th\xedch h\u1ee3p s\u1eed d\u1ee5ng v\xe0o m\xf9a thu h\u01a1n, v\xf9 ch\xfang c\xf3 kh\u1ea3 n\u0103ng gi\u1eef nhi\u1ec7t cao h\u01a1n c\xe1c lo\u1ea1i v\u1ea3i kh\xe1c. Ch\xednh v\xec v\u1eady, v\xe0o m\xf9a h\xe8 b\u1ea1n kh\xf4ng n\xean ch\u1ecdn v\u1ea3i nhung \u0111\u1ec3 may \xe1o d\xe0i.",null,B.i,B.j,null)
B.OH=new A.h("      V\xe0o nh\u1eefng d\u1ecbp khai tr\u01b0\u01a1ng c\xf4ng ty/ doanh nghi\u1ec7p c\u0169ng l\xe0 th\u1eddi \u0111i\u1ec3m l\xfd t\u01b0\u1edfng \u0111\u1ec3 b\u1ea1n di\u1ec7n v\xe0o b\u1ed9 \xe1o d\xe0i thi\u1ebft tha thu h\xfat m\u1ecdi \xe1nh nh\xecn. Vi\u1ec7c d\xf9ng trang ph\u1ee5c \xe1o d\xe0i v\xe0o c\xe1c ng\xe0y quan tr\u1ecdng n\xe0y s\u1ebd gi\xfap b\u1ea1n t\u1ea1o n\xean \u1ea5n t\u01b0\u1ee3ng t\u1ed1t \u0111\u1eb9p cho \u0111\u1ed1i t\xe1c ho\u1eb7c kh\xe1ch h\xe0ng c\u1ee7a m\xecnh. M\u1ed9t chi\u1ebfc \xe1o d\xe0i v\u1edbi m\xe0u n\u1ec1n n\xe3 nh\u1eb9 nh\xe0ng \u0111i\u1ec3m th\xeam v\xe0i n\xe9t hoa v\u0103n hoa sen, n\xfai non ho\u1eb7c ho\u1ea1t ti\u1ebft hoa v\u0103n li ti c\u0169ng l\xe0 m\u1ed9t l\u1ef1a ch\u1ecdn r\u1ea5t \u0111\xe1ng c\xe2n nh\u1eafc ph\u1ea3i kh\xf4ng n\xe0o.",null,B.i,null,null)
B.OI=new A.h("      Nh\u0103\u0301c t\u01a1\u0301i ph\u1ee5 ki\u1ec7n \xe1o d\xe0i thi\u0300 ch\u1eafc ch\u1eafn kh\xf4ng th\u1ec3 n\xe0o b\u1ecf qua nh\u1eefng chi\u1ebfc t\xfai x\xe1ch. N\xf3 \u0111\u01b0\u1ee3c xem l\xe0 m\u1ed9t \u201cv\u0169 kh\xed\u201d l\u1ee3i h\u1ea1i c\u1ee7a h\u1ea7u h\u1ebft c\xe1c ch\u1ecb em ph\u1ee5 n\u1eef. Tuy nhi\xean \u0111\u1ec3 ph\xf9 h\u1ee3p v\u1edbi \xe1o d\xe0i, b\u1ea1n n\xean l\u1ef1a ch\u1ecdn nh\u1eefng chi\u1ebfc t\xfai c\xf3 m\xe0u s\u1eafc v\xe0 h\u1ecda ti\u1ebft \u0111\u1ed3ng nh\u1ea5t \u0111\u1ec3 kh\xf4ng b\u1ecb \u2018l\u1ea1c qu\u1ebb\u201d.",null,B.i,B.j,null)
B.OJ=new A.h("      Ki\u1ec3u d\xe1ng, k\u1ebft c\u1ea5u \xe1o c\xf3 c\xf4ng n\u0103ng s\u1eed d\u1ee5ng cao, mang t\u1edbi cho ng\u01b0\u1eddi \u0111\xe0n \xf4ng c\xf3 phong th\xe1i \u0111\u0129nh \u0111\u1ea1c, oai phong. V\u1edbi n\u1eef th\xec t\xf4n d\xe1ng, che khuy\u1ebft \u0111i\u1ec3m c\u01a1 th\u1ec3. Tuy nhi\xean, c\xe1ch may \xe1o ng\u0169 th\xe2n r\u1ea5t k\u1ef3 c\xf4ng, h\u01a1n n\u1eefa gi\xe1 th\xe0nh l\u1ea1i cao h\u01a1n so v\u1edbi nh\u1eefng m\u1eabu \xe1o d\xe0i th\xf4ng th\u01b0\u1eddng.",null,B.i,B.j,null)
B.OL=new A.h("Ch\xfa H\xf9ng h\u1ecdc ngh\u1ec1 t\u1eeb cha m\xecnh. T\u1edbi nay, ch\xfa may \xe1o d\xe0i c\u0169ng \u0111\xe3 tr\xean 25 n\u0103m kinh nghi\u1ec7m",null,B.v,B.G,null)
B.OM=new A.h("      Vi\u1ec7t Nam \u2013 m\u1ed9t \u0111\u1ea5t n\u01b0\u1edbc v\u1edbi b\u1ec1 d\xe0y l\u1ecbch s\u1eed h\xf9ng v\u0129 qua nhi\u1ec1u n\u0103m th\u0103ng tr\u1ea7m. Ng\xe0y nay \u0111\u1ea5t n\u01b0\u1edbc ch\xfang ta \u0111\u01b0\u1ee3c thi\xean nhi\xean \u01b0u \u0111\xe3i ban t\u1eb7ng d\u1ea3i \u0111\u1ea5t tr\xf9 ph\xfa t\u01b0\u01a1i t\u1ed1t. V\xe0 c\xf3 m\u1ed9t \u0111i\u1ec1u khi nh\u1eafc \u0111\u1ebfn \u0111\u1ea5t n\u01b0\u1edbc h\xecnh ch\u1eef S m\xe0 b\u1ea1n kh\xf4ng th\u1ec3 b\u1ecf qua \u0111\xf3 ch\xednh l\xe0 chi\u1ebfc \xe1o d\xe0i, m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng \u0111\u1eb7c tr\u01b0ng d\xe0nh cho ng\u01b0\u1eddi Ph\u1ee5 N\u1eef Vi\u1ec7t Nam. \u0110\u1ec3 b\u1ed9 qu\u1ed1c ph\u1ee5c Vi\u1ec7t Nam ph\xe1t huy n\xe9t \u0111\u1eb9p v\u1ed1n c\xf3 c\u1ee7a chi\u1ebfc \xe1o d\xe0i \u0111\xf2i h\u1ecfi ng\u01b0\u1eddi di\u1ec7n n\xf3 ph\u1ea3i ch\u1ecdn \u0111\xfang th\u1eddi \u0111i\u1ec3m, \u0111\xfang n\u01a1i. V\u1eady n\xean m\u1eb7c \xe1o d\xe0i trong d\u1ecbp n\xe0o?",null,B.aE,B.j,null)
B.ON=new A.h("      \xc1o Nh\u1eadt B\xecnh c\u1ee7a Ho\xe0ng H\u1eadu \u0111\u01b0\u1ee3c l\xe0m t\u1eeb ch\u1ea5t li\u1ec7u sa s\u1ee3i v\xe0ng v\xf4 c\xf9ng qu\xfd gi\xe1. Tr\xean \xe1o th\xeau \u0111\u1ee7 20 hoa v\u0103n h\xecnh r\u1ed3ng, ph\u01b0\u1ee3ng, loan, tr\u0129. C\u1ea5p H\u1eadu s\u1ebd \u0111\u01b0\u1ee3c ph\xe1t ph\u1ee5 ki\u1ec7n \u0111i k\xe8m g\u1ed3m c\xf3 2 chi\u1ebfc m\u0169 c\u1eedu long kim \u01b0\u1edbc ph\xe1t, 1 chi\u1ebfc m\u0169 c\u1eedu ph\u01b0\u1ee3ng kim \u01b0\u1edbc ph\xe1t, 8 chi\u1ebfc tr\xe2m ph\u01b0\u1eddng b\u1eb1ng v\xe0ng. ",null,B.i,B.j,null)
B.OO=new A.h("      Hoa v\u0103n trang tr\xed \u1edf c\u1ed5 \xe1o t\u1ea1o th\xe0nh h\xecnh ch\u1eef nh\u1eadt l\u1edbn \u1edf ngay tr\u01b0\u1edbc ng\u1ef1c ng\u01b0\u1eddi m\u1eb7c, v\u1eady n\xean m\u1edbi c\xf3 t\xean g\u1ecdi l\xe0 \xe1o Nh\u1eadt B\xecnh. Kh\u1eafp th\xe2n \xe1o c\xf3 nhi\u1ec1u h\u1ecda ti\u1ebft, th\u1ec3 th\u1ee9c hoa v\u0103n d\u1ea1ng h\xecnh tr\xf2n kh\xe9p k\xedn. C\xf9ng v\u1edbi \u0111\xf3 l\xe0 \u0111an xen th\xeam c\xe1c h\xecnh ph\u01b0\u1ee3ng m\xfaa, h\xecnh hoa l\xe1 v\xe0 \u0111\xednh c\xe1c h\u1ea1t tuy\u1ebfn l\u1ea5p l\xe1nh. ",null,B.i,B.j,null)
B.OP=new A.h("      V\u1ea3i ren c\xf3 r\u1ea5t nhi\u1ec1u hoa v\u0103n kh\xe1c nhau gi\xfap cho ng\u01b0\u1eddi s\u1eed d\u1ee5ng c\xf3 th\u1ec3 d\u1ec5 d\xe0ng l\u1ef1a ch\u1ecdn khi may \xe1o d\xe0i. V\u1ea3i ren c\xf3 nhi\u1ec1u l\u1ed7 nh\u1ecf n\xean r\u1ea5t tho\xe1ng m\xe1t v\xe0 gi\xfap cho ng\u01b0\u1eddi m\u1eb7c tr\u1edf n\xean sexy, quy\u1ebfn r\u0169 h\u01a1n.",null,B.i,B.j,null)
B.OQ=new A.h("      \xc1o Nh\xe2\u0323t Bi\u0300nh co\u0301 \u201cc\xe1ch t\xe2n\u201d \u0111\u01b0\u01a1\u0323c kh\xf4ng?",null,B.a0,null,null)
B.OR=new A.h("      3. Ti\u1ec7m may Minh T\xe2n",null,B.a5,B.j,null)
B.OS=new A.h("      Khi ch\u1ee5p \u1ea3nh \xe1o d\xe0i tr\xean c\xe2y ph\xeda sau, ph\xf4ng n\u1ec1n c\u1ef1c t\u1ed1t v\u1edbi b\u1ea7u tr\u1eddi trong xanh v\xe0 m\u1eb7t n\u01b0\u1edbc s\xf4ng H\u01b0\u01a1ng l\u1ea5p l\xe1nh ph\u1ea3n chi\u1ebfu. Khi \u0111\u1ebfn th\u0103m n\u01a1i n\xe0y, b\u1ea1n s\u1ebd c\xf3 r\u1ea5t nhi\u1ec1u h\xecnh \u1ea3nh \u0111\u1eb9p cho m\xe0 xem!",null,B.i,B.j,null)
B.OT=new A.h("      \u2013 M\xe0u \u0111\u1ecf t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 may m\u1eafn, sung t\xfac: \u0111\xe2y l\xe0 m\xe0u \xe1o d\xe0i \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng ph\u1ed5 bi\u1ebfn b\u1edfi n\xf3 g\xf3p ph\u1ea7n t\u1ea1o n\xean s\u1ef1 n\u1ed5i b\u1eadt r\u1ef1c r\u1ee1 cho c\xf4 d\xe2u trong ng\xe0y l\u1ec5 tr\u1ecdng \u0111\u1ea1i c\u1ee7a \u0111\u1eddi m\xecnh. Kh\xf4ng ch\u1ec9 th\u1ebf, m\xe0u \u0111\u1ecf c\xf2n l\xe0 m\xe0u c\u1ee7a s\u1ef1 quy\u1ebfn r\u0169 v\xe0 n\u1ed3ng n\xe0n trong t\xecnh y\xeau.",null,B.i,null,null)
B.OU=new A.h("Gi\u1edbi thi\u1ec7u t\u1edbi c\xf4ng ch\xfang n\xe9t \u0111\u1eb9p, s\u1ef1 bi\u1ebfn \u0111\u1ed5i v\u1ec1 ki\u1ec3u d\xe1ng, t\xednh \u0111a d\u1ea1ng v\u1ec1 m\xe0u s\u1eafc, hoa v\u0103n c\u1ee7a \xe1o d\xe0i truy\u1ec1n th\u1ed1ng Vi\u1ec7t Nam n\xf3i chung v\xe0 \xe1o d\xe0i Hu\u1ebf n\xf3i ri\xeang trong d\xf2ng ch\u1ea3y l\u1ecbch s\u1eed v\u0103n h\xf3a",null,B.v,B.G,null)
B.OV=new A.h("      Ngu\u1ed3n g\u1ed1c \xe1o Nh\u1eadt B\xecnh",null,B.a0,null,null)
B.OW=new A.h("      - R\u1ea5t nhi\u1ec1u ch\u1ecb em ph\u1ee5 n\u1eef \u0111\xe3 l\u1ef1a ch\u1ecdn n\xf3n l\xe1 l\xe0 ph\u1ee5 ki\u1ec7n ch\u1ee7 \u0111\u1ea1o \u0111\u1ec3 t\u1ea1o ra nh\u1eefng b\u1ee9c h\xecnh \u1ea5n t\u01b0\u1ee3ng. Ph\u1ee5 ki\u1ec7n \xe1o d\xe0i n\xe0y s\u1ebd mang \u0111\u1ebfn cho b\u1ea1n m\u1ed9t h\xecnh \u1ea3nh th\u01b0\u1edbt tha v\xe0 d\u1ecbu d\xe0ng c\u1ee7a m\u1ed9t thi\u1ebfu n\u1eef.",null,B.i,B.j,null)
B.OX=new A.h("      Ch\u1eafc ch\u1eafn khi ch\u1ee5p \u1ea3nh \u1edf s\xf4ng H\u01b0\u01a1ng b\u1ea1n s\u1ebd c\xf3 nh\u1eefng b\u1ee9c \u1ea3nh l\u01b0u tr\u1eef t\xecnh c\u1ea3m v\u1ec1 Hu\u1ebf. \u0110\u1eebng b\u1ecf l\u1ee1 \u0111\u1ecba \u0111i\u1ec3m ch\u1ee5p \u1ea3nh \xe1o d\xe0i \u1edf Hu\u1ebf n\xe0y khi \u0111\u1ebfn v\u1edbi c\u1ed1 \u0111\xf4 nh\xe9!",null,B.i,B.j,null)
B.OY=new A.h("\u0110\u1ed3ng ph\u1ee5c \xe1o d\xe0i nh\xe2n vi\xean ng\xe2n h\xe0ng BIDV",null,B.v,B.G,null)
B.P_=new A.h("      Gi\xe1 tr\u1ecb l\u1ecbch s\u1eed v\xe0 v\u0103n h\xf3a v\u1ec1 \xe1o Nh\u1eadt B\xecnh",null,B.a0,B.j,null)
B.OZ=new A.h("L\u1ecbch S\u1eed \xc1o D\xe0i ",null,B.cz,null,null)
B.P0=new A.h("Ho\u1ea1t \u0111\u1ed9ng n\xe0y tr\u01b0ng b\xe0y 13 b\u1ea3ng tr\xedch, g\u1ea7n 60 \u1ea3nh t\u01b0 li\u1ec7u v\xe0 h\u01a1n 40 hi\u1ec7n v\u1eadt",null,B.v,B.G,null)
B.P1=new A.h("      Khuy\xean tai ch\xednh l\xe0 m\u1ed9t trong nh\u1eefng ph\u1ee5 ki\u1ec7n \xe1o d\xe0i c\u1ed5 thuy\u1ec1n kh\xf4ng th\u1ec3 thi\u1ebfu v\u1edbi b\u1ea5t c\u1ee9 lo\u1ea1i \xe1o d\xe0i n\xe0o. M\u1ed9t \u0111\xf4i khuy\xean tai tuy nh\u1ecf nh\u1eafn nh\u01b0ng n\xf3 c\xf3 t\xe1c d\u1ee5ng t\u1ea1o ra s\u1ef1 duy\xean d\xe1ng v\xe0 xinh \u0111\u1eb9p cho b\u1ea5t c\u1ee9 c\xf4 g\xe1i n\xe0o.",null,B.i,B.j,null)
B.P2=new A.h("      Ch\u1ee3 \u0110\xf4ng Ba \u2013 \u0111\u1ecba \u0111i\u1ec3m ch\u1ee5p \u1ea3nh \xe1o d\xe0i \u1edf Hu\u1ebf \u0111\u01b0\u1ee3c nhi\u1ec1u b\u1ea1n tr\u1ebb y\xeau th\xedch",null,B.E,null,null)
B.P3=new A.h("      Th\xeam m\u1ed9t nh\u01b0\u1ee3c \u0111i\u1ec3m kh\xf4ng ph\u1ea3i \u0111\u1ed1i v\u1edbi ng\u01b0\u01a1i s\u1eed d\u1ee5ng m\xe0 l\xe0 \u0111\u1ed1i v\u1edbi ng\u01b0\u1eddi may. Nh\u1eefng th\u1ee3 may n\xe0o ch\u01b0a quen s\u1eed d\u1ee5ng v\u1ea3i chiffon th\xec trong qu\xe1 tr\xecnh may, v\u1ea3i s\u1ebd r\u1ea5t d\u1ec5 b\u1ecb s\u1eddn d\u1eabn \u0111\u1ebfn h\u1ecfng lu\xf4n c\u1ea3 m\u1ed9t t\u1ea5m v\u1ea3i.",null,B.i,B.j,null)
B.P4=new A.h("      V\u1ea3i c\xf3 tr\u1ecdng l\u01b0\u1ee3ng nh\u1eb9, tho\xe1ng m\xe1t l\xe0 ch\u1ea5t li\u1ec7u l\xfd t\u01b0\u1edfng khi s\u1eed d\u1ee5ng v\xe0o nh\u1eefng ng\xe0y h\xe8 n\xf3ng n\u1ef1c. Kh\xf4ng nh\u1eefng th\u1ebf v\u1ea3i c\xf2n c\xf3 \u0111\u1ed9 r\u0169 gi\xfap cho t\xe0 \xe1o kh\xf4ng b\u1ecb \u0111\u01a1 c\u1ee9ng khi di chuy\u1ec3n. M\u1eb7c v\u1ea3i chiffon s\u1ebd gi\xfap ch\xfang ta c\xf3 c\u1ea3m gi\xe1c nh\u01b0 kh\xf4ng m\u1eb7c.",null,B.i,B.j,null)
B.P5=new A.h("   Trang ch\u1ee7 > Nh\xe0 may truy\u1ec1n th\u1ed1ng",null,B.bf,null,null)
B.P6=new A.h("      L\u1ef1a ch\u1ecdn kh\u1ed5 v\u1ea3i c\u0169ng r\u1ea5t quan tr\u1ecdng trong vi\u1ec7c ch\u1ecdn v\u1ea3i may \xe1o d\xe0i. B\u1edfi v\xec ph\u1ea3i tu\u1ef3 theo k\xedch th\u01b0\u1edbc v\xe0 ki\u1ec3u d\xe1ng c\u1ee7a \xe1o d\xe0i t\u1eeb \u0111\xf3 m\u1edbi bi\u1ebft \u0111\u01b0\u1ee3c kh\u1ed5 v\u1ea3i c\u1ea7n mua l\xe0 bao nhi\xeau. Hi\u1ec7n t\u1ea1i \u0111\u1ec3 may \xe1o d\xe0i c\xf3 hai kh\u1ed5 v\u1ea3i \u0111ang \u0111\u01b0\u1ee3c b\xe1n \u0111\xf3 l\xe0 1.6m v\xe0 1m. \u0110\u1ec3 may \u0111\u01b0\u1ee3c m\u1ed9t b\u1ed9 \xe1o d\xe0i ho\xe0n thi\u1ec7n c\u1ea7n ph\u1ea3i mua \u0111\u1ee7 v\u1ea3i tr\xe1nh l\xe0m thi\u1ebfu hay d\u01b0 th\u1eeba.",null,B.i,B.j,null)
B.P7=new A.h("      M\xe0u s\u1eafc c\u0169ng r\u1ea5t quan tr\u1ecdng trong vi\u1ec7c ch\u1ecdn v\u1ea3i may \xe1o d\xe0i. M\xe0u da v\xe0 m\xe0u \xe1o ph\u1ea3i h\u1ed7 tr\u1ee3 l\u1eabn nhau th\xec chi\u1ebfc \xe1o d\xe0i m\u1edbi tr\u1edd n\xean ho\xe0n h\u1ea3o h\u01a1n. V\xec v\u1eady, n\u1ebfu nh\u1eefng b\u1ea1n n\xe0o c\xf3 l\xe0n da ng\u0103m h\xe3y ch\u1ecdn nh\u1eefng gam m\xe0u nh\u1ea1t v\xe0 c\xf3 th\u1ec3 ch\u1ecdn m\xe0u tr\u1eafng ng\xe0.",null,B.i,B.j,null)
B.P8=new A.h("      \xc1o Nh\u1eadt B\xecnh l\xe0 m\u1ed9t lo\u1ea1i trang ph\u1ee5c mang nh\u1eefng y\u1ebfu t\u1ed1 ri\xeang bi\u1ec7t, th\u1ec3 hi\u1ec7n nh\u1eefng d\u1ea5u \u1ea5n \u0111\u1eadm ch\u1ea5t cung \u0111\xecnh c\u1ee7a tri\u1ec1u \u0111\u1ea1i qu\xe2n ch\u1ee7 cu\u1ed1i c\xf9ng n\u01b0\u1edbc ta.",null,B.i,B.j,null)
B.P9=new A.h("      \u0110\xf3 l\xe0 nh\u1eefng lo\u1ea1i v\u1ea3i th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\xf9ng \u0111\u1ec3 may \xe1o d\xe0i, nh\u01b0ng hi\u1ec7n nay n\u1ebfu t\xednh \u0111\u1ebfn s\u1ef1 ph\u1ed5 bi\u1ebfn v\xe0 \u0111\u1ea1i tr\xe0 th\xec v\u1ea3i chiffon, l\u1ee5a, g\u1ea5m, ren l\xe0 4 lo\u1ea1i v\u1ea3i \u0111\u01b0\u1ee3c \u01b0a chu\u1ed9ng nhi\u1ec1u nh\u1ea5t. C\xf2n c\xe1c b\u1ea1n th\xec sao? B\u1ea1n th\xedch nh\u1ea5t lo\u1ea1i v\u1ea3i n\xe0o khi may \xe1o d\xe0i? H\xe3y b\xecnh lu\u1eadn b\xean d\u01b0\u1edbi \u0111\u1ec3 ch\xfang t\xf4i \u0111\u01b0\u1ee3c bi\u1ebft th\xeam ch\u1ea5t li\u1ec7u m\xe0 b\u1ea1n hay s\u1eed d\u1ee5ng nh\xe9. Ch\xfac c\xe1c b\u1ea1n lu\xf4n xinh \u0111\u1eb9p trong t\xe0 \xe1o d\xe0i th\u01b0\u1edbt tha.",null,B.vr,B.j,null)
B.Pa=new A.h("     Nh\u1eefng l\u01b0u \xfd khi mua v\u1ea3i m\xe1y \xe1o d\xe0i \u0111\u1eb9p",null,B.E,null,null)
B.Pb=new A.h("      - B\xean c\u1ea1nh \u0111\xf3, n\xean k\u1ebft h\u1ee3p v\u1edbi m\u1ed9t chi\u1ebfc t\xfai c\xf3 k\xedch th\u01b0\u1edbc v\u1eeba ph\u1ea3i \u0111\u01b0\u1ee3c \u0111\xednh \u0111\xe1 v\xe0 \u0111\xf4i gi\xe0y cao g\xf3t t\u1eeb 3-5 cm s\u1ebd gi\xfap t\u1ed5ng th\u1ec3 trang ph\u1ee5c th\xeam h\xe0i h\xf2a h\u01a1n.",null,B.i,B.j,null)
B.bh=new A.h("      b. Nh\u01b0\u1ee3c \u0111i\u1ec3m",null,B.a5,B.j,null)
B.Pc=new A.h("      - \xc1o tay ch\u1ebdn: \xe1o t\u1ea5c tay ch\u1ebdn c\xf3 ph\u1ea7n th\xe2n \xe1o c\u0169ng t\u01b0\u01a1ng t\u1ef1 nh\u01b0 \xe1o t\u1ea5c, tuy nhi\xean ph\u1ea7n \u0111o\u1ea1n v\u1ea3i \u0111\u01b0\u1ee3c n\u1ed1i t\u1eeb khu\u1ef7u tay t\u1edbi qu\xe1 c\u1ed5 tay ch\u1eebng 2cm th\xec \u0111\u01b0\u1ee3c may ki\u1ec3u \u1ed1ng tay h\u1eb9p. Hai th\xe2n tr\u01b0\u1edbc c\u1ee7a \xe1o th\xec d\xe0i qua kh\u1ecfi \u0111\u1ea7u g\u1ed1i t\u1ea7m 5-7cm, \u1edf tr\xean m\u1eaft c\xe1 m\u1ed9t t\xed. \u1ed0ng tay \u0111\u01b0\u1ee3c may nh\u1ecf g\u1ecdn h\u01a1n \u1ed1ng tay c\u1ee7a \xe1o t\u1ea5c, \xe1o giao l\u0129nh n\xean g\u1ecdi l\xe0 \xe1o tay ch\u1ebdn.",null,B.i,B.j,null)
B.Pd=new A.h("      Nh\u1eefng ch\u1eef Th\u1ecd, Ph\xfac b\u1eb1ng ch\u1ec9 \u0111\u1ecf, ch\u1ec9 v\xe0ng \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng nh\u01b0 m\u1ed9t h\xe0m \xfd mang l\u1ea1i \u0111i\u1ec1u t\u1ed1t l\xe0nh, may m\u1eafn. ",null,B.i,null,null)
B.Pe=new A.h('"Ng\xe0y h\u1ed9i \xc1o d\xe0i" l\xe0 d\u1ecbp \u0111\u1ec3 kh\u1eb3ng \u0111\u1ecbnh Hu\u1ebf l\xe0 c\xe1i n\xf4i v\xe0 c\u0169ng l\xe0 kinh \u0111\xf4 c\u1ee7a \xc1o d\xe0i Vi\u1ec7t Nam',null,B.v,B.G,null)
B.Pf=new A.h("      L\xe0 m\u1ed9t lo\u1ea1i v\u1ea3i \u0111\u01b0\u1ee3c d\u1ec7t ho\xe0n to\xe0n b\u1eb1ng th\u1ee7 c\xf4ng v\u1edbi nh\u1eefng hoa v\u0103n t\u01b0\u1ee3ng tr\u01b0ng cho t\u1eebng v\xf9ng mi\u1ec1n, b\u1ea3n s\u1eafc d\xe2n t\u1ed9c. V\u1ea3i th\u1ed5 c\u1ea9m \u0111em \u0111\u1ebfn s\u1ef1 \u0111\u1ed9c \u0111\xe1o pha l\u1eabn n\xe9t n\xfai r\u1eebng gi\xfap cho t\xe0 \xe1o d\xe0i tr\u1edf n\xean truy\u1ec1n th\u1ed1ng v\xe0 \u0111a s\u1eafc h\u01a1n.",null,B.i,null,null)
B.Pg=new A.h("      \u0110\u1ed3i Thi\xean An \u2013 \u0110\u1ecba \u0111i\u1ec3m th\u01a1 m\u1ed9ng th\xedch h\u1ee3p \u0111\u1ec3 ch\u1ee5p \u1ea3nh v\u1edbi \xe1o d\xe0i ",null,B.E,null,null)
B.Ph=new A.h("Trang ph\u1ee5c cung \u0111\xecnh tri\u1ec1u Nguy\u1ec5n",null,B.aT,null,null)
B.Pi=new A.h("      - B\xean c\u1ea1nh \u0111\xf3, b\u1ea1n n\xean b\xfai t\xf3c m\u1ed9t c\xe1ch \u0111\u01a1n gi\u1ea3n, g\u1ecdn g\xe0ng, kh\xf4ng qu\xe1 cao ho\u1eb7c qu\xe1 th\u1ea5p, t\xf3c c\xf3 th\u1ec3 c\u1ed9t l\xean h\u1ebft ho\u1eb7c \u0111\u1ec3 v\xe0i s\u1ee3i bu\xf4ng l\u01a1i tr\u01b0\u1edbc m\u1eb7t \u0111\u1ec3 v\u1eeba che \u0111\u01b0\u1ee3c khuy\u1ebft \u0111i\u1ec3m l\u1ea1i gi\xfap b\u1ea1n nh\xecn cu\u1ed1n h\xfat h\u01a1n.",null,B.i,null,null)
B.Pj=new A.h("      M\u1ed9t trong nh\u1eefng bi\u1ec3u t\u01b0\u1ee3ng \u0111\u1eb7c tr\u01b0ng v\xe0 \u0111\xe1ng t\u1ef1 h\xe0o c\u1ee7a Hu\u1ebf l\xe0 c\u1ea7u Tr\xe0ng Ti\u1ec1n. V\u1ebb \u0111\u1eb9p c\u1ed5 k\xednh pha ch\xfat b\xecnh y\xean c\u1ee7a c\u1ea7u Tr\xe0ng Ti\u1ec1n \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi \u0111\u1eb7c bi\u1ec7t y\xeau th\xedch.",null,B.i,B.j,null)
B.Pk=new A.h("      Tuy \u0111\u01b0\u1ee3c thi\u1ebft k\u1ebf d\u1ef1a theo nguy\xean m\u1eabu \xe1o Phi Phong nh\u01b0ng \u0111\u1eb7c \u0111i\u1ec3m c\u1ee7a \xe1o Nh\u1eadt B\xecnh v\u1eabn c\xf3 s\u1ef1 kh\xe1c bi\u1ec7t. \u0110i\u1ec1u n\xe0y th\u1ec3 hi\u1ec7n tinh th\u1ea7n s\xe1ng t\u1ea1o c\u0169ng nh\u01b0 l\xf2ng t\u1ef1 t\xf4n c\u1ee7a d\xe2n t\u1ed9c. \u0110\u1ed3ng th\u1eddi, ch\xfang kh\u1eafc h\u1ecda r\xf5 n\xe9t c\xe1c \u0111\u1eb7c \u0111i\u1ec3m v\u0103n h\xf3a ng\u01b0\u1eddi Vi\u1ec7t ch\xfang ta. C\u1ee5 th\u1ec3 nh\u01b0 sau:",null,B.i,null,null)
B.Pl=new A.h("      M\u1ed7i nh\xf3m trang ph\u1ee5c bao g\u1ed3m: \xe1o, m\u0169, \u0111ai, xi\xeam, h\u1ed1t, hia, h\xe0i... \u0111\u01b0\u1ee3c may theo c\xe1ch th\u1ee9c ri\xeang, c\xf3 t\xean g\u1ecdi ri\xeang v\xe0 kh\xe1c nhau v\u1ec1 m\xe0u s\u1eafc, hoa v\u0103n. M\u0169 thi\u1ebft \u0111\u1ea1i tri\u1ec1u c\u1ee7a vua g\u1ecdi l\xe0 m\u0169 c\u1eedu long; \xe1o g\u1ecdi l\xe0 long b\xe0o, th\xeau h\xecnh r\u1ed3ng ngang 5 m\xf3ng. Ph\u1ee5c trang k\xe8m theo long b\xe0o c\xf2n c\xf3 xi\xeam, \u0111ai, h\u1ed1t ng\u1ecdc v\xe0 \u0111\xf4i hia th\xeau c\u1eb7p r\u1ed3ng b\u1eb1ng kim tuy\u1ebfn n\u1ea1m v\xe0ng. M\u0169 thi\u1ebft th\u01b0\u1eddng tri\u1ec1u c\u1ee7a vua g\u1ecdi l\xe0 m\u0169 b\xecnh thi\xean, \xe1o g\u1ecdi l\xe0 ho\xe0ng b\xe0o, th\xeau vi\xean long n\u1ea1m tr\xe2n ch\xe2u, t\u01a1 v\xe0ng. \u0110i k\xe8m v\u1edbi ho\xe0ng b\xe0o l\xe0 \u0111\xf4i h\xe0i th\xeau r\u1ea5t c\u1ea7u k\u1ef3. M\u0169 d\xf9ng trong d\u1ecbp vua t\u1ebf Nam Giao l\xe0 mi\u1ec7n, \xe1o g\u1ecdi l\xe0 c\u1ed5n, m\xe0u \u0111en, tay th\u1ee5ng th\u1eadt l\u1edbn, th\xeau l\u01b0\u1ee1ng long tri\u1ec1u nh\u1eadt d\u1ecdc hai th\xe2n tr\u01b0\u1edbc. \xc1o vua m\u1eb7c \u0111i c\xe0y ru\u1ed9ng t\u1ecbch \u0111i\u1ec1n l\xe0 \xe1o sa k\xe9p m\xe0u g\u1ea1ch non, th\xeau c\xe1c h\xecnh r\u1ed3ng nh\u1ecf \u1ea9n trong c\xe1c c\u1ee5m m\xe2y. Trong khi \u0111\xf3, m\u0169 c\u1ee7a th\xe1i t\u1eed, tuy r\u1ea5t gi\u1ed1ng m\u0169 b\xecnh thi\xean c\u1ee7a vua nh\u01b0ng l\u1ea1i g\u1ecdi l\xe0 m\u0169 b\xecnh \u0111\xednh, \u0111\u1ec3 ph\xe2n bi\u1ec7t giai t\u1ea7ng, th\u1ee9 c\u1ea5p.",null,B.i,B.j,null)
B.Pm=new A.h("\u0110\u1ed1i v\u1edbi ch\xfa, t\u1ea5t c\u1ea3 c\xe1c c\xf4ng \u0111o\u1ea1n may \xe1o d\xe0i \u0111\u1ec1u quan tr\u1ecdng, trong \u0111\xf3 c\u1eaft v\xe0 l\xean form \xe1o d\xe0i l\xe0 quan tr\u1ecdng nh\u1ea5t, \u0111\u1ea3m b\u1ea3o chi\u1ebfc \xe1o d\xe0i th\xe0nh ph\u1ea9m c\xf3 v\u1eeba v\u1eb7n, \xf4m d\xe1ng ng\u01b0\u1eddi m\u1eb7c hay kh\xf4ng.",null,B.v,B.G,null)
B.Pn=new A.h("      M\u0169 d\xe0nh cho c\u1ea5p n\xe0y l\xe0 1 chi\u1ebfc Ph\u01b0\u1ee3ng kim \u01b0\u1edbc, c\xf9ng v\u1edbi \u0111\xf3 l\xe0 8 c\xe2y tr\xe2m c\xe0i.",null,B.i,B.j,null)
B.Po=new A.h("   Trang ch\u1ee7 > B\xe0i vi\u1ebft m\u1edbi nh\u1ea5t",null,B.bf,null,null)
B.Pp=new A.h("     Nh\u1eefng gi\xe1 tr\u1ecb m\xe0 \xe1o ng\u0169 th\xe2n mang l\u1ea1i",null,B.E,B.bE,null)
B.Pq=new A.h("      Ngo\xe0i m\u1ea5n \u0111\u1ed9i \u0111\u1ea7u ra, b\u0103ng \u0111\xf4 c\u0169ng l\xe0 ph\u1ee5 ki\u1ec7n \u0111i k\xe8m \xe1o d\xe0i gi\xfap c\xf4 n\xe0ng c\u1ee7a ch\xfang ta tr\u1edf n\xean tr\u1ebb trung v\xe0 n\u1eef t\xednh h\u01a1n. R\u1ea5t nhi\u1ec1u m\u1eabu b\u0103ng \u0111\xf4 \u0111\u01b0\u1ee3c l\xe0m b\u1eb1ng v\u1ea3i \u0111\u01b0\u1ee3c ra m\u1eaft v\xe0 nh\u1eadn \u0111\u01b0\u1ee3c s\u1ef1 \u0111\xf3n nh\u1eadn c\u1ee7a c\xe1c ch\u1ecb em.",null,B.i,B.j,null)
B.Pr=new A.h("      Tu\u1ea7n l\u1ec5 \xc1o d\xe0i c\u1ed9ng \u0111\u1ed3ng Hu\u1ebf s\u1ebd t\u1ed5 ch\u1ee9c chu\u1ed7i ho\u1ea1t \u0111\u1ed9ng tri \xe2n, qu\u1ea3ng di\u1ec5n, tr\xecnh di\u1ec5n \xc1o d\xe0i Hu\u1ebf, ho\u1ea1t \u0111\u1ed9ng bi\u1ec3u di\u1ec5n ngh\u1ec7 thu\u1eadt, k\u1ebft h\u1ee3p v\u1edbi c\xe1c h\xecnh th\u1ee9c tuy\xean truy\u1ec1n, qu\u1ea3ng b\xe1, t\xf4n vinh h\xecnh \u1ea3nh \xc1o d\xe0i; khuy\u1ebfn kh\xedch, huy \u0111\u1ed9ng s\u1ef1 tham gia, h\u01b0\u1edfng \u1ee9ng c\u1ee7a c\u1ed9ng \u0111\u1ed3ng khi tham gia Tu\u1ea7n l\u1ec5 \xc1o d\xe0i c\u1ed9ng \u0111\u1ed3ng Hu\u1ebf.",null,B.i,B.j,null)
B.Ps=new A.h("   Trang ch\u1ee7 > \xc1o d\xe0i ng\u0169 th\xe2n",null,B.bf,null,null)
B.Pt=new A.h("      L\u1ec5 Festival l\xe0 c\u01a1 h\u1ed9i v\xe0ng \u0111\u1ec3 cho m\u1ecdi ng\u01b0\u1eddi \u0111\u01b0\u1ee3c tinh hoa v\u0103n h\xf3a c\u1ed1 \u0111\xf4, h\xe3y nh\u1edb du l\u1ecbch Hu\u1ebf v\xe0o d\u1ecbp n\xe0y v\xe0 \u0111\u1eebng qu\xean m\u1eb7c th\u1eed m\u1ed9t b\u1ed9 \xe1o d\xe0i nh\xe9 ! ",null,B.i,B.j,null)
B.Pu=new A.h("      T\u1eeb khi h\xecnh th\xe0nh, \u0111i qua bao ch\u1eb7ng \u0111\u01b0\u1eddng c\u1ee7a nh\u1eefng cu\u1ed9c chi\u1ebfn tranh kh\xf3i l\u1eeda. \u0110i qua bao nhi\xeau th\u1eadp ni\xean kh\xf3 kh\u0103n, t\u1eeb v\u1ea5t v\u1ea3 c\u01a1 c\u1ef1c \u0111\u1ebfn t\u1ecfa n\u1eafng r\u1ef1c r\u1ee1. \xc1o d\xe0i lu\xf4n \u0111\u01b0\u1ee3c may d\xf9 v\u1eabn \u0111\u01b0\u1ee3c gi\u1eef g\xecn theo n\xe9t c\u0169 nh\u01b0ng l\u1ea1i \u0111\u01b0\u1ee3c bi\u1ebfn t\u1ea5u r\u1ea5t nhi\u1ec1u. V\u1edbi t\xe2m s\u1ee9c v\xe0 t\xecnh c\u1ea3m c\u1ee7a nh\u1eefng th\u1ee3 may, \u0111\xe3 t\u1ea1o n\xean nh\u1eefng t\xe0 \xe1o cho \u0111\xe0n \xf4ng \u2013 ph\u1ee5 n\u1eef v\xf4 c\xf9ng \u0111\u1eb9p \u0111\u1ebd. Qua bao nhi\xeau th\u0103ng tr\u1ea7m, t\xe0 \xe1o d\xe0i Hu\u1ebf lu\xf4n l\xe0 m\u1ed9t nh\xe2n ch\u1ee9ng \u0111\xe3 t\u1eadn m\u1eaft ch\u1ee9ng ki\u1ebfn t\u1ea5t c\u1ea3 nh\u1eefng thay \u0111\u1ed5i l\u1ecbch s\u1eed c\u1ee7a d\xe2n t\u1ed9c ",null,B.i,B.j,null)
B.Pv=new A.h("      S\u1ef1 h\u1ecdc h\u1ecfi t\u1eeb Trung Hoa b\u1eaft ngu\u1ed3n t\u1eeb t\xe2m l\xfd t\u1ef1 t\xf4n, mong mu\u1ed1n s\xe1nh ngang c\xf9ng c\xe1c tri\u1ec1u \u0111\u1ea1i phong ki\u1ebfn ph\u01b0\u01a1ng B\u1eafc. \u0110i\u1ec1u n\xe0y \u0111\u01b0\u1ee3c th\u1ec3 hi\u1ec7n t\u1eeb vi\u1ec7c nh\u1eefng v\u1ecb vua \u0110\u1ea1i Vi\u1ec7t \u0111\u1ec1u x\u01b0ng \u0111\u1ebf, kh\xf4ng x\u01b0ng v\u01b0\u01a1ng.",null,B.i,B.j,null)
B.Pw=new A.h("C\u1ea3 gia \u0111\xecnh c\xf9ng di\u1ec7n \xe1o d\xe0i \u0111\xf3n xu\xe2n",null,B.v,B.G,null)
B.Px=new A.h("      M\u1ed9t g\u1ee3i \xfd kh\xe1c cho nh\u1eefng ai \u0111ang t\xecm ki\u1ebfm \u0111\u1ecba \u0111i\u1ec3m ch\u1ee5p \u1ea3nh \xe1o d\xe0i \u1edf Hu\u1ebf. Ch\xf9a Thi\xean M\u1ee5 \u0111\u01b0\u1ee3c bi\u1ebft \u0111\u1ebfn l\xe0 \u0111i\u1ec3m du l\u1ecbch t\xe2m linh l\xe2u \u0111\u1eddi nh\u1ea5t c\u1ee7a c\u1ed1 \u0111\xf4. D\xf9 b\u1ea1n ch\u1ecdn g\xf3c ch\u1ee5p n\xe0o th\xec ki\u1ebfn \u200b\u200btr\xfac \u0111\u1ed9c \u0111\xe1o c\u1ee7a ng\xf4i ch\xf9a s\u1ebd gi\xfap nh\u1eefng b\u1ee9c \u1ea3nh c\u1ee7a b\u1ea1n lu\xf4n n\u1ed5i b\u1eadt v\xe0 c\xf3 \u0111i\u1ec3m nh\u1ea5n.",null,B.i,B.j,null)
B.Py=new A.h("\xc1o sa k\xe9p xu\xe2n h\u1ea1 c\u1ee7a ho\xe0ng th\xe1i h\u1eadu.",null,B.v,null,null)
B.Pz=new A.h(u.r,null,B.aT,null,null)
B.PA=new A.h("     2. V\u1ea3i l\u1ee5a",null,B.E,null,null)
B.PB=new A.h("      V\xf2ng c\u1ed5",null,B.a0,null,null)
B.PC=new A.h("      Ba\u0309n ch\xe2\u0301t c\u1ee7a Nh\u1eadt B\xecnh l\xe0 m\u1ed9t lo\u1ea1i \xe1o l\u1ec5 ti\u1ebft, h\xe2\u0323u cung nha\u0300 Nguy\xea\u0303n s\u01b0\u0309 du\u0323ng ch\xfang trong ca\u0301c di\u0323p l\xea\u0303 theo quy \u0111i\u0323nh ch\u0103\u0323t che\u0303. V\u1eady n\xean, Nh\u1eadt B\xecnh c\xe1ch t\xe2n l\xe0 m\u1ed9t kh\xe1i ni\u1ec7m \u0111ang b\u1ecb l\u1ea1m d\u1ee5ng. ",null,B.i,B.j,null)
B.PD=new A.h("      M\u1ed9t \u0111\xf4i hoa tai \u0111\u1ed9c m\u1ed9t vi\xean ng\u1ecdc trai c\xf9ng m\u1ed9t chi\u1ebfc v\xf2ng c\u1ed5 t\u01b0\u01a1ng t\u1ef1 d\xe1ng bo tr\xf2n c\u1ee7a c\u1ed5 \xe1o s\u1ebd l\xe0 ph\u1ee5 ki\u1ec7n \u0111i k\xe8m \xe1o d\xe0i c\u1ef1c k\u1ef3 ph\xf9 h\u1ee3p v\u1edbi \xe1o d\xe0i c\u1ed5 tr\xf2n. C\xe1ch k\u1ebft h\u1ee3p n\xe0y tuy kh\xf4ng qu\xe1 c\u1ea7u k\u1ef3, th\u1ebf nh\u01b0ng n\xf3 mang l\u1ea1i s\u1ef1 tinh t\u1ebf v\xe0 thanh l\u1ecbch cho ng\u01b0\u1eddi m\u1eb7c.",null,B.i,B.j,null)
B.PE=new A.h("      1. Ti\u1ec7m may H\xf9ng",null,B.a5,B.j,null)
B.PG=new A.h("     \xc1o d\xe0i Hu\u1ebf l\xe0 m\u1ed9t s\u1ea3n ph\u1ea9m du l\u1ecbch Hu\u1ebf",null,B.E,null,null)
B.PH=new A.h("      \xc1o Nh\u1eadt B\xecnh c\u1ee7a C\xf4ng Ch\xfaa",null,B.a5,null,null)
B.PI=new A.h("      B\xean c\u1ea1nh \u0111\xf3, d\u1ef1a v\xe0o m\xe0u s\u1eafc c\u1ee7a \xe1o c\u0169ng c\xf3 th\u1ec3 bi\u1ebft \u0111\u01b0\u1ee3c c\u1ea5p b\u1eadc c\u1ee7a ng\u01b0\u1eddi m\u1eb7c. V\xed d\u1ee5 nh\u01b0 \xe1o Nh\u1eadt B\xecnh d\xe0nh cho Ho\xe0ng H\u1eadu s\u1ebd c\xf3 m\xe0u v\xe0ng ho\u1eb7c m\xe0u cam, c\u1ee7a C\xf4ng Ch\xfaa s\u1ebd l\xe0 m\xe0u \u0111\u1ecf,\u2026",null,B.i,null,null)
B.PJ=new A.h("      S\xf4ng H\u01b0\u01a1ng \u2013 \u0110\u1ecba \u0111i\u1ec3m ch\u1ee5p \u1ea3nh \xe1o d\xe0i c\u01b0\u1edbi \u0111\u1eb9p \u1edf Hu\u1ebf",null,B.E,null,null)
B.PK=new A.h("      - H\xecnh \u1ea3nh \xe1o \u0111i k\xe8m v\u1edbi nh\u1eefng chi\u1ebfc b\u0103ng \u0111\xf4 t\u1ea1o ra n\xe9t \u0111\u1ed9c \u0111\xe1o khi v\u1eeba mang t\xednh c\u1ed5 \u0111i\u1ec3n v\u1eeba \u0111an xen h\u01a1i th\u1edf hi\u1ec7n \u0111\u1ea1i. Ph\u1ee5 ki\u1ec7n \xe1o d\xe0i n\xe0y kh\xf4ng ch\u1ec9 c\xf3 t\xe1c d\u1ee5ng gi\xfap b\u1ed9 \xe1o d\xe0i tr\u1edf n\xean n\u1ed5i b\u1eadt m\xe0 c\xf2n l\xe0 c\xf4ng c\u1ee5 gi\u1eef t\xf3c v\xf4 c\xf9ng ti\u1ec7n l\u1ee3i.",null,B.i,B.j,null)
B.PM=new A.h("      \xc1o d\xe0i ng\u0169 th\xe2n- \xe1o d\xe0i Hu\u1ebf xu\u1ea5t hi\u1ec7n t\u1eeb \u0111\u1ea7u th\u1ebf k\u1ef7 XVII, t\u1eeb nhu c\u1ea7u v\u1ec1 trang ph\u1ee5c c\u1ee7a ng\u01b0\u1eddi \u0110\xe0ng Trong: v\u1eeba g\u1ecdn g\xe0ng, gi\u1ea3n ti\u1ec7n v\u1eeba k\xedn \u0111\xe1o v\xe0 ph\xf9 h\u1ee3p v\u1edbi l\u1ec5 nghi truy\u1ec1n th\u1ed1ng c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t tr\xean v\xf9ng \u0111\u1ea5t m\u1edbi. \u0110\xe0o Duy T\u1eeb \u0111\xe3 t\u1eebng khuy\xean ch\xfaa Nguy\u1ec5n Ph\xfac Nguy\xean s\u1eed d\u1ee5ng \xe1o d\xe0i ng\u0169 th\xe2n l\xe0m trang ph\u1ee5c ch\xednh th\u1ee9c cho ng\u01b0\u1eddi d\xe2n \u0110\xe0ng Trong \u0111\u1ec3 t\u1ea1o n\xean s\u1ef1 kh\xe1c bi\u1ec7t v\u1edbi \u0110\xe0ng Ngo\xe0i, nh\u01b0ng \u0111i\u1ec1u n\xe0y ch\u01b0a \u0111\u01b0\u1ee3c th\u1ef1c hi\u1ec7n.",null,B.i,B.j,null)
B.PL=new A.h("\xc1o d\xe0i r\u1ef1c r\u1ee1 m\u1eebng Festival Hu\u1ebf",null,B.aT,null,null)
B.PN=new A.h("      \u0110i\u1ec1u na\u0300y v\u1eeba tra\u0301nh \u0111\u01b0\u1ee3c g\xe2y tranh ca\u0303i, v\u01b0\u0300a kh\xf4ng g\xe2y nh\u1ea7m l\u1eabn v\xea\u0300 c\xf4\u0309 phu\u0323c Vi\xea\u0323t Nam trong m\u0103\u0301t c\xe1c ba\u0323n be\u0300 qu\xf4\u0301c t\xea\u0301.",null,B.i,B.j,null)
B.PO=new A.h("      - Th\xf4ng th\u01b0\u1eddng v\u1edbi ph\u1ee5 ki\u1ec7n \xe1o d\xe0i truy\u1ec1n th\u1ed1ng n\xe0y, c\xe1c ch\u1ecb em th\u01b0\u1eddng l\u1ef1a ch\u1ecdn nh\u1eefng \u0111\xf4i gi\xe0y cao g\xf3t kho\u1ea3ng 5-7cm \u0111\u1ec3 t\u0103ng th\xeam chi\u1ec1u cao gi\xfap th\xe2n h\xecnh tr\u1edf n\xean quy\u1ebfn r\u0169 h\u01a1n r\u1ea5t nhi\u1ec1u. Tuy nhi\xean, v\u1edbi nh\u1eefng b\u1ed9 \xe1o d\xe0i c\xe1ch t\xe2n hay \xe1o d\xe0i h\u1ecdc sinh th\xec ho\xe0n to\xe0n c\xf3 th\u1ec3 l\u1ef1a ch\u1ecdn gi\xe0y th\u1ec3 thao hay sandal \u0111\u1ec1u r\u1ea5t ph\xf9 h\u1ee3p.",null,B.i,B.j,null)
B.PP=new A.h("      Th\u1eeba Thi\xean - Hu\u1ebf v\u1ed1n l\xe0 chi\u1ebfc n\xf4i s\u1ea3n sinh c\u1ee7a \xe1o d\xe0i ng\u0169 th\xe2n, \u0111\u1ed3ng th\u1eddi l\xe0 m\u1ea3nh \u0111\u1ea5t g\xecn gi\u1eef, nu\xf4i d\u01b0\u1ee1ng v\xe0 ph\xe1t tri\u1ec3n \xe1o d\xe0i Vi\u1ec7t Nam su\u1ed1t h\xe0ng tr\u0103m n\u0103m qua. Xuy\xean su\u1ed1t th\u1eddi gian gi\u1eef vai tr\xf2 l\xe0 kinh \u0111\xf4 c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, C\u1ed1 \u0111\xf4 Hu\u1ebf c\u0169ng l\xe0 Kinh \u0111\xf4 \xe1o d\xe0i Vi\u1ec7t Nam, n\u1ed5i danh b\u1edfi \u201cch\u1ebf \u0111\u1ed9 y quan\u201d r\u1ef1c r\u1ee1 - bi\u1ec3u tr\u01b0ng cho m\u1ed9t tri\u1ec1u \u0111\u1ea1i ph\u01b0\u01a1ng \u0110\xf4ng. Ch\xednh v\xec th\u1ebf, \xe1o d\xe0i l\xe0 b\u1ea3n s\u1eafc v\u0103n h\xf3a v\xf9ng \u0111\u1ea5t, n\xe9t \u0111\u1eb9p c\u1ee7a con ng\u01b0\u1eddi x\u1ee9 Hu\u1ebf. C\xf9ng v\u1edbi s\u1ef1 \u0111\u1ed5i thay c\u1ee7a l\u1ecbch s\u1eed, \xe1o d\xe0i qua t\u1eebng th\u1eddi \u0111\u1ea1i \u0111\xe3 c\xf3 kh\xf4ng \xedt s\u1ef1 \u0111i\u1ec1u ch\u1ec9nh. Tuy nhi\xean, d\xf9 \u0111i\u1ec1u ch\u1ec9nh ra sao, \xe1o d\xe0i v\u1eabn l\xe0 qu\u1ed1c ph\u1ee5c, ni\u1ec1m t\u1ef1 h\xe0o c\u1ee7a ng\u01b0\u1eddi d\xe2n Vi\u1ec7t Nam n\xf3i chung v\xe0 l\xe0 \u201cm\xf3n \u0103n tinh th\u1ea7n\u201d th\u1ec3 hi\u1ec7n b\u1ea3n s\u1eafc ri\xeang c\u1ee7a v\u0103n h\xf3a v\xf9ng \u0111\u1ea5t C\u1ed1 \u0111\xf4 Hu\u1ebf.",null,B.aE,B.j,null)
B.PR=new A.h("      - Ca\u0301c ph\u1ee5 ki\u1ec7n \u0111i k\xe8m \xe1o d\xe0i c\u1ed5 thuy\u1ec1n kh\xf4ng th\u1ec3 thi\u1ebfu \u0111i nh\u1eefng chi\u1ebfc v\xf2ng c\u1ed5 \u0111\u01b0\u1ee3c thi\u1ebft k\u1ebf theo d\xe1ng c\u1ed5 \xe1o d\xe0i. V\xf2ng c\u1ed5 cho \xe1o d\xe0i c\u1ed5 thuy\u1ec1n n\xean ch\u1ecdn v\xf2ng ng\u1ecdc trai hay nh\u1eefng chi\u1ebfc v\xf2ng \u0111\xednh \u0111\xe1 d\xe1ng d\xe0i \u0111\u1ec3 t\u0103ng th\xeam ph\u1ea7n n\u1ed5i b\u1eadt.",null,B.i,B.j,null)
B.PS=new A.h("      Nhi\u1ec1u ng\u01b0\u1eddi m\u1eb7c \xe1o d\xe0i m\xe0 kh\xf4ng \u0111\u1ec3 \xfd \u0111\u1ebfn c\xe1c ph\u1ee5 ki\u1ec7n \u0111i k\xe8m. Th\u1ebf nh\u01b0ng \u0111i\u1ec1u n\xe0y v\xf4 t\xecnh khi\u1ebfn b\u1ed9 trang ph\u1ee5c tr\u1edf n\xean t\u1ed1i gi\u1ea3n v\xe0 k\xe9m sang. V\xec th\u1ebf, \u0111\u1ec3 lu\xf4n n\u1ed5i b\u1eadt tr\u01b0\u1edbc \u0111\xe1m \u0111\xf4ng v\xe0 thu h\xfat \u0111\u01b0\u1ee3c m\u1ecdi \xe1nh nh\xecn b\u1ea1n n\xean tham kh\u1ea3o m\u1ed9t s\u1ed1 lo\u1ea1i ph\u1ee5 ki\u1ec7n \xe1o d\xe0i sau.",null,B.i,B.j,null)
B.PT=new A.h("      \xc1o Nh\u1eadt B\xecnh c\u1ee7a C\xf4ng Ch\xfaa \u0111\u01a1n gi\u1ea3n h\u01a1n so v\u1edbi c\u1ea5p H\u1eadu, ch\xfang s\u1ebd \u0111\u01b0\u1ee3c may t\u1eeb ch\u1ea5t li\u1ec7u s\u1ee3i sa m\xe0u \u0111\u1ecf. Tr\xean \xe1o \u0111\u01b0\u1ee3c th\xeau hoa v\u0103n ph\u01b0\u1ee3ng \u1ed5. C\xe1c ph\u1ee5 ki\u1ec7n \u0111i k\xe8m \u0111\xf3 l\xe0 1 chi\u1ebfc Th\u1ea5t Ph\u01b0\u1ee3ng Kim \u01b0\u1edbc ph\xe1t, 12 c\xe2y tr\xe2m hoa. ",null,B.i,B.j,null)
B.PU=new A.h("      Theo TS. Tr\u1ea7n \u0110\u1ee9c Anh S\u01a1n (nguy\xean Gi\xe1m \u0111\u1ed1c B\u1ea3o t\xe0ng C\u1ed5 v\u1eadt Cung \u0111\xecnh Hu\u1ebf), c\xe1c lo\u1ea1i v\u1ea3i l\u1ee5a d\xf9ng \u0111\u1ec3 may trang ph\u1ee5c, m\u0169 m\xe3o cho vua ch\xfaa, ho\xe0ng th\xe2n qu\u1ed1c th\xedch \u0111\u1ec1u l\xe0 h\xe0ng cao c\u1ea5p, do tri\u1ec1u \u0111\xecnh \u0111\u1eb7t mua \u1edf Trung Hoa. ",null,B.i,B.j,null)
B.PV=new A.h("      N\u1ebfu nh\u01b0 l\u1ec5 t\u1ed1t nghi\u1ec7p trung h\u1ecdc ph\u1ed5 th\xf4ng l\xe0 b\u01b0\u1edbc ngo\u1eb7c \u0111\xe1nh d\u1ea5u k\u1ebft th\xfac giai \u0111o\u1ea1n h\u1ecdc sinh chuy\u1ec3n sang qu\xe1 tr\xecnh b\u1ed3i d\u01b0\u1ee1ng vun \u0111\u1eafp ki\u1ebfn th\u1ee9c cho ng\xe0nh ngh\u1ec1 m\xecnh y\xeau th\xedch. Th\xec l\u1ec5 t\u1ed1t nghi\u1ec7p \u0111\u1ea1i h\u1ecdc c\u0169ng s\u1ebd l\xe0 b\u01b0\u1edbc chuy\u1ec3n \u0111\xe1nh d\u1ea5u b\u1ea1n k\u1ebft th\xfac qu\xe1 tr\xecnh ng\u1ed3i tr\xean gh\u1ebf nh\xe0 tr\u01b0\u1eddng v\xe0 \u0111\u1ed3ng ngh\u0129a l\xfac n\xe0y b\u1ea1n c\xf3 th\u1ec3 ch\xednh th\u1ee9c t\xecm ki\u1ebfm cho m\xecnh m\u1ed9t c\xf4ng vi\u1ec7c y\xeau th\xedch.",null,B.i,null,null)
B.PW=new A.h("      T\u1ea5t c\u1ea3 nh\u1eefng nguy\xean li\u1ec7u d\xf9ng \u0111\u1ec3 d\u1ec7t hay m\xe0u nhu\u1ed9m \u0111\u1ec1u l\u1ea5y t\u1eeb c\xe2y c\u1ecf hoa l\xe1 gi\xfap v\u1ea3i th\u1ed5 c\u1ea9m g\u1ea7n g\u0169i v\u1edbi con ng\u01b0\u1eddi h\u01a1n. Kh\xf4ng nh\u1eefng th\u1ebf, v\u1ea3i th\u1ed5 c\u1ea9m c\xf2n t\u1ea1o n\xean n\xe9t \u0111\u1eb7c tr\u01b0ng ri\xeang cho t\xe0 \xe1o d\xe0i m\xe0 kh\xf4ng th\u1ec3 n\xe0o nh\u1ea7m l\u1eabn \u0111\u01b0\u1ee3c v\u1edbi nh\u1eefng lo\u1ea1i ch\u1ea5t li\u1ec7u kh\xe1c.",null,B.i,B.j,null)
B.PX=new A.h("\u0110i\u1ec7n Long An (B\u1ea3o t\xe0ng C\u1ed5 v\u1eadt Cung \u0111\xecnh Hu\u1ebf) l\xe0 n\u01a1i \u0111ang tr\u01b0ng b\xe0y \u201ctuy\u1ec7t ph\u1ea9m\u201d Long b\xe0o \u0111\u1ebf v\u01b0\u01a1ng tri\u1ec1u Nguy\u1ec5n.",null,B.v,B.G,null)
B.PY=new A.h("      Ph\u1ee5 ki\u1ec7n \xe1o d\xe0i c\u1ed5 thuy\u1ec1n",null,B.a5,B.j,null)
B.Q_=new A.h("      - H\xe3y kh\xe9o l\xe9o l\u1ef1a ch\u1ecdn ki\u1ec3u d\xe1ng v\xe0 m\xe0u s\u1eafc c\u1ee7a v\xf2ng tay v\xe0 \u0111\u1ed3ng h\u1ed3 \u0111\u1ec3 tr\xe1nh l\u1ea1c qu\u1ebb so v\u1edbi ki\u1ec3u \xe1o d\xe0i b\u1ea1n \u0111ang m\u1eb7c.",null,B.i,B.j,null)
B.PZ=new A.h("      V\u1ea3i \u0111\u0169i c\xf3 \u0111\u1ed9 nh\u0103n t\u1ef1 nhi\xean v\u1ed1n c\xf3 c\u1ee7a n\xf3, n\u1ebfu b\u1ea1n c\xf3 c\u1ed1 t\xecnh l\xe0m th\u1eb3ng th\xec sau m\u1ed9t th\u1eddi gian n\xf3 c\u0169ng s\u1ebd b\u1ecb nh\u0103n l\u1ea1i. Cho n\xean \u0111\xe2y ch\xednh l\xe0 khuy\u1ebft \u0111i\u1ec3m l\u1edbn nh\u1ea5t c\u1ee7a v\u1ea3i \u0111\u0169i. Tuy nhi\xean ng\u01b0\u1ee3c l\u1ea1i nhi\u1ec1u b\u1ea1n l\u1ea1i th\xedch \u0111\u1ed9 nh\u0103n t\u1ef1 nhi\xean n\xe0y c\u1ee7a v\u1ea3i \u0111\u0169i, b\u1edfi ch\xfang tr\xf4ng l\u1ea1 m\u1eaft v\xe0 ph\xf9 h\u1ee3p v\u1edbi ki\u1ec3u \xe1o d\xe0i m\xe0 ng\u01b0\u1eddi \u0111\xf3 mu\u1ed1n t\u1ea1o ra.",null,B.i,B.j,null)
B.Q0=new A.h("      N\u1ebfu Hanbook l\xe0 qu\u1ed1c ph\u1ee5c c\u1ee7a H\xe0n Qu\u1ed1c, Kimono l\xe0 qu\u1ed1c ph\u1ee5c \u0111\u1ea5t n\u01b0\u1edbc Nh\u1eadt B\u1ea3n th\xec t\u1ea1i Vi\u1ec7t Nam chi\u1ebfc \xe1o d\xe0i ch\xednh l\xe0 b\u1ed9 qu\u1ed1c ph\u1ee5c mang h\u01a1i th\u1edf n\xe9t \u0111\u1eb9p c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u1ee7a d\xe2n t\u1ed9c. Ng\u01b0\u1ee3c d\xf2ng th\u1eddi gian, tr\u1edf v\u1ec1 nh\u1eefng trang s\u1eed h\xe0o h\xf9ng chi\u1ebfc \xe1o d\xe0i Vi\u1ec7t Nam l\xe0 m\u1ed9t trong nh\u1eefng nh\xe2n ch\u1ee9ng s\u1ed1ng m\u1ea1nh m\u1ebd \u201cng\u1eafm nh\xecn\u201d r\xf5 n\xe9t s\u1ef1 thay \u0111\u1ed5i c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc ta qua nhi\u1ec1u cu\u1ed9c kh\xe1ng chi\u1ebfn v\u1edbi h\u01a1n ng\xe0n n\u0103m B\u1eafc thu\u1ed9c v\xe0 tr\u0103m n\u0103m b\u1ecb Ph\xe1p \u0111\xf4 h\u1ed9. Kh\xf4ng \u0111\u01a1n gi\u1ea3n l\xe0 b\u1ed9 qu\u1ed1c ph\u1ee5c m\xe0 \xe1o d\xe0i c\xf2n l\xe0 \u0111\u1ea1i di\u1ec7n cho m\u1ed9t n\u1ec1n v\u0103n h\xf3a nh\xe2n sinh g\xf3i tr\u1ecdn tinh th\u1ea7n d\xe2n t\u1ed9c. ",null,B.i,null,null)
B.Q1=new A.h("      B\xean c\u1ea1nh nh\u1eefng ph\u1ee5 ki\u1ec7n \xe1o d\xe0i m\xe0 ch\xfang t\xf4i g\u1ee3i \xfd \u1edf tr\xean, c\xe1c ch\u1ecb em ph\u1ee5 n\u1eef n\xean l\u1ef1a ch\u1ecdn ph\u1ee5 ki\u1ec7n t\xf9y theo ki\u1ec3u d\xe1ng c\u1ee7a \xe1o d\xe0i. C\u1ee5 th\u1ec3:",null,B.i,B.j,null)
B.Q2=new A.h("      V\u1edbi \xe1o Nh\u1eadt B\xecnh d\xf9ng \u0111\u1ec3 m\u1eb7c h\xe0ng ng\xe0y c\u1ee7a Ho\xe0ng H\u1eadu th\xec \u0111\u01b0\u1ee3c l\xe0m b\u1eb1ng ch\u1ea5t li\u1ec7u t\u01a1 b\xe1t ti tr\u1eafng v\xe0 tr\xean \xe1o c\xf3 th\xeau hoa v\u0103n r\u1ed3ng, ph\u01b0\u1ee3ng.",null,B.i,B.j,null)
B.Q3=new A.h("      Kh\xe1c bi\u1ec7t ho\xe0n to\xe0n v\u1edbi nh\u1eefng b\u1ed9 trang ph\u1ee5c kh\xe1c b\u1ea1n c\xf3 th\u1ec3 kh\xf4ng s\u1eed d\u1ee5ng ph\u1ee5 ki\u1ec7n \u0111i k\xe8m \xe1o d\xe0i, v\xe0 khi di\u1ec7n \xe1o d\xe0i b\u1ea1n kh\xf4ng c\u1ea7n qu\xe1 ch\u1ea3i chu\u1ed1t hay ki\u1ec3u c\xe1ch cho m\xe1i t\xf3c c\u1ee7a m\xecnh.",null,B.i,B.j,null)
B.Q4=new A.h("Kh\xe1ch h\xe0ng ch\u1ee7 y\u1ebfu l\xe0 d\xe2n \u0111\u1ecba ph\u01b0\u01a1ng. C\xe1c o, c\xe1c d\xec x\u1ee9 c\u1ed1 \u0111\xf4 r\u1ea5t t\xedn nhi\u1ec7m m\u1ed7i khi mu\u1ed1n may m\u1ed9t t\u1ea5m \xe1o d\xe0i Hu\u1ebf truy\u1ec1n th\u1ed1ng.",null,B.v,B.G,null)
