B.Q7=new A.h("      V\u1ec1 hoa v\u0103n \xe1o Nh\u1eadt B\xecnh",null,B.a5,null,null)
B.Q6=new A.h("      \xc1o Nh\u1eadt B\xecnh th\u1eddi vua \u0110\u1ed3ng Kh\xe1nh \u0111\u01b0\u1ee3c m\u1eb7c v\u1edbi qu\u1ea7n \u1ed1ng m\xe0u tuy\u1ebft b\u1ea1ch, \u0111\u1ea7u c\xf3 v\u1ea5n kh\u0103n to b\u1ea3n. C\xf2n m\xe0u s\u1eafc kh\u0103n v\u1ea5n th\xec c\xf3 th\u1ec3 thay \u0111\u1ed5i theo c\u1ea5p b\u1eadc nh\u01b0 tr\u01b0\u1edbc.",null,B.i,B.j,null)
B.Q8=new A.h("Xu h\u01b0\u1edbng ch\u1ee5p h\xecnh v\u1edbi \xe1o ng\u0169 th\xe2n x\u01b0a \u0111ang g\xe2y s\u1ed1t tr\u1edf l\u1ea1i ",null,B.v,null,null)
B.Q9=new A.h("      Gi\xe1 ti\u1ec1n c\u0169ng l\xe0 m\u1ed9t v\u1ea5n \u0111\u1ec1 c\u1ea7n quan t\xe2m, v\u1ea3i g\u1ea5m c\xf3 gi\xe1 r\u1ea5t cao n\xean ng\u01b0\u1eddi ti\xeau d\xf9ng ch\u1ec9 may \xe1o g\u1ea5m v\xe0o nh\u1eefng ng\xe0y th\u1ef1c s\u1ef1 quan tr\u1ecdng. V\u1ea3i g\u1ea5m kh\xf4ng c\xf3 \u0111\u1ed9 r\u0169 nh\u01b0 l\u1ee5a hay chiffon n\xean t\xe0 \xe1o th\u01b0\u1eddng s\u1ebd h\u01a1i \u0111\u01a1.",null,B.i,B.j,null)
B.vu=new A.h("      \u0110\u1eb7c \u0111i\u1ec3m c\u1ee7a \xe1o Nh\u1eadt B\xecnh",null,B.a0,null,null)
B.Qa=new A.h("   Trang ch\u1ee7 > L\u1ec5 h\u1ed9i \xe1o d\xe0i",null,B.bf,null,null)
B.Qb=new A.h("      N\xf3n l\xe1",null,B.a0,null,null)
B.Qd=new A.h("      Nh\u1eefng m\xe0u s\u1eafc, h\u1ecda ti\u1ebft tr\xean Long B\xe0o \u0111\u1ec1u c\xf3 \xfd ngh\u0129a s\xe2u xa:",null,B.i,B.j,null)
B.Qc=new A.h("      \xc1o Nh\u1eadt B\xecnh \u2013 Ph\xe2n theo th\u1ee9 b\u1eadc",null,B.a0,B.j,null)
B.Qe=new A.h("\xc1o d\xe0i c\u01b0\u1edbi",null,B.v,B.G,null)
B.Qf=new A.h("L\u1ec5 H\u1ed9i \xc1o D\xe0i",null,B.cz,null,null)
B.Qg=new A.h("      \xc1o d\xe0i ng\u0169 th\xe2n l\xe0 m\u1eabu \xe1o d\xe0i nam n\u1eef truy\u1ec1n th\u1ed1ng \u0111\u01b0\u1ee3c may hai l\u1edbp, g\u1ed3m l\u1edbp b\xean ngo\xe0i v\xe0 l\u1edbp l\xf3t b\xean trong, mang l\u1ea1i s\u1ef1 tho\u1ea3i m\xe1i, ti\u1ec7n l\u1ee3i, g\u1ecdn g\xe0ng, k\xedn \u0111\xe1o cho ng\u01b0\u1eddi m\u1eb7c.",null,B.i,B.j,null)
B.Qh=new A.h("      \u0110\u01b0\u1ee3c d\u1ec7t t\u1eeb nhi\u1ec1u nguy\xean li\u1ec7u kh\xe1c nhau kh\xf4ng ch\u1ec9 l\xe0 l\u1ee5a n\xean v\u1ea3i r\u1ea5t \xedt nh\u0103n, t\u0103ng \u0111\u01b0\u1ee3c \u0111\u1ed9 th\u1ea9m m\u1ef9 c\u0169ng nh\u01b0 gi\xfap cho ng\u01b0\u1eddi s\u1eed d\u1ee5ng kh\xf4ng t\u1ed1n th\u1eddi gian l\xe0m th\u1eb3ng \xe1o.",null,B.i,B.j,null)
B.Qi=new A.h("      - M\u1ed9t m\xe1i t\xf3c \u0111\u01b0\u1ee3c bu\xf4ng th\u1ea3 t\u1ef1 nhi\xean k\u1ebft h\u1ee3p v\u1edbi m\u1ed9t n\u1ee5 hoa \u0111\u01a1n gi\u1ea3n ch\u1eafc ch\u1eafn s\u1ebd mang \u0111\u1ebfn cho b\u1ea1n m\u1ed9t h\xecnh \u1ea3nh duy\xean d\xe1ng v\xe0 t\u01b0\u01a1i t\u1eafn h\u01a1n bao gi\u1edd h\u1ebft.",null,B.i,B.j,null)
B.Qj=new A.h("      V\u1ea3i th\u1ed5 c\u1ea9m c\xf3 gi\xe1 th\xe0nh kh\xe1 cao, v\xe0 kh\xf4ng ph\u1ea3i l\xe0 lo\u1ea1i v\u1ea3i \u0111\u01b0\u1ee3c s\u1ea3n xu\u1ea5t h\xe0ng lo\u1ea1t tr\xean th\u1ecb tr\u01b0\u1eddng. Tuy nhi\xean v\xec s\u1ef1 \u01b0a chu\u1ed9ng c\u1ee7a ng\u01b0\u1eddi ti\xeau d\xf9ng m\xe0 h\u1ecd lu\xf4n t\xecm ki\u1ebfm v\u1ea3i th\u1ed5 c\u1ea9m \u0111\u1ec3 may nh\u1eefng t\xe0 \xe1o d\xe0i truy\u1ec1n th\u1ed1ng, th\u01b0\u1edbt tha.",null,B.i,B.j,null)
B.Qk=new A.h("D\xe0n ng\u01b0\u1eddi m\u1eabu nam tr\xecnh di\u1ec5n \xe1o d\xe0i \u1edf c\u1ea7u b\xe1n nguy\u1ec7t",null,B.v,B.G,null)
B.Ql=new A.h("      - \u0110i\u1ec1u quan tr\u1ecdng, b\u1ea1n n\xean l\u1ef1a ch\u1ecdn gi\xe0y d\xe9p c\xf3 m\xe0u s\u1eafc ph\xf9 h\u1ee3p v\u1edbi b\u1ed9 \xe1o d\xe0i. T\xf9y v\xe0o s\u1edf th\xedch v\xe0 nhu c\u1ea7u, b\u1ea1n c\xf3 th\u1ec3 ch\u1ecdn \u0111\xf4i gi\xe0y \u0111\u1ebf cao ho\u1eb7c \u0111\u1ebf th\u1ea5p. \u0110\u1eb7c bi\u1ec7t, h\xe3y ch\u1ecdn m\u1ed9t \u0111\xf4i gi\xe0y v\u1eeba ch\xe2n \u0111\u1ec3 thu\u1eadn ti\u1ec7n h\u01a1n trong qu\xe1 tr\xecnh di chuy\u1ec3n.",null,B.i,B.j,null)
B.Qm=new A.h("      \u0110\u1ecba ch\u1ec9: 57 Nguy\u1ec5n Sinh Cung, ph\u01b0\u1eddng V\u1ef9 D\u1ea1, th\xe0nh ph\u1ed1 Hu\u1ebf ",null,B.i,null,null)
B.Qn=new A.h("      C\xf3 th\u1ec3 n\xf3i chi\u1ebfc \xe1o d\xe0i Vi\u1ec7t Nam mang h\u01a1i th\u1edf c\u1ee7a c\u1ea3 m\u1ed9t d\xe2n t\u1ed9c, b\u1ea5t k\u1ef3 \u0111\u1ed9 tu\u1ed5i n\xe0o c\u0169ng c\xf3 th\u1ec3 kho\xe1c l\xean m\xecnh ni\u1ec1m t\u1ef1 h\xe0o n\xe0y, cho d\xf9 \u0111i \u0111\u1ebfn m\u1ecdi ng\u1ed1c ng\xe1ch th\xf4n qu\xean hay n\u01a1i \u0111\xe2u thu\u1ed9c v\xf9ng l\xe3nh th\u1ed5 Vi\u1ec7t Nam b\u1ea1n v\u1eabn d\u1ec5 d\xe0ng b\u1eaft g\u1eb7p t\xe0 \xe1o d\xe0i \u0111ung \u0111\u01b0a trong gi\xf3, th\u1eadt y\xeau ki\u1ec1u v\xe0 thi\u1ebft tha l\xe0m sao! Nh\u01b0 \u0111\xe3 n\xf3i \u1edf tr\xean, \u0111\u1ec3 ph\xe1t huy \u0111\xfang t\xe1c d\u1ee5ng c\u1ee7a b\u1ed9 qu\u1ed1c ph\u1ee5c Vi\u1ec7t Nam b\u1ea1n c\u1ea7n bi\u1ebft \u0111\xe2u l\xe0 th\u1eddi \u0111i\u1ec3m th\xedch h\u1ee3p n\xean di\u1ec7n v\xe0o b\u1ed9 trang ph\u1ee5c n\xe0y. V\u1eady n\xean m\u1eb7c \xe1o d\xe0i trong d\u1ecbp n\xe0o? ",null,B.i,null,null)
B.Qo=new A.h("      \xc1o d\xe0i Hu\u1ebf t\u1eeb x\u01b0a cho \u0111\u1ebfn nay \u0111\u1ec1u v\u1eabn lu\xf4n gi\u1eef \u0111\u01b0\u1ee3c nh\u1eefng n\xe9t \u0111\u1eb9p v\xf4 c\xf9ng trang nh\xe3. L\xe0 m\u1ed9t trang ph\u1ee5c truy\u1ec1n th\u1ed1ng, \xe1o d\xe0i c\u1ee7a c\u1ed1 \u0111\xf4 mang trong m\xecnh nh\u1eefng \xfd ngh\u0129a \u0111\u1eb9p \u0111\u1ebd. ",null,B.i,B.j,null)
B.Qp=new A.h("      C\u1ed1 \u0111\xf4 Hu\u1ebf \u2013 \u0111\u1ecba \u0111i\u1ec3m ch\u1ee5p \u1ea3nh \xe1o d\xe0i t\u1ea1i Hu\u1ebf b\u1ea1n kh\xf4ng th\u1ec3 b\u1ecf l\u1ee1",null,B.E,null,null)
B.Qq=new A.h("\xc1o d\xe0i ng\u0169 th\xe2n Nam v\xe0 N\u1eef",null,B.v,null,null)
B.Qr=new A.h("Nh\u1eefng ti\u1ec7m may \xe1o d\xe0i l\xe2u \u0111\u1eddi nh\u1ea5t \u1edf Hu\u1ebf",null,B.aT,null,null)
B.Qs=new A.h("      X\u1ee9 Hu\u1ebf n\u1ed5i ti\u1ebfng c\u1ea7u k\u1ef3, t\u1ec9 m\u1ec9 trong vi\u1ec7c may \u0111o \xe1o d\xe0i; bao du kh\xe1ch \u0111\u1ebfn v\u1edbi C\u1ed1 \u0111\xf4 ch\u1eafc c\u0169ng c\xf3 l\u1ea7n xao xuy\u1ebfn tr\u01b0\u1edbc h\xecnh \u1ea3nh nh\u1eefng t\xe0 \xe1o d\xe0i th\u01b0\u1edbt tha tr\xean \u0111\u01b0\u1eddng ph\u1ed1 Hu\u1ebf, \u0111\u1ec3 r\u1ed3i m\u1eb7c nhi\xean, nh\u01b0 m\u1ed9t l\u1ebd th\u01b0\u1eddng, c\u1ee9 \u0111\u1ebfn Hu\u1ebf l\xe0 ph\u1ea3i \u0111i mua v\u1ea3i \xe1o d\xe0i, may \xe1o d\xe0i \u0111\u1ec3 l\xe0m k\u1ef7 ni\u1ec7m\u2026",null,B.aE,B.j,null)
B.Qt=new A.h("Ho\xe0ng h\u1eadu Nam Ph\u01b0\u01a1ng trong trang ph\u1ee5c m\u1ec7nh ph\u1ee5 thu \u0111\xf4ng.",null,B.v,null,null)
B.Qu=new A.h("      - Kh\xf4ng n\xean l\u1ef1a ch\u1ecdn nh\u1eefng lo\u1ea1i khuy\xean tai h\u1ea7m h\u1ed1, c\xe1 t\xednh n\u1ebfu b\u1ea1n kh\xf4ng mu\u1ed1n ng\u01b0\u1eddi kh\xe1c n\xf3i m\xecnh thi\u1ebfu tinh t\u1ebf.",null,B.i,B.j,null)
B.Qv=new A.h("      V\u1ea3i l\u1ee5a c\xf3 \u0111\u1ed9 b\u1ec1n kh\xe1 cao, r\u1ea5t th\xedch h\u1ee3p \u0111\u1ec3 may \xe1o d\xe0i trong tr\u01b0\u1eddng h\u1ee3p s\u1eed d\u1ee5ng d\xe0i ng\xe0y v\xe0 trong th\u1eddi gian d\xe0i. B\xean c\u1ea1nh \u0111\xf3, v\u1ea3i l\u1ee5a c\xf2n l\xe0 ch\u1ea5t li\u1ec7u tho\xe1ng m\xe1t r\u1ea5t th\xedch h\u1ee3p khi s\u1eed d\u1ee5ng v\xe0o m\xf9a h\xe8. V\u1ea3i c\u0169ng r\u1ea5t nhanh kh\xf4 n\xean m\u1ecdi ng\u01b0\u1eddi c\xf3 th\u1ec3 y\xean t\xe2m \u0111\u01b0\u1ee3c c\xe1c v\u1ea5n \u0111\u1ec1 v\u1ec1 \u1ea9m m\u1ed1c hay sinh ra nh\u1eefng m\xf9i h\xf4i kh\xf3 ch\u1ecbu.",null,B.i,B.j,null)
B.Qw=new A.h("      N\u0103m 1806, vua Gia Long cho x\xe2y \u0111\xe0n Nam Giao t\u1ebf Tr\u1eddi. T\u1eeb \u0111\xe2y, nh\xe0 vua b\u1eaft \u0111\u1ea7u \u0111\u1ecbnh \u0111\u1ea1i l\u1ec5 Nam Giao v\xe0 l\u1ec5 ph\u1ee5c T\u1ebf Giao. Vua c\u0169ng quy \u0111\u1ecbnh vi\u1ec7c ph\xe2n bi\u1ec7t ph\u1ea9m c\u1ea5p quan ch\u1ee9c d\u1ef1a v\xe0o ph\u1ee5c ph\u1ea9m. M\u1ed9t b\u1ed9 trang ph\u1ee5c \u0111\u1ea1i tri\u1ec1u g\u1ed3m: m\u0169, \xe1o b\xe0o, \u0111ai, xi\xeam, h\xe0i t\u1ea5t. Trong \u0111\xf3, ri\xeang \u0111\u1ed1i v\u1edbi m\u0169 \xe1o \u0111\u1ea1i tri\u1ec1u c\u1ee7a ho\xe0ng \u0111\u1ebf, v\u1eadt li\u1ec7u trang tr\xed l\xe0 v\xe0ng, kim c\u01b0\u01a1ng, tr\xe2n ch\xe2u v\xe0 c\xe1c lo\u1ea1i ng\u1ecdc qu\xfd.",null,B.i,B.j,null)
B.Qx=new A.h("Th\u01b0\u1ee3ng th\u01b0 H\u1ed3ng Kh\u1eb3ng c\xf9ng c\xe1c con mang \xe1o d\xe0i t\u1ea1i L\u1ea1c T\u1ecbnh vi\xean. \u1ea2nh t\u01b0 li\u1ec7u",null,B.v,B.G,null)
B.Qy=new A.h("Vua B\u1ea3o \u0110\u1ea1i trong trang ph\u1ee5c \u0111\u1ea1i tri\u1ec1u, \u0111\u1ea7u \u0111\u1ed9i m\xe3o c\u1eedu long, ng\u1ef1 tr\xean ngai v\xe0ng trong \u0111i\u1ec7n Th\xe1i H\xf2a.",null,B.v,null,null)
B.Qz=new A.h("      Hi v\u1ecdng r\u1eb1ng \u0111\xe2y l\xe0 nh\u1eefng g\u1ee3i \xfd t\u1ed1t gi\xfap b\u1ea1n c\xf3 \u0111\u01b0\u1ee3c s\u1ef1 l\u1ef1a ch\u1ecdn h\u1ee3p l\xfd v\u1ec1 \u0111\u1ecba ch\u1ec9 may \u0111o \xe1o d\xe0i khi c\xf3 d\u1ecbp gh\xe9 Hu\u1ebf.",null,B.i,null,null)
B.QA=new A.h("   Trang ch\u1ee7 > Trang ph\u1ee5c cung \u0111\xecnh tri\u1ec1u Nguy\u1ec5n",null,B.bf,null,null)
B.QB=new A.h("      - B\xean c\u1ea1nh nh\u1eefng chi\u1ebfc l\u1eafc tay \u0111\u01b0\u1ee3c l\xe0m t\u1eeb kim lo\u1ea1i hay b\u1ea1c, v\xe0ng, b\u1ea1n ho\xe0n to\xe0n c\xf3 th\u1ec3 ch\u1ecdn l\u1ef1a cho m\xecnh m\u1ed9t chi\u1ebfc v\xf2ng tay g\u1ed7 hay \u0111\u1ed3ng h\u1ed3. N\xf3 \u0111\u1ec1u l\xe0 nh\u1eefng trang s\u1ee9c \xe1o d\xe0i mang \u0111\u1ebfn cho b\u1ea1n s\u1ef1 thanh l\u1ecbch, t\xf4n l\xean \u0111\u01b0\u1ee3c v\u1ebb duy\xean d\xe1ng c\u1ee7a ng\u01b0\u1eddi ph\u1ee5 n\u1eef.",null,B.i,B.j,null)
B.QC=new A.h("      \u2013 M\xe0u v\xe0ng \u0111em \u0111\u1ebfn s\u1ef1 t\u01b0\u01a1i tr\u1ebb tr\xe0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng: n\u1ebfn b\u1ea1n y\xeau th\xedch s\u1ef1 tr\u1ebb trung n\u0103ng \u0111\u1ed9 th\xec m\xe0u v\xe0ng l\xe0 s\u1ef1 l\u1ef1a ch\u1ecdn ho\xe0n h\u1ea3o nh\u1ea5t d\xe0nh cho b\u1ea1n. R\u1ea1ng ng\u1eddi trong t\xe0 \xe1o d\xe0i m\xe0u v\xe0ng b\u1ea1n s\u1ebd l\xe0 t\xe2m \u0111i\u1ec3m c\u1ee7a m\u1ecdi s\u1ef1 ch\xfa \xfd, v\u1eeba t\u01b0\u01a1i t\u1eafn tr\u1ebb trung, v\u1eeba nh\u1eb9 nh\xe0ng sang tr\u1ecdng.",null,B.i,null,null)
B.QD=new A.h("      M\u1ed8T S\u1ed0 L\u01afU \xdd KHI L\u1ef0A CH\u1eccN PH\u1ee4 KI\u1ec6N \u0110I K\xc8M \xc1O D\xc0I THEO T\u1eeaNG D\xc1NG \xc1O D\xc0I",null,B.a0,B.j,null)
B.QE=new A.h("      \xc1o ng\u0169 th\xe2n th\u1ec3 hi\u1ec7n \u0111\u1eb7c t\xednh khi\xeam nh\u01b0\u1eddng, k\xedn \u0111\xe1o, phong th\xe1i \u0111\u0129nh \u0111\u1ea1c v\xe0 th\u1ea9m m\u1ef9 tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi m\u1eb7c. S\u1ef1 tinh t\u1ebf c\u1ee7a \xe1o ng\u0169 th\xe2n c\xf2n \u0111\u01b0\u1ee3c th\u1ec3 hi\u1ec7n \u1edf k\u1ef9 thu\u1eadt may, gh\xe9p hoa v\u0103n \u0111\u1ea3m b\u1ea3o kh\u1edbp, t\u1eebng \u0111\u01b0\u1eddng kim th\u1eb3ng, nh\u1ecf, \u0111\u1ec1u, c\xf3 ch\u1ed7 \u0111\u01b0\u1ee3c gi\u1ea5u k\xedn kh\xf4ng \u0111\u1ec3 l\u1ed9 \u0111\u01b0\u1eddng ch\u1ec9 kh\xe2u.\u0110\u01b0\u1eddng t\xe0 \xe1o l\u01b0\u1ee3n, ch\xe2n v\u1ea1t \xe1o c\xf3 \u0111\u01b0\u1eddng cong h\xecnh c\xe1nh cung v\u1eeba s\u1ed1ng \u0111\u1ed9ng l\u1ea1i v\u1eeba uy\u1ec3n chuy\u1ec3n. Khi may \xe1o ng\u0169 th\xe2n, kh\xe2u \u0111\u1ecbnh h\xecnh c\u1ee7a t\xe0 \xe1o l\xe0 c\xf4ng \u0111o\u1ea1n ph\u1ee9c t\u1ea1p  nh\u1ea5t, v\u1ea5n \u0111\u1ec1 \u0111\u1eb9p, x\u1ea5u, c\u01a1 b\u1ea3n \u0111\u1ec1u ph\u1ee5 thu\u1ed9c v\xe0o c\xf4ng \u0111o\u1ea1n n\xe0y.     ",null,B.i,B.j,null)
B.QF=new A.h("Vua B\u1ea3o \u0110\u1ea1i, ho\xe0ng h\u1eadu Nam Ph\u01b0\u01a1ng v\xe0 ho\xe0ng th\xe1i h\u1eadu \u0110oan Huy trong trang ph\u1ee5c \xe1o d\xe0i truy\u1ec1n th\u1ed1ng c\xf9ng c\xf4ng ch\xfaa Ph\u01b0\u01a1ng Mai v\xe0 Ph\u01b0\u01a1ng Dung.",null,B.v,B.G,null)
B.QG=new A.h("M\xe3ng lan c\u1ee7a ho\xe0ng t\u1eed, m\u1eb7c trong c\xe1c d\u1ecbp l\u1ec5 l\u1ea1t quan tr\u1ecdng.",null,B.v,null,null)
B.QH=new A.h("     9. V\u1ea3i tuy\u1ebft m\u01b0a",null,B.E,null,null)
B.QI=new A.h("     L\u0103ng Minh M\u1ea1ng \u2013 \u0111\u1ecba \u0111i\u1ec3m ch\u1ee5p \xe1o d\xe0i \u1edf Hu\u1ebf c\u1ef1c ch\u1ea5t ",null,B.E,null,null)
B.QJ=new A.h("      M\u1ed7i \u0111\u1ed9 t\u1ebft \u0111\u1ebfn xu\xe2n v\u1ec1 l\xe0 d\u1ecbp ng\u01b0\u1eddi ng\u01b0\u1eddi nh\xe0 nh\xe0 nh\u1edb v\u1ec1 c\xe1c gi\xe1 tr\u1ecb truy\u1ec1n th\u1ed1ng nh\u01b0 n\u1ed3i b\xe1nh ch\u01b0ng, n\u1ed3i th\u1ecbt kho, d\u01b0a h\u1ea5u, c\u1ee7 ki\u1ec7u. Trong \u0111\xf3, m\u1eb7c \u0111\u1eb9p \u0111\u1ec3 \u0111\xf3n T\u1ebft c\u0169ng l\xe0 m\u1ed9t trong nh\u1eefng gi\xe1 tr\u1ecb truy\u1ec1n th\u1ed1ng t\u1eeb bao \u0111\u1eddi nay b\u1edfi m\u1ecdi ng\u01b0\u1eddi \u0111\u1ec1u quan ni\u1ec7m r\u1eb1ng c\xf3 m\u1ed9t c\xe1i T\u1ebft kh\u1edfi \u0111\u1ea7u no \u0111\u1ee7 \u0103n no m\u1eb7c \u1ea5m s\u1ebd l\xe0m n\xean m\u1ed9t n\u0103m m\u1edbi su\xf4n s\u1ebb, sung t\xfac \u0111\u1ea7y may m\u1eafn. ",null,B.i,null,null)
B.QK=new A.h("      - Thay v\xec l\u1ef1a ch\u1ecdn nh\u1eefng \u0111\xf4i gi\xe0y cao g\xf3t \u0111i\u1ec7u \u0111\xe0, b\u1ea1n c\xf3 th\u1ec3 k\u1ebft h\u1ee3p v\u1edbi \u0111\xf4i gi\xe0y th\u1ec3 thao v\xf4 c\xf9ng n\u0103ng \u0111\u1ed9ng v\xe0 c\xe1 t\xednh.",null,B.i,B.j,null)
B.QL=new A.h("      - B\u1ea1n h\xe3y l\u1ef1a ch\u1ecdn m\u1ed9t chi\u1ebfc b\u0103ng \u0111\xf4 c\xf3 m\xe0u s\u1eafc v\xe0 ch\u1ea5t li\u1ec7u ph\xf9 h\u1ee3p v\u1edbi \xe1o d\xe0i. Ngo\xe0i vi\u1ec7c b\u0103ng \u0111\xf4 \u1edf c\xe1c c\u1eeda h\xe0ng ph\u1ee5 ki\u1ec7n a\u0301o da\u0300i, b\u1ea1n ho\xe0n to\xe0n c\xf3 th\u1ec3 t\u1ef1 thi\u1ebft k\u1ebf cho m\xecnh m\u1ed9t b\u0103ng \u0111\xf4 \u0111\u1ed9c \u0111\xe1o, kh\xf4ng gi\u1ed1ng b\u1ea5t c\u1ee9 ai, gi\xe1 c\u1ea3 l\u1ea1i r\u1ea5t r\u1ebb. \u0110\xe2y l\xe0 ph\u1ee5 ki\u1ec7n \u0111i k\xe8m v\u1edbi \xe1o d\xe0i h\u1ecdc sinh \u0111\u01b0\u1ee3c nhi\u1ec1u b\u1ea1n l\u1ef1a ch\u1ecdn.",null,B.i,B.j,null)
B.QN=new A.h("      C\xf9ng v\u1edbi qu\xe1 tr\xecnh h\xecnh th\xe0nh v\xe0 ph\xe1t tri\u1ec3n c\u1ee7a v\xf9ng \u0111\u1ea5t Thu\u1eadn H\xf3a - Ph\xfa Xu\xe2n - Th\u1eeba Thi\xean Hu\u1ebf, chi\u1ebfc \xc1o d\xe0i Hu\u1ebf \u0111\xe3 \u0111i qua m\u1ed9t ch\u1eb7ng \u0111\u01b0\u1eddng d\xe0i v\u1edbi nhi\u1ec1u th\u0103ng tr\u1ea7m l\u1ecbch s\u1eed. D\xf9 \u1edf b\u1ea5t c\u1ee9 th\u1eddi k\u1ef3 n\xe0o, t\xe0 \xc1o d\xe0i truy\u1ec1n th\u1ed1ng v\u1eabn lu\xf4n t\xf4n vinh t\xednh c\xe1ch \u0111\u1ee9c \u0111\u1ed9, k\xedn \u0111\xe1o, th\xf9y m\u1ecb, to\xe1t l\xean \u0111\u01b0\u1ee3c th\u1ea7n th\xe1i c\u1ee7a ng\u01b0\u1eddi ph\u1ee5 n\u1eef Hu\u1ebf trong c\xe1ch \u0111i \u0111\u1ee9ng, n\xf3i n\u0103ng, \u1ee9ng x\u1eed, hay l\xe0m n\xean phong th\xe1i \u0111\u0129nh \u0111\u1ea1c - ch\xednh nh\xe2n qu\xe2n t\u1eed v\u1edbi \u201cNh\xe2n - L\u1ec5 -Ngh\u0129a - Tr\xed - T\xedn\u201d c\u1ee7a gi\u1edbi \u0111\xe0n \xf4ng v\xe0o m\u1ed7i d\u1ecbp l\u1ec5 t\u1ebft, ng\xe0y h\u1ed9i truy\u1ec1n th\u1ed1ng, hay vi\u1ec7c l\xe0ng, vi\u1ec7c h\u1ecd. C\u0169ng ch\xednh v\xec l\u1ebd \u0111\xf3 m\xe0 chi\u1ebfc \xc1o d\xe0i \u0111\xe3 tr\u1edf th\xe0nh h\xecnh \u1ea3nh g\u1eafn b\xf3 v\u1edbi cu\u1ed9c s\u1ed1ng \u0111\u1eddi th\u01b0\u1eddng c\u1ee7a ng\u01b0\u1eddi Hu\u1ebf. H\xecnh \u1ea3nh \xc1o d\xe0i c\u0169ng \u0111\xe3 \u0111\u01b0\u1ee3c t\xf4n vinh trong c\xe1c k\u1ef3 l\u1ec5 h\u1ed9i truy\u1ec1n th\u1ed1ng v\xe0 hi\u1ec7n \u0111\u1ea1i, \u0111\u1eb7c bi\u1ec7t l\xe0 c\xe1c k\u1ef3 Festival v\xe0 \u0111\xe3 tr\u1edf th\xe0nh n\xe9t v\u0103n h\xf3a \u0111\u1eb7c s\u1eafc, ri\xeang c\xf3 c\u1ee7a mi\u1ec1n n\xfai Ng\u1ef1, s\xf4ng H\u01b0\u01a1ng.",null,B.i,B.j,null)
B.QM=new A.h("      Ph\u1ee5 ki\u1ec7n \u0111i k\xe8m \xe1o d\xe0i h\u1ecdc sinh",null,B.a5,B.j,null)
B.QO=new A.h("      \u2013 M\xe0u h\u1ed3ng \u2013 m\xe0u c\u1ee7a s\u1ef1 duy\xean d\xe1ng v\xe0 d\u1ecbu d\xe0ng: n\u1ebfu chi\u1ebfc \xe1o d\xe0i m\xe0u \u0111\u1ecf \u0111em \u0111\u1ebfn s\u1ef1 quy\u1ebfn r\u1ee7, m\xe0u v\xe0ng \u0111em l\u1ea1i s\u1ef1 t\u1ef1 tin th\xec m\xe0u h\u1ed3ng t\xf4n l\xean n\xe9t duy\xean d\xe1ng, d\u1ecbu d\xe0ng cho c\xf4 d\xe2u trong ng\xe0y c\u01b0\u1edbi.",null,B.i,null,null)
B.QP=new A.h("      Trong khi trang ph\u1ee5c c\u1ee7a vua ch\xfaa c\u1ea7u k\u1ef3, r\u01b0\u1eddm r\xe0 l\xe0 v\u1eady, th\xec qu\u1ea7n \xe1o c\u1ee7a d\xe2n ch\xfang l\u1ea1i h\u1ebft s\u1ee9c gi\u1ea3n d\u1ecb: Tri\u1ec1u \u0111\xecnh b\u1eaft bu\u1ed9c: m\u0169 th\xec d\xf9ng m\u0169 phong c\xe2n s\u1eafc \u0111en, kh\xf4ng trang s\u1ee9c, \xe1o th\xec d\xf9ng \xe1o giao l\u0129nh, s\u1eafc \u0111en, h\xe0i t\u1ea5t \u0111\u1ec1u \u0111en.L\u1ea1 m\u1ed9t \u0111i\u1ec1u l\xe0 trong b\u1ed9 trang ph\u1ee5c \u0111en tuy\u1ec1n \u0111\xf3, th\u1ea7n d\xe2n c\u1ee7a nh\xe0 vua ng\u01b0\u1eddi n\xe0o c\u0169ng gi\u1ed1ng nh\u01b0 ng\u01b0\u1eddi n\xe0o nh\u01b0ng trong nh\u1eefng cu\u1ed9c tu\u1ea7n du ra mi\u1ec1n th\xf4n d\xe3, ch\u1ec9 tho\xe1ng nh\xecn nh\xe0 vua \u0111\xe3 bi\u1ebft ngay ai \u0111\u1eb9p, ai x\u1ea5u \u0111\u1ec3 tuy\u1ec3n ch\u1ecdn m\u1ef9 nh\xe2n \u0111\u01b0a v\u1ec1 cung c\u1ea5m \u0111\u1ec3 \u201cd\xf9ng\u201d d\u1ea7n. H\xf3a ra c\xe2u ng\u01b0\u1eddi \u0111\u1eb9p v\xec l\u1ee5a xem ra kh\xf4ng \u0111\xfang l\u1eafm, \u0111\xfang ra ph\u1ea3i l\xe0 ng\u01b0\u1eddi ta \u0111\u1eb9p trong m\u1eaft nh\u1eefng k\u1ebb \u0111a t\xecnh. M\xe0 nh\u1eefng k\u1ebb \u0111a t\xecnh \u1edf \u0111\xe2y l\xe0 nh\u1eefng \xf4ng vua tri\u1ec1u Nguy\u1ec5n n\xean trong ho\xe0ng cung Hu\u1ebf m\u1edbi lu\xf4n \u0111\u1ea7y \u1eafp nh\u1eefng cung t\u1ea7n m\u1ef9 n\u1eef v\xe0 d\u1ea5u t\xedch c\u1ee7a tam cung l\u1ee5c vi\u1ec7n v\u1eabn c\xf2n \u0111\u1ebfn t\u1eadn b\xe2y gi\u1edd.",null,B.i,B.j,null)
B.QQ=new A.h("      \xc1o Nh\u1eadt B\xecnh d\xe0nh cho cung t\u1ea7n",null,B.a5,null,null)
B.QR=new A.h("      - \xc1o T\u1ea5c: \xe1o t\u1ea5c c\xf3 \u1ed1ng tay \xe1o h\xecnh d\u1ea1ng g\xec? \xc1o t\u1ea5c c\xf3 ph\u1ea7n tay \xe1o b\xf3, \xf4m s\xe1t v\xe0o tay ng\u01b0\u1eddi m\u1eb7c. \xc1o \u0111\u01b0\u1ee3c m\u1eb7c c\xf9ng v\u1edbi qu\u1ea7n d\xe0i, che th\xe2n t\u1eeb c\u1ed5 qua kh\u1ecfi \u0111\u1ea7u g\u1ed1i. \xc1o t\u1ea5c nam, \xe1o t\u1ea5c n\u1eef \u0111\u1ec1u c\xf3 c\u1ed5 \u0111\u1ee9ng c\xe0i c\xfac b\xean ph\u1ea3i, t\xe0 \xe1o ch\u1eafp t\u1eeb n\u0103m m\u1ea3nh v\u1ea3i. Hi\u1ec7n c\xe1c m\u1eabu \xe1o t\u1ea5c c\xe1ch t\xe2n l\xe0 thi\u1ebft k\u1ebf \u0111\u01b0\u1ee3c kh\xe1 nhi\u1ec1u ng\u01b0\u1eddi quan t\xe2m.     ",null,B.i,B.j,null)
B.QS=new A.h("      V\u1ea3i organza hay c\xf2n \u0111\u01b0\u1ee3c g\u1ecdi l\xe0 v\u1ea3i t\u01a1 s\u1ed1ng, v\u1ea3i \u0111\u01b0\u1ee3c d\u1ec7t t\u1eeb l\u1ee5a v\xe0 c\xf3 b\u1ed5 sung th\xeam ch\u1ea5t keo. Ngo\xe0i ra v\u1ea3i \u0111\u01b0\u1ee3c d\u1ec7t v\u1edbi m\u1eadt \u0111\u1ed9 gi\u1eefa c\xe1c s\u1ee3i v\u1ea3i r\u1ea5t th\u01b0a n\xean ch\xfang ta c\xf3 th\u1ec3 nh\xecn xuy\xean th\u1ea5u qua b\u1ec1 m\u1eb7t v\u1ea3i. V\u1ea3i organza tuy ra \u0111\u1eddi \u0111\xe3 l\xe2u nh\u01b0ng \u0111\u1ed1i v\u1edbi \xe1o d\xe0i th\xec \u0111\xe2y l\u1ea1i l\xe0 m\u1ed9t ch\u1ea5t li\u1ec7u kh\xe1 m\u1edbi m\u1ebb.",null,B.i,null,null)
B.QT=new A.h(u.p,null,B.aT,null,null)
B.QW=new A.h("      Tu\u1ea7n l\u1ec5 \xc1o d\xe0i c\u1ed9ng \u0111\u1ed3ng Hu\u1ebf \u0111\u01b0\u1ee3c t\u1ed5 ch\u1ee9c nh\u1eb1m khai th\xe1c th\u1ebf m\u1ea1nh, th\u01b0\u01a1ng hi\u1ec7u v\xe0 gi\xe1 tr\u1ecb v\u0103n h\xf3a \u0111\u1ed9c \u0111\xe1o c\u1ee7a \xc1o d\xe0i Hu\u1ebf, x\xe2y d\u1ef1ng h\xecnh \u1ea3nh du l\u1ecbch Hu\u1ebf g\u1eafn v\u1edbi \xc1o d\xe0i, k\xedch c\u1ea7u du l\u1ecbch ph\xe1t tri\u1ec3n. \u0110\u1ed3ng th\u1eddi, t\xf4n vinh \xc1o d\xe0i Hu\u1ebf, \xc1o d\xe0i Vi\u1ec7t Nam, kh\u1eb3ng \u0111\u1ecbnh th\u01b0\u01a1ng hi\u1ec7u \u201cHu\u1ebf - Kinh \u0111\xf4 \xc1o d\xe0i\u201d, g\xf3p ph\u1ea7n tuy\xean truy\u1ec1n qu\u1ea3ng b\xe1 v\u0103n h\xf3a Hu\u1ebf g\u1eafn v\u1edbi qu\u1ea3ng b\xe1, x\xfac ti\u1ebfn v\u1ec1 du l\u1ecbch. Ho\u1ea1t \u0111\u1ed9ng n\xe0y c\u0169ng t\u1eebng b\u01b0\u1edbc tri\u1ec3n khai c\xf3 hi\u1ec7u qu\u1ea3 \u0110\u1ec1 \xe1n \u201cHu\u1ebf - Kinh \u0111\xf4 \xc1o d\xe0i\u201d.",null,B.i,B.j,null)
B.QV=new A.h("      \xc1o Nh\u1eadt B\xecnh d\xe0nh cho cung t\u1ea7n s\u1ebd c\xf3 nh\u1eefng s\u1ef1 kh\xe1c bi\u1ec7t sau \u0111\xe2y:",null,B.i,B.j,null)
B.QU=new A.h("      \xc1o Nh\u1eadt B\xecnh ph\xe2n theo th\u1ee9 b\u1eadc trong cung: B\u1eadc Ho\xe0ng th\xe1i h\u1eadu, ho\xe0ng h\u1eadu, c\xf4ng ch\xfaa, phi t\u1ea7n\u2026t\xf9y v\xe0o ph\u1ea9m c\u1ea5p m\xe0 c\u1ed5 ph\u1ee5c c\u0169ng nh\u01b0 ch\u1ea5t li\u1ec7u, m\xe0u s\u1eafc, hoa v\u0103n c\xf3 s\u1ef1 kh\xe1c bi\u1ec7t \u0111\u1ec3 ph\xe2n \u0111\u1ecbnh r\xf5 r\xe0ng. ",null,B.i,B.j,null)
B.QX=new A.h("      S\u1ef1 s\u1eafp x\u1ebfp hoa v\u0103n tr\xean \xe1o Nh\u1eadt B\xecnh \u0111\u01b0\u1ee3c s\u1eafp x\u1ebfp v\xe0 thay \u0111\u1ed5i d\u1ef1a theo c\u1ea5p b\u1eadc, \u0111\u1ecba v\u1ecb c\u1ee7a ng\u01b0\u1eddi m\u1eb7c. Ch\u1ec9 c\u1ea7n nh\xecn v\xe0o hoa v\u0103n l\xe0 c\xf3 th\u1ec3 ph\xe2n bi\u1ec7t danh ph\u1eadn v\xe0 vai v\u1ebf c\u1ee7a ng\u01b0\u1eddi \u0111\xf3. \u0110\u1ed1i v\u1edbi \xe1o cho c\u1ea5p H\u1eadu th\xec quy ch\u1ebf kh\xf4ng \u0111\u01b0\u1ee3c \xe1p d\u1ee5ng. ",null,B.i,null,null)
B.QY=new A.h("      - Khi ch\u1ecdn hoa c\xe0i \u0111\u1ea7u b\u1ea1n n\xean d\u1ef1a v\xe0o m\xe0u s\u1eafc v\xe0 ki\u1ec3u d\xe1ng c\u1ee7a \xe1o d\xe0i \u0111\u1ec3 tr\xe1nh l\xe0m m\u1ea5t s\u1ef1 h\xe0i h\xf2a v\xe0 th\u1ea9m m\u1ef9 c\u1ee7a t\u1ed5ng th\u1ec3 trang ph\u1ee5c.",null,B.i,B.j,null)
B.R_=new A.h("      Ch\xf9a Thi\xean M\u1ee5 \u2013 \u0111\u1ecba \u0111i\u1ec3m ch\u1ee5p \u1ea3nh \xe1o d\xe0i n\xe0ng th\u01a1 \u1edf Hu\u1ebf ",null,B.E,null,null)
B.R0=new A.h("      \xc1o d\xe0i ch\xednh l\xe0 m\u1ed9t trang ph\u1ee5c truy\u1ec1n th\u1ed1ng \u0103n s\xe2u v\xe0o ti\u1ec1m th\u1ee9c c\u1ee7a m\u1ed7i ng\u01b0\u1eddi d\xe2n Vi\u1ec7t. Tuy nhi\xean, \xe1o d\xe0i m\u1ed7i mi\u1ec1n \u0111\u1ec1u s\u1ebd c\xf3 s\u1ef1 kh\xe1c bi\u1ec7t. Trong \u0111\xf3, \u0111\u1eb7c bi\u1ec7t nh\u1ea5t v\xe0 \u0111\u01b0\u1ee3c xem nh\u01b0 l\xe0 s\u1ea3n ph\u1ea9m du l\u1ecbch ch\xednh l\xe0 t\xe0 \xe1o d\xe0i Hu\u1ebf . M\u1ed9t nh\xe2n ch\u1ee9ng l\u1ecbch s\u1eed \u0111i qua bao nhi\xeau n\u0103m th\u1eddi gian v\u1eabn kh\xf4ng h\u1ec1 b\u1ecb phai ph\xf4i. Trong b\xe0i vi\u1ebft n\xe0y, h\xe3y c\xf9ng  nh\u1eafc l\u1ea1i h\xe0nh tr\xecnh l\u1ecbch s\u1eed c\u1ee7a t\xe0 \xe1o d\xe0i x\u1ee9 Hu\u1ebf \u0111\u1ec3 tr\u1edf th\xe0nh m\u1ed9t s\u1ea3n ph\u1ea9m du l\u1ecbch \u0111\u01b0\u1ee3c \u01b0a chu\u1ed9ng. C\xf9ng t\xecm hi\u1ec3u nh\xe9!",null,B.vs,B.j,null)
B.QZ=new A.h("     8. V\u1ea3i voan",null,B.E,null,null)
B.R1=new A.h("      2. Ti\u1ec7m may M\u1ef9 L\u1ec7",null,B.a5,B.j,null)
B.R2=new A.h("      - H\u01a1n n\u1eefa, v\xec l\xe0 ph\u1ee5 ki\u1ec7n \u0111i k\xe8m v\u1edbi \xe1o d\xe0i, b\u1ea1n n\xean l\u1ef1a ch\u1ecdn t\xfai x\xe1ch ph\xf9 h\u1ee3p v\u1edbi \xe1o d\xe0i, theo \u0111\xf3 t\xfai x\xe1ch ph\u1ea3i c\xf3 k\xedch th\u01b0\u1edbc v\u1eeba ph\u1ea3i, c\xf3 th\u1ec3 ch\u1ecdn lo\u1ea1i c\xf3 d\xe2y c\u1ea7m tay ng\u1eafn ho\u1eb7c d\u1ea1ng v\xed nh\u1ecf \u0111\u1ec1u \u0111\u01b0\u1ee3c. T\xfai x\xe1ch n\xean \u0111\u01b0\u1ee3c thi\u1ebft k\u1ebf theo phong c\xe1ch \u0111\u01a1n gi\u1ea3n, \u0111\u01a1n s\u1eafc ho\u1eb7c th\xeam m\u1ed9t s\u1ed1 chi ti\u1ebft nh\u01b0 \u0111\xednh \u0111\xe1 ho\u1eb7c ng\u1ecdc trai chi\u1ebfc t\xfai tr\u1edf n\xean sang tr\u1ecdng h\u01a1n.",null,B.i,B.j,null)
B.R3=new A.h("Long b\xe0o c\u1ee7a vua, m\u1eb7c l\xfac thi\u1ebft \u0111\u1ea1i tri\u1ec1u.",null,B.v,null,null)
B.R4=new A.h("     \xc1o d\xe0i \u2013 trang ph\u1ee5c trong ng\xe0y khai tr\u01b0\u01a1ng, khai m\u1ea1c c\xf4ng ty, l\u1ec5 ra m\u1eaft s\u1ea3n ph\u1ea9m: ",null,B.E,null,null)
B.R5=new A.h("Ho\xe0ng h\u1eadu Nam Ph\u01b0\u01a1ng m\u1eb7c \xe1o d\xe0i c\u1ed5 truy\u1ec1n, \u0111\u1ea7u ch\xedt kh\u0103n v\xe0nh.",null,B.v,null,null)
B.R6=new A.h("      Ngay tr\xean \u0111\u01b0\u1eddng l\xean \u0111\u1ed3i V\u1ecdng C\u1ea3nh, du kh\xe1ch s\u1ebd b\u1eaft g\u1eb7p m\u1ed9t l\xe0ng ngh\u1ec1 \u0111ang \u1ea9n m\xecnh b\xean d\xf2ng s\xf4ng H\u01b0\u01a1ng. D\xf9 mang v\u1ebb \u0111\u1eb9p b\xecnh d\u1ecb, y\xean b\xecnh nh\u01b0ng l\xe0ng h\u01b0\u01a1ng Th\u1ee7y Xu\xe2n v\u1eabn r\u1ea5t n\u1ed5i b\u1eadt, thu h\xfat ngay t\u1eeb c\xe1i nh\xecn \u0111\u1ea7u ti\xean b\u1edfi nh\u1eefng l\xe0n h\u01b0\u01a1ng r\u1ef1c r\u1ee1 s\u1eafc m\xe0u. Tr\u01b0\u1edbc \u0111\xe2y, c\xe1c s\u1ea3n ph\u1ea9m \u0111\xe8n th\u1eafp s\xe1ng th\xf4ng th\u01b0\u1eddng ch\u1ec9 c\xf3 2 m\xe0u c\u01a1 b\u1ea3n l\xe0 \u0111\u1ecf v\xe0 n\xe2u. Nh\u01b0ng \u0111\u1ec3 thu h\xfat nhi\u1ec1u du kh\xe1ch, ng\u01b0\u1eddi d\xe2n trong l\xe0ng \u0111\xe3 b\u1eaft tay v\xe0o t\xecm ki\u1ebfm, s\xe1ng t\u1ea1o k\u1ebft h\u1ee3p th\xe0nh nhi\u1ec1u m\xe0u kh\xe1c nhau nh\u01b0 xanh, \u0111\u1ecf, t\xedm, v\xe0ng. Khi \u0111\u1ebfn \u0111\u1ecba \u0111i\u1ec3m ch\u1ee5p \u1ea3nh \xe1o d\xe0i \u0111\u1eb9p n\xe0y, b\u1ea1n c\xf3 th\u1ec3 ch\u1ecdn \xe1o d\xe0i c\xf3 m\xe0u s\u1eafc t\u01b0\u01a1i s\xe1ng v\xe0 h\u1ecda ti\u1ebft \u0111\u01a1n gi\u1ea3n nh\xe9! Ch\u1eafc ch\u1eafn \u0111\xe2y s\u1ebd l\xe0 \u0111\u1ecba \u0111i\u1ec3m ch\u1ee5p \u1ea3nh v\u1edbi chi\u1ebfc \xe1o d\xe0i khi\u1ebfn b\u1ea1n m\xea m\u1ea9n.",null,B.i,B.j,null)
B.R7=new A.h("      C\u0169ng ch\xednh v\xec nh\u1eefng \u0111i\u1ec1u k\u1ec3 tr\xean m\xe0 \xe1o d\xe0i \u0111\xe3 tr\u1edf th\xe0nh h\xecnh \u1ea3nh kh\xf4ng th\u1ec3 n\xe0o xa r\u1eddi \u0111\u01b0\u1ee3c ng\u01b0\u1eddi d\xe2n c\u1ed1 \u0111\xf4. \u0110\u1eb7c bi\u1ec7t, t\xe0 \xe1o d\xe0i c\u0169ng \u0111\xe3 \u0111\u01b0\u1ee3c t\xf4n vinh trong nhi\u1ec1u l\u1ec5 h\u1ed9i truy\u1ec1n th\u1ed1ng v\xe0 hi\u1ec7n \u0111\u1ea1i. Trong \u0111\xf3 c\xf3 c\xe1c k\u1ef3 Festival, tr\u1edf th\xe0nh m\u1ed9t \u0111i\u1ec3m n\xe9t v\u0103n h\xf3a \u0111\u1eb7c s\u1eafc c\u1ee7a Hu\u1ebf. ",null,B.i,B.j,null)
B.R8=new A.h("     \xc1o d\xe0i Hu\u1ebf - H\xe0nh tr\xecnh l\u1ecbch s\u1eed",null,B.E,null,null)
B.R9=new A.h("Ho\xe0ng th\xe1i t\u1eed B\u1ea3o Long (con vua B\u1ea3o \u0110\u1ea1i) m\u1eb7c \xe1o sa k\xe9p, \u0111\u1ea7u \u0111\u1ed9i kh\u0103n x\u1ebfp.",null,B.v,null,null)
B.Ra=new A.h("      V\u1ea3i l\u1ee5a c\u0169ng r\u1ea5t m\u1ec1m m\u1ea1i g\u1ea7n gi\u1ed1ng v\u1edbi v\u1ea3i chiffon, tuy nhi\xean v\u1ea3i l\u1ee5a d\xe0y h\u01a1n v\xe0 c\xf3 \u0111\u1ed9 b\xf3ng h\u01a1n. V\u1ea3i l\u1ee5a \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi s\u1eed d\u1ee5ng may \xe1o d\xe0i trong r\u1ea5t nhi\u1ec1u tr\u01b0\u1eddng h\u1ee3p nh\u01b0 \u0111i h\u1ecdc, may \xe1o d\xe0i c\u01b0\u1edbi, \xe1o d\xe0i t\u1ebft\u2026 V\u1ea3i l\u1ee5a c\u0169ng c\xf3 \u0111\u1ed9 r\u0169, \u0111\xe2y l\xe0 m\u1ed9t \u01b0u \u0111i\u1ec3m kh\xe1 t\u1ed1t gi\xfap cho ng\u01b0\u1eddi m\u1eb7c che \u0111i \u0111\u01b0\u1ee3c nh\u1eefng khuy\u1ebft \u0111i\u1ec3m tr\xean c\u01a1 th\u1ec3.",null,B.i,null,null)
B.Rb=new A.h("Ho\xe0ng th\xe1i h\u1eadu \u0110oan Huy (v\u1ee3 vua Kh\u1ea3i \u0110\u1ecbnh, m\u1eb9 vua B\u1ea3o \u0110\u1ea1i) trong trang ph\u1ee5c \u0110\u1ea1i tri\u1ec1u.",null,B.v,null,null)
B.Rc=new A.h("\xc1o sa k\xe9p xu\xe2n h\u1ea1 c\xf4ng ch\xfaa.",null,B.v,null,null)
B.Rd=new A.h("Ra \u0111\u1eddi t\u1eeb n\u0103m 1955, qua th\u1eddi gian, \xe1o d\xe0i Minh T\xe2n v\u1eabn nhi\u1ec7t huy\u1ebft v\u1edbi ngh\u1ec1 v\xe0 \u0111\u01b0\u1ee3c l\u01b0u truy\u1ec1n t\u1eeb th\u1ebf h\u1ec7 n\xe0y \u0111\u1ebfn th\u1ebf h\u1ec7 kh\xe1c.",null,B.v,B.G,null)
B.Re=new A.h("      H\xecnh \u1ea3nh \xc1o d\xe0i l\xe0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a ng\u01b0\u1eddi con g\xe1i Vi\u1ec7t Nam. S\u1ef1 duy\xean d\xe1ng d\u1ecbu d\xe0ng c\u1ee7a m\u1ed7i c\xf4 g\xe1i khi mang trong m\xecnh b\u1ed9 \xe1o d\xe0i lu\xf4n l\xe0 h\xecnh \u1ea3nh \u0111\u1eb9p v\xe0 l\xe2u qu\xean trong m\u1eaft ng\u01b0\u1eddi \u0111\u1ed1i di\u1ec7n. Hi\u1ec7n nay, \xe1o d\xe0i \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng nhi\u1ec1u trong m\u1ed7i d\u1ecbp l\u1ec5, bu\u1ed5i ti\u1ec7c hay c\xe1c s\u1ef1 ki\u1ec7n quan tr\u1ecdng nh\u01b0 c\u01b0\u1edbi h\u1ecfi,\u2026Th\u1ebf n\xean ch\u1ecdn mua v\u1ea3i v\xe0 may cho m\xecnh b\u1ed9 \xe1o d\xe0i \u0111\u1eb9p, h\u1ee3p th\u1eddi trang \u0111ang l\xe0 s\u1ef1 l\u1ef1a ch\u1ecdn r\u1ea5t c\u1ea7n thi\u1ebft c\u1ee7a m\u1ed7i ng\u01b0\u1eddi.",null,B.aE,B.j,null)
B.KO=new A.o(!0,null,null,null,null,null,18,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.Rf=new A.h("Thi\u1ebft k\u1ebf: T\xf4n Th\u1ea5t Minh Nh\u1eadt\nTrang web kh\xf4ng \u0111\u01b0\u1ee3c sao ch\xe9p d\u01b0\u1edbi b\u1ea5t k\u1ef3 h\xecnh th\u1ee9c n\xe0o v\xec ch\u01b0a \u0111\u01b0\u1ee3c xin ph\xe9p b\u1ea3n quy\u1ec1n",null,B.KO,null,null)
B.Rg=new A.h("      \xc1o Nh\xe2\u0323t Bi\u0300nh va\u0300 Phi Phong co\u0301 kha\u0301c nhau kh\xf4ng?",null,B.a0,null,null)
B.Rh=new A.h('V\u1edbi s\u1ef1 kh\xe9o l\xe9o, t\u1ec9 m\u1ec9, c\u1ea7n m\u1eabn, t\xe2m huy\u1ebft v\xe0 \u0111am m\xea, anh Nguy\u1ec5n Qu\u1ed1c H\xf2a \u0111\xe3 \u0111\u01b0\u1ee3c ng\u01b0\u1eddi cha - \xf4ng Nguy\u1ec5n V\u0103n Song cho n\u1ed1i nghi\u1ec7p. Anh c\u0169ng \u0111\xe3 theo ngh\u1ec1 \u0111\u01b0\u1ee3c 30 n\u0103m: \u201cN\u0103m 1992, b\u1ed1 t\xf4i b\u1eaft \u0111\u1ea7u truy\u1ec1n ngh\u1ec1 cho t\xf4i. T\xf4i \u0111\xe3 n\u1eafm h\u1ebft \u0111\u01b0\u1ee3c nh\u1eefng g\xec \xf4ng truy\u1ec1n l\u1ea1i. C\xf3 nh\u1eefng c\xe1i t\xf4i ph\u1ea3i ph\xe1t tri\u1ec3n th\xeam theo xu h\u01b0\u1edbng c\u1ee7a \xe1o d\xe0i th\u1eddi \u0111\u1ea1i m\u1edbi".',null,B.v,B.G,null)
B.Ri=new A.h("     1. V\u1ea3i chiffon",null,B.E,null,null)
B.Rj=new A.h("      So v\u1edbi nh\u1eefng lo\u1ea1i \xe1o d\xe0i kh\xe1c, ph\u1ee5 ki\u1ec7n \u0111i k\xe8m \xe1o d\xe0i c\xe1ch t\xe2n c\xf3 ph\u1ea7n \u201ctho\xe1ng\u201d h\u01a1n r\u1ea5t nhi\u1ec1u.",null,B.i,B.j,null)
B.Rl=new A.h("      Cung An \u0110\u1ecbnh \u2013 \u0110\u1ecba \u0111i\u1ec3m ch\u1ee5p h\xecnh \u1edf Hu\u1ebf xu\u1ea5t hi\u1ec7n trong MV ca s\u0129 n\u1ed5i ti\u1ebfng",null,B.E,null,null)
B.Rk=new A.h('B\u1ed9 \xe1o d\xe0i mang t\xean "R\u1ed3ng ch\u1ea7u m\u1eb7t tr\u1eddi" gi\xfap T\u01b0\u1eddng San gi\xe0nh gi\u1ea3i trang ph\u1ee5c d\xe2n t\u1ed9c',null,B.v,B.G,null)
B.Rm=new A.h("      - \u0110\u1ec3 g\u01b0\u01a1ng m\u1eb7t tr\u1edf n\xean b\u1eebng s\xe1ng, b\u1ea1n n\xean l\u1ef1a ch\u1ecdn nh\u1eefng lo\u1ea1i khuy\xean tai th\xedch h\u1ee3p v\u1edbi m\xe0u s\u1eafc v\xe0 ki\u1ec3u d\xe1ng c\u1ee7a \xe1o d\xe0i. Nh\u1eefng \u0111\xf4i khuy\xean tai ng\u1ecdc trai, \u0111\xednh \u0111\xe1 ch\xednh ph\u1ee5 ki\u1ec7n \u0111i k\xe8m v\u1edbi \xe1o d\xe0i ph\xf9 h\u1ee3p v\u1edbi nhi\u1ec1u d\xe1ng \xe1o d\xe0i gi\xfap b\u1ea1n tr\u1edf n\xean n\u1ed5i b\u1eadt.",null,B.i,B.j,null)
B.Ro=new A.h("      Qui \u0111\u1ecbnh nghi\xeam ng\u1eb7t l\xe0 v\u1eady nh\u01b0ng \u0111\xf4i l\xfac c\u0169ng c\xf3 nh\u1eefng ph\xe1 l\u1ec7 r\u1ea5t th\xfa v\u1ecb. Chi\u1ebfc \xe1o Th\u01b0\u1eddng tri\u1ec1u c\u1ee7a vua Kh\u1ea3i \xd0\u1ecbnh hi\u1ec7n l\u01b0u gi\u1eef \u1edf B\u1ea3o t\xe0ng C\u1ed5 v\u1eadt Cung \u0111\xecnh Hu\u1ebf, ngo\xe0i hoa v\u0103n r\u1ed3ng m\xe2y, th\u1ee7y ba nh\u01b0 th\xf4ng l\u1ec7 c\xf2n \u0111i\u1ec3m xuy\u1ebft 18 \u0111\xf3a h\u1ed3ng nhung th\xeau kim tuy\u1ebfn v\xe0 ch\u1ec9 b\xf3ng, c\xf9ng hai b\xf4ng c\xfac \u0111\u1ea1i \u0111\xf3a \u1edf tr\u01b0\u1edbc ng\u1ef1c v\xe0 sau l\u01b0ng. Tr\xean m\u1ed9t \xe1o kh\xe1c c\u1ee7a vua c\xf2n c\xf3 h\xecnh chim ph\u01b0\u1ee3ng \u0111\u1ed1i m\u1eb7t v\u1edbi r\u1ed3ng trong v\u1ea7ng m\xe2y h\xecnh c\u1ea7u. Vua Kh\u1ea3i \xd0\u1ecbnh l\xe0 con ng\u01b0\u1eddi th\xedch m\xe0u m\xe8, chu\u1ed9ng s\u1ef1 m\u1edbi l\u1ea1, k\u1ef3 d\u1ecb n\xean kh\xf4ng ch\u1ec9 trong trang ph\u1ee5c m\xe0 c\u1ea3 trong cung \u0111i\u1ec7n, l\u0103ng t\u1ea9m c\u1ee7a vua, c\xe1 t\xednh \u0111\u1ed9c \u0111\xe1o \u0111\xf3 c\u1ee7a \xf4ng c\u0169ng l\xf3 d\u1ea1ng \u1edf nhi\u1ec1u n\u01a1i m\xe0 Thi\xean \xd0\u1ecbnh Cung l\xe0 m\u1ed9t v\xed d\u1ee5 c\u1ee5 th\u1ec3.",null,B.i,B.j,null)
B.Rn=new A.h("      Thi\xean An l\xe0 m\u1ed9t v\xf9ng \u0111\u1ed3i n\xfai nh\u1ea5p nh\xf4 n\u1eb1m \u1edf ph\xeda Nam th\xe0nh ph\u1ed1 Hu\u1ebf, tr\xean \u0111\u01b0\u1eddng v\xe0o l\u0103ng Kh\u1ea3i \u0110\u1ecbnh, c\xe1ch ng\xe3 ba C\u1ea7u Lim kho\u1ea3ng 2km. Thi\xean An hi\u1ec7n ra tr\u01b0\u1edbc m\u1eaft b\u1ea1n m\u1ed9t m\xe0u xanh m\u01b0\u1edbt c\u1ee7a b\u1ea1t ng\xe0n th\xf4ng v\u1edbi nh\u1eefng th\u1eeda ru\u1ed9ng xen canh, m\xe1i l\xe1 v\xe0 con \u0111\u01b0\u1eddng d\u1ed1c ngo\u1eb1n ngo\xe8o ch\u1ea1y v\xe0o k\xfd \u1ee9c.",null,B.i,B.j,null)
B.Rp=new A.h("      Th\u1ec3 hi\u1ec7n truy\u1ec1n th\u1ed1ng v\u0103n h\xf3a d\xe2n t\u1ed9c",null,B.i4,null,null)
B.Rq=new A.h("      C\xf3 r\u1ea5t nhi\u1ec1u ph\u1ee5 ki\u1ec7n \u0111i k\xe8m \xe1o d\xe0i, \u0111\u1eb7c bi\u1ec7t l\xe0 \xe1o d\xe0i c\xe1ch t\xe2n. B\xean c\u1ea1nh nh\u1eefng ph\u1ee5 ki\u1ec7n c\u01a1 b\u1ea3n tr\xean, b\u1ea1n c\xf3 th\u1ec3 mix c\xf9ng m\u1ed9t chi\u1ebfc k\xednh tr\xe1ng g\u01b0\u01a1ng s\xe0nh \u0111i\u1ec7u hay m\u1ed9t chi\u1ebfc m\u0169 beret th\u1eddi trang. N\u1ebfu kh\xf4ng ph\u1ea3i l\xe0 nh\u1eefng d\u1ecbp quan tr\u1ecdng, h\xe3y ch\u1ecdn cho m\xecnh m\u1ed9t \u0111\xf4i d\xe9p sandal hay b\xfap b\xea \u0111\u1ec3 di chuy\u1ec3n nh\u1eb9 nh\xe0ng h\u01a1n nh\xe9!",null,B.i,B.j,null)
B.Rr=new A.h("      Khi bi\xean so\u1ea1n b\u1ed9 \u0111i\u1ec3n l\u1ec7 n\u1ed5i ti\u1ebfng c\u1ee7a tri\u1ec1u Nguy\u1ec5n, Kh\xe2m \u0111\u1ecbnh \xd0\u1ea1i Nam h\u1ed9i \u0111i\u1ec3n s\u1ef1 l\u1ec7, c\xe1c s\u1eed quan c\u1ee7a tri\u1ec1u \u0111\xecnh \u0111\xe3 d\xe0nh quy\u1ec3n 78 v\xe0 quy\u1ec3n 242 \u0111\u1ec3 b\xe0n v\u1ec1 vi\u1ec7c \u0103n m\u1eb7c c\u1ee7a c\xe1c b\u1eadc \u0111\u1ebf, h\u1eadu, ho\xe0ng t\u1eed, c\xf4ng ch\xfaa, quan l\u1ea1i\u2026 tri\u1ec1u Nguy\u1ec5n, t\u1eeb trang ph\u1ee5c d\xf9ng trong c\xe1c d\u1ecbp tri\u1ec1u l\u1ec5, kh\xe1nh ti\u1ebft, t\u1ebft nh\u1ee9t, cho \u0111\u1ebfn th\u01b0\u1eddng ph\u1ee5c, k\u1ec3 c\u1ea3 n\u1ed9i y, \u201cph\u1ee5 ki\u1ec7n\u201d...",null,B.aE,B.j,null)
B.Rs=new A.h("       Ph\xe2n lo\u1ea1i:",null,B.vq,B.bE,null)
B.Rt=new A.h("      Trang ph\u1ee5c trong ho\xe0ng cung nh\xe0 Nguy\u1ec5n c\xf3 nhi\u1ec1u lo\u1ea1i v\u1edbi t\xean g\u1ecdi ri\xeang, m\xe0u s\u1eafc ri\xeang. Hi\u1ec7n v\u1eadt ph\u1ee5c ch\u1ebf Long b\xe0o ho\xe0ng \u0111\u1ebf \u0111ang \u0111\u01b0\u1ee3c tr\u01b0ng b\xe0y t\u1ea1i B\u1ea3o t\xe0ng C\u1ed5 v\u1eadt Cung \u0111\xecnh Hu\u1ebf. \u0110\xe2y l\xe0 m\u1ed9t t\u1ea5m \xe1o r\u1ea5t l\u1ed9ng l\u1eaby, \u0111\u01b0\u1ee3c ch\u1ebf t\xe1c r\u1ea5t c\xf4ng phu. S\u1ef1 uy nghi \u0111\u1ebf v\u01b0\u01a1ng th\u1ec3 hi\u1ec7n r\xf5 n\xe9t qua h\xecnh t\u01b0\u1ee3ng r\u1ed3ng, ch\u1ea5t li\u1ec7u g\u1ea5m, l\u1ee5a v\xe0ng v\u01b0\u01a1ng gi\u1ea3. C\xf9ng v\u1edbi h\xecnh r\u1ed3ng l\xe0 hai ch\u1eef H\xe1n hai b\xean \u1edf ph\xeda tr\xean.",null,B.i,B.j,null)
B.Ru=new A.h("Chi\xeam ng\u01b0\u1ee1ng \u2018tuy\u1ec7t ph\u1ea9m\u2019 Long b\xe0o",null,B.cz,null,null)
B.Rv=new A.h('\u0110\u1ebfn v\u1edbi "Tr\u01b0ng b\xe0y \xc1o d\xe0i truy\u1ec1n th\u1ed1ng Hu\u1ebf", du kh\xe1ch s\u1ebd \u0111\u01b0\u1ee3c l\u1eafng nghe h\u01a1i th\u1edf c\u1ee7a th\u1eddi gian, \u0111an xen gi\u1eefa qu\xe1 kh\u1ee9 - hi\u1ec7n t\u1ea1i c\xf9ng nh\u1eefng gi\xe1 tr\u1ecb v\u0103n h\xf3a, ngh\u1ec7 thu\u1eadt truy\u1ec1n th\u1ed1ng nh\u1eb9 nh\xe0ng tung bay tr\xean nh\u1eefng t\xe0 \xe1o th\u01b0\u1edbt tha',null,B.v,B.G,null)
B.Rw=new A.h("Tri\u1ec1u Nguy\u1ec5n c\xf3 nh\u1eefng quy \u0111\u1ecbnh kh\xe1c bi\u1ec7t v\u1ec1 trang ph\u1ee5c cho c\xe1c giai t\u1ea7ng trong x\xe3 h\u1ed9i, d\u1ef1a tr\xean c\xe1c ti\xeau ch\xed: ch\u1ea5t li\u1ec7u v\u1ea3i, m\xe0u s\u1eafc, c\xe1ch may, h\u1ecda ti\u1ebft trang tr\xed, th\u1eadm ch\xed c\u1ea3 s\u1ed1 l\u01b0\u1ee3ng y ph\u1ee5c d\xe0nh cho t\u1eebng h\u1ea1ng ng\u01b0\u1eddi c\u0169ng c\xf3 nh\u1eefng quy \u0111\u1ecbnh r\u1ea5t ch\u1eb7t ch\u1ebd.",null,B.v,B.G,null)
B.Rx=new A.h("      C\xf9ng v\u1edbi s\u1ef1 h\xecnh th\xe0nh v\xe0 ph\xe1t tri\u1ec3n c\u1ee7a v\xf9ng d\u1ea5t Thu\u1eadn H\xf3a - Ph\xfa Xu\xe2n - Th\u1eeba Thi\xean Hu\u1ebf. \xc1o d\xe0i Hu\u1ebf \u0111\xe3 ph\xe1t tri\u1ec3n m\u1ed9t ch\u1eb7ng \u0111\u01b0\u1eddng d\xe0i v\u1edbi nhi\u1ec1u th\u0103ng tr\u1ea7m c\u1ee7a l\u1ecbch s\u1eed. D\xf9 qua bao nhi\xeau n\u0103m, \xe1o d\xe0i c\u1ed1 \u0111\xf4 v\u1eabn gi\u1eef ri\xeang n\xe9t k\xedn \u0111\xe1o, th\xf9y m\u1ecb, to\xe1t l\xean m\u1ed9t v\u1ebb th\u1ea7n th\xe1i c\u1ee7a ng\u01b0\u1eddi ph\u1ee5 n\u1eef Hu\u1ebf trong c\xe1ch \u0111i \u0111\u1ee9ng, l\u1ec5 ngh\u0129a n\xf3i n\u0103ng, c\u01b0 x\u1eed. \xc1o d\xe0i c\u1ed1 \u0111\xf4 kh\xf4ng d\xe0i ch\u1ea5m g\xf3t c\u0169ng kh\xf4ng x\u1ebb t\xe0 qu\xe1 cao. C\u1ed5 \xe1o cao v\u1eeba ph\u1ea3i, c\xf3 \u0111\u01b0\u1eddng eo \u0111\u01b0\u1ee3c chi\u1ebft \xf4m l\u1ea5y \u0111\u01b0\u1eddng cong thanh m\u1ea3nh c\u1ee7a c\u01a1 th\u1ec3. Kh\xf4ng qu\xe1 b\xf3 s\xe1t gi\xfap ng\u01b0\u1eddi ph\u1ee5 n\u1eef gi\u1eef \u0111\u01b0\u1ee3c n\xe9t thanh l\u1ecbch, kh\xf4ng h\u1ec1 l\u1eb3ng l\u01a1. ",null,B.i,B.j,null)
B.Ry=new A.h("Vua Kh\u1ea3i \u0110\u1ecbnh m\u1eb7c \xe1o t\u1ebf Giao, \u0111\u1ed9i m\u0169 b\xecnh thi\xean, ng\u1ef1 tr\xean ngai v\xe0ng.",null,B.v,null,null)
B.eW=new A.h("C\xf4ng ch\xfaa M\u1ef9 L\u01b0\u01a1ng - con g\xe1i Vua D\u1ee5c \u0110\u1ee9c di\u1ec7n trang ph\u1ee5c Nh\u1eadt B\xecnh.",null,B.v,B.G,null)
