B.RA=new A.h("      Ch\u1ec9 c\xf3 tr\xean \xe1o vua, h\u1eadu ng\u01b0\u1eddi ta m\u1edbi trang tr\xed th\xeam c\xe1c hoa v\u0103n t\u1ee9 th\u1eddi, b\xe1t b\u1eedu, c\xf2n tr\xean \xe1o m\xe3o c\u1ee7a v\u01b0\u01a1ng t\xf4n v\xe0 cung giai, b\xe1t b\u1eedu \u0111\u01b0\u1ee3c thay th\u1ebf b\u1eb1ng nh\u1eefng c\u1ed5 \u0111\u1ed3. Ngay c\u1ea3 ch\u1eef H\xe1n trang tr\xed tr\xean \xe1o m\xe3o c\u0169ng c\xf3 s\u1ef1 ph\xe2n bi\u1ec7t. \xc1o vua th\u01b0\u1eddng th\xeau n\u1ed5i c\xe1c ch\u1eef Ph\xfac, L\u1ed9c, Th\u1ecd \u0111\u1ea1i t\u1ef1 theo l\u1ed1i ch\u1eef tri\u1ec7n, trong khi c\xe1c ch\u1eef Ph\xfac, L\u1ed9c, Th\u1ecd tr\xean \xe1o ph\u1ee5 n\u1eef th\u01b0\u1eddng nh\u1ecf h\u01a1n v\xe0 d\u1ec7t ch\xecm tr\xean m\u1eb7t v\u1ea3i, kh\xf4ng n\u1ea1m tr\xe2n ch\xe2u hay th\xeau kim tuy\u1ebfn nh\u01b0 tr\xean \xe1o m\u0169 c\u1ee7a vua v\xe0 th\u01b0\u1eddng th\u1ec3 hi\u1ec7n theo l\u1ed1i ch\u1eef ch\xe2n",null,B.i,B.j,null)
B.RB=new A.h("      \u0110\u1ecba ch\u1ec9: 4 \u0110inh Ti\xean Ho\xe0ng, Ph\u01b0\u1eddng Thu\u1eadn Th\xe0nh, Th\xe0nh ph\u1ed1 Hu\u1ebf ",null,B.i,null,null)
B.RC=new A.h("M\xe3ng b\xe0o c\u1ee7a ho\xe0ng t\u1eed, m\u1eb7c l\xfac thi\u1ebft \u0111\u1ea1i tri\u1ec1u.",null,B.v,null,null)
B.RD=new A.h("      L\u1ecbch s\u1eed tr\xf4i qua \u0111\u1ec3 l\u1ea1i nh\u1eefng d\u1ea5u \u1ea5n v\u0103n h\xf3a \u0111\u1eb9p \u0111\u1ebd tr\u01b0\u1eddng t\u1ed3n m\xe3i theo th\u1eddi gian. Th\u1eddi k\u1ef3 nh\xe0 Nguy\u1ec5n \u0111\xe3 h\xecnh th\xe0nh nh\u1eefng th\xe0nh t\u1ef1u v\u1ec1 trang ph\u1ee5c, l\xe0 b\u01b0\u1edbc \u0111\u1ec7m cho nh\u1eefng ph\xe1t tri\u1ec3n v\u01b0\u1ee3t tr\u1ed9i sau n\xe0y. Trong \u0111\xf3, ch\xfang ta ph\u1ea3i k\u1ec3 \u0111\u1ebfn chi\u1ebfc \xe1o Nh\u1eadt B\xecnh, lo\u1ea1i trang ph\u1ee5c truy\u1ec1n th\u1ed1ng Vi\u1ec7t Nam d\xe0nh cho n\u1eef gi\u1edbi ho\xe0ng t\u1ed9c th\u1eddi b\u1ea5y gi\u1edd. Ngo\xe0i gi\xe1 tr\u1ecb v\u1ec1 m\u1eb7t th\u1ea9m m\u1ef9, \xe1o d\xe0i Nh\u1eadt B\xecnh c\xf2n mang nhi\u1ec1u gi\xe1 tr\u1ecb l\u1ecbch s\u1eed v\xe0 \xfd ngh\u0129a v\u0103n h\xf3a.",null,B.aE,B.j,null)
B.RE=new A.h("\xc1o d\xe0i t\u1ea5c \u0111\u01b0\u1ee3c kh\xf4i ph\u1ee5c l\u1ea1i th\xe0nh trend hi\u1ec7n nay",null,B.v,null,null)
B.RF=new A.h("      \xc1o d\xe0i v\u1ea3i organza th\xedch h\u1ee3p cho nh\u1eefng b\u1ea1n n\xe0o c\xf3 s\u1edf th\xedch ch\u1ee5p \u1ea3nh, b\u1edfi ch\xfang t\u1ea1o n\xean \u0111\u01b0\u1ee3c s\u1ef1 nh\u1eb9 nh\xe0ng, thanh tho\xe1t m\xe0 \xedt ch\u1ea5t li\u1ec7u n\xe0o \u0111em \u0111\u1ebfn \u0111\u01b0\u1ee3c.",null,B.i,B.j,null)
