B.RK=new A.h("     \xc1o d\xe0i tr\u1edf th\xe0nh \u0111\u1ed3ng ph\u1ee5c c\u1ee7a nh\xe2n vi\xean ng\xe2n h\xe0ng, ti\u1ebfp vi\xean h\xe0ng kh\xf4ng:",null,B.E,null,null)
B.RL=new A.h("      \xc1o Nh\u1eadt B\xecnh l\xe0 g\xec ? \xc1o Nh\u1eadt B\xecnh l\xe0 c\u1ed5 ph\u1ee5c mang v\u1ebb \u0111\u1eb9p sang tr\u1ecdng, quy\u1ec1n qu\xfd d\xe0nh cho ho\xe0ng h\u1eadu, c\xf4ng ch\xfaa, c\xe1c phi t\u1ea7n v\xe0 n\u1eef gi\u1edbi qu\xfd t\u1ed9c m\u1eb7c khi xu\u1ea5t gi\xe1. \xc1o Nh\u1eadt B\xecnh l\xe0 ki\u1ec3u \xe1o x\u1ebb c\u1ed5, c\xf3 d\u1ea1ng \u0111\u1ed1i kh\xe2m, c\u1ed5 \xe1o h\xecnh ch\u1eef nh\u1eadt to b\u1ea3n, d\u01b0\u1edbi \u1ee9c c\xf3 d\xe2y v\u1ea3i bu\u1ed9c 2 v\u1ea1t \xe1o. Th\u01b0\u1eddng ph\u1ee5c n\xe0y xu\u1ea5t hi\u1ec7n t\u1eeb th\u1eddi vua Gia Long cho \u0111\u1ebfn cu\u1ed1i th\u1eddi nh\xe0 Nguy\u1ec5n. Trong kho\u1ea3ng th\u1eddi gian \u0111\xf3, b\u1ea5t k\u1ec3 n\u1eef nh\xe2n qu\xfd t\u1ed9c n\xe0o c\u0169ng \u0111\u1ec1u m\u1eb7c \xc1o Nh\u1eadt B\xecnh, v\u1ea5n kh\u0103n v\xe0nh.",null,B.i,B.j,null)
B.RM=new A.h("      V\u1ea3i organza th\u01b0\u1eddng \u0111\u01b0\u1ee3c k\u1ebft h\u1ee3p v\u1edbi nhi\u1ec1u ch\u1ea5t li\u1ec7u kh\xe1c \u0111\u1ec3 may \xe1o d\xe0i. V\u1ea3i organza gi\xfap t\xe0 \xe1o d\xe0i tr\u1edf n\xean tinh t\u1ebf v\xe0 c\xf3 m\u1ed9t v\u1ebb \u0111\u1eb9p r\u1ea5t kh\xe1c l\u1ea1.",null,B.i,null,null)
B.RN=new A.h("      Kh\xf4ng ch\u1ec9 l\xe0 thi\xean \u0111\u01b0\u1eddng th\u01b0\u1edfng th\u1ee9c \u1ea9m th\u1ef1c \u0111\u1eb7c s\u1eafc c\u1ee7a \u0111\u1ea5t c\u1ed1 \u0111\xf4, ch\u1ee3 \u0110\xf4ng Ba c\xf2n l\xe0 \u0111\u1ecba \u0111i\u1ec3m ch\u1ee5p \u1ea3nh \xe1o d\xe0i \u0111\u1eb9p \u1edf Hu\u1ebf m\xe0 b\u1ea1n kh\xf4ng n\xean b\u1ecf qua. Ch\u1ee3 ngay trung t\xe2m th\xe0nh ph\u1ed1, g\u1ea7n s\xf4ng H\u01b0\u01a1ng v\u1edbi khung c\u1ea3nh kh\xe1 s\xf4i \u0111\u1ed9ng v\xe0 h\u1ed1i h\u1ea3. \u0110i\u1ec3m check in \u0111\u1eb9p nh\u1ea5t \u1edf \u0111\xe2y c\xf3 l\u1ebd l\xe0 khu v\u1ef1c ngo\xe0i c\u1ed5ng ch\u1ee3 v\u1edbi t\u1ea5m bi\u1ec3n ph\xeda tr\u01b0\u1edbc. B\u1ea1n c\xf3 th\u1ec3 ch\u1ecdn b\u1ea5t k\u1ef3 trang ph\u1ee5c n\xe0o m\xecnh th\xedch, v\xec \u0111\u1ecba \u0111i\u1ec3m ch\u1ee5p \u1ea3nh n\xe0y c\xf3 th\u1ec3 c\xe2n nh\u1eafc m\u1ecdi kh\xe1i ni\u1ec7m.",null,B.i,B.j,null)
B.RO=new A.h("      V\xe2\u0323y n\xean g\u1ecdi \u201c\xe1o Nh\u1eadt B\xecnh c\xe1ch t\xe2n\u201d sao cho chu\xe2\u0309n?",null,B.a0,null,null)
B.RP=new A.h("      Sau th\u1eddi Nguy\u1ec5n, lo\u1ea1i trang ph\u1ee5c n\xe0y tr\u1edf th\xe0nh b\u1ed9 \xe1o trang tr\u1ecdng cho gi\u1edbi qu\xfd t\u1ed9c, m\u1eb7c v\xe0o m\u1ed9t s\u1ed1 d\u1ecbp l\u1ec5, nh\u1ea5t l\xe0 ng\xe0y c\u01b0\u1edbi. C\xf3 r\u1ea5t nhi\u1ec1u n\xe0ng d\xe2u x\u1ee9 Hu\u1ebf l\u1ef1a ch\u1ecdn m\u1eabu \xe1o Nh\u1eadt B\xecnh \u0111\u1ec3 kho\xe1c l\xean m\xecnh v\xe0o ng\xe0y vui tr\u1ecdng \u0111\u1ea1i c\u1ee7a \u0111\u1eddi m\xecnh.",null,B.i,B.j,null)
B.RQ=new A.h("      Tr\u1ea3i qua nhi\u1ec1u th\u1ebf h\u1ec7, \xe1o d\xe0i Hu\u1ebf  v\u1eabn ch\u01b0a t\u1eebng m\u1ed9t ph\xfat gi\xe2y n\xe0o mai m\u1ed9t c\u1ea3. S\u1ef1 h\xecnh th\xe0nh c\u1ee7a \xe1o d\xe0i x\u1ee9 Hu\u1ebf l\xe0 b\u1eaft \u0111\u1ea7u t\u1eeb v\u01b0\u01a1ng tri\u1ec1u nh\xe0 Nguy\u1ec5n. V\xe0 m\u1ed9t d\u1ea5u m\u1ed1c v\xf4 c\xf9ng quan tr\u1ecdng c\u1ee7a trang ph\u1ee5c \xe1o d\xe0i x\u1ee9 Hu\u1ebf l\xe0 v\xe0o n\u0103m 1744. Khi ch\xfaa Nguy\u1ec5n Ph\xfac Kho\xe1t l\xean ng\xf4i \u1edf Ph\xfa Xu\xe2n th\xec \u0111\xe3 \u0111\u01b0a ra nhi\u1ec1u ch\u1ee7 tr\u01b0\u01a1ng thay \u0111\u1ed5i y ph\u1ee5c. ",null,B.i,B.j,null)
B.RR=new A.h("      \u0110\u1ebfn Hu\u1ebf, \u0111\u0103ng k\xfd \u0111\u1ecba \u0111i\u1ec3m v\xe0 ch\u1ee5p \u1ea3nh chi\u1ebfc \xe1o d\xe0i \u0111\u1ea7u ti\xean trong t\xe2m tr\xed t\u1ea5t nhi\xean b\u1ea1n s\u1ebd l\xe0 \u0110\u1ea1i N\u1ed9i Hu\u1ebf r\u1ed3i ph\u1ea3i kh\xf4ng n\xe0o! L\xe0m th\u1ebf n\xe0o b\u1ea1n c\xf3 th\u1ec3 b\u1ecf l\u1ee1 \u0111\u1ecba \u0111i\u1ec3m huy\u1ec1n tho\u1ea1i n\xe0y? V\u1edbi v\u1ebb c\u1ed5 k\xednh, nguy nga, nh\u1eefng ki\u1ebfn \u200b\u200btr\xfac k\u1ef3 c\xf4ng nh\u01b0 Ng\u1ecd M\xf4n, \u0111i\u1ec7n Th\xe1i H\xf2a v\xe0 c\xe1c cung \u0111i\u1ec7n s\u1ebd gi\xfap nh\u1eefng b\u1ee9c \u1ea3nh c\u1ee7a b\u1ea1n tr\u1edf n\xean ngh\u1ec7 thu\u1eadt h\u01a1n r\u1ea5t nhi\u1ec1u. \u0110\u1eb7c bi\u1ec7t v\u1edbi kh\xf4ng gian n\xe0y, b\u1ea1n c\xf3 th\u1ec3 ch\u1ecdn \xe1o d\xe0i m\xe0u \u0111\u1ecf ho\u1eb7c v\xe0ng v\xec l\xean h\xecnh s\u1ebd n\u1ed5i b\u1eadt h\u01a1n r\u1ea5t nhi\u1ec1u. Ngo\xe0i ra, b\u1ea1n c\xf3 th\u1ec3 ch\u1ecdn th\xeam nh\u1eefng ph\u1ee5 ki\u1ec7n nh\u01b0 n\xf3n l\xe1 \u0111\u1ec3 mix c\xf9ng t\xe0 \xe1o d\xe0i. \u0110\u1ec3 t\u1eadn h\u01b0\u1edfng h\u1ebft v\u1ebb \u0111\u1eb9p t\u1ea1i \u0110\u1ea1i N\u1ed9i Hu\u1ebf, b\u1ea1n n\xean ch\u1ecdn ch\u1ee5p \u1ea3nh \u1edf ch\u1ebf \u0111\u1ed9 g\xf3c r\u1ed9ng, v\xec nh\u01b0 v\u1eady s\u1ebd bao qu\xe1t h\u1ebft m\u1ed9t c\xf4ng tr\xecnh ho\xe0n ch\u1ec9nh. \u0110i\u1ec1u n\xe0y ch\u1eafc ch\u1eafn l\xe0 \u0111\u1ecba \u0111i\u1ec3m ch\u1ee5p \u1ea3nh \xe1o d\xe0i \u0111\u1eb9p th\xedch h\u1ee3p v\u1edbi \xe1o d\xe0i \u1edf Hu\u1ebf m\xe0 b\u1ea1n kh\xf4ng n\xean b\u1ecf qua.",null,B.i,B.j,null)
B.RS=new A.h("      \u1ede nh\u1eefng c\u1ed9t m\u1ed1c quan tr\u1ecdng trong \u0111\u1eddi, \xe1o d\xe0i s\u1ebd l\xe0 trang ph\u1ee5c tuy\u1ec7t v\u1eddi nh\u1ea5t d\xe0nh cho b\u1ea1n. H\xe3y nhanh ch\xf3ng t\xecm ki\u1ebfm cho m\xecnh m\u1ed9t b\u1ed9 \xe1o d\xe0i \u01b0ng \xfd ch\u1ee5p v\xe0i t\u1ea5m h\xecnh c\xf9ng b\xe8 b\u1ea1n, gia \u0111\xecnh, th\u1ea7y c\xf4 ghi d\u1ea5u kho\u1ea3nh kh\u1eafc \u0111\xe1ng nh\u1edb n\xe0y nh\xe9.",null,B.i,null,null)
B.RT=new A.h("      M\u1ed7i ch\u1ea5t li\u1ec7u s\u1ebd c\xf3 nh\u1eefng \u0111\u1eb7c t\xednh kh\xe1c nhau, v\xe0 ch\xfang s\u1ebd khi\u1ebfn cho nh\u1eefng t\xe0 \xe1o d\xe0i c\xf3 s\u1ef1 thay \u0111\u1ed5i v\u1ec1 v\u1ebb b\xean ngo\xe0i. V\xec v\u1eady, b\u1ea1n c\u1ea7n c\xf3 kinh nghi\u1ec7m trong vi\u1ec7c l\u1ef1a ch\u1ecdn ch\u1ea5t li\u1ec7u sao cho ph\xf9 h\u1ee3p v\u1edbi nhu c\u1ea7u s\u1eed d\u1ee5ng c\u1ee7a b\u1ea3n th\xe2n.",null,B.i,B.j,null)
B.RU=new A.h("\xd4ng Nguy\u1ec5n V\u0103n Song c\xf3 th\xe2m ni\xean g\u1ea7n 70 n\u0103m may \xe1o d\xe0i.",null,B.v,B.G,null)
B.RV=new A.h("      \xc1o d\xe0i kh\xf4ng ch\u1ec9 l\xe0 trang ph\u1ee5c cho nh\u1eefng ng\u01b0\u1eddi \u0111\xe0n \xf4ng th\u1ef1c hi\u1ec7n vi\u1ec7c l\u1edbn. M\xe0 c\xf2n l\xe0 trang ph\u1ee5c \u0111i\u1ec3m xuy\u1ebfn v\xe0 t\u0103ng th\xeam ph\u1ea7n n\xe9t \u0111\u1eb9p c\u1ee7a ng\u01b0\u1eddi con g\xe1i. \xc1o d\xe0i \u0111\u01b0\u1ee3c xem l\xe0 c\xe2y th\u01b0\u1edbc, c\xf3 th\u1ec3 \u0111o \u0111\u1ea1c, u\u1ed1n n\u1eafn cho m\u1ed7i ng\u01b0\u1eddi ph\u1ee5 n\u1eef. L\xe0 c\xe2y th\u01b0\u1edbc v\xf4 h\xecnh t\u0103ng th\xeam n\xe9t duy\xean d\xe1ng, \u0111\u1eb1m th\u1eafm. Gi\xfap ng\u01b0\u1eddi con g\xe1i k\xecm n\xe9n \u0111\u01b0\u1ee3c nh\u1eefng b\u1ed3ng b\u1ed9t, t\u1ea1o n\xean nh\u1eefng b\u01b0\u1edbc khoan thai trang nh\xe3. \xc1o d\xe0i g\u1eafn b\xf3 v\u1edbi ng\u01b0\u1eddi con g\xe1i v\u1edbi th\u1eddi gian r\u1ea5t d\xe0i. K\u1ec3 c\u1ea3 th\u1eddi h\u1ecdc sinh cho \u0111\u1ebfn nh\u1eefng d\u1ecbp c\u01b0\u1edbi h\u1ecfi, ti\u1ec7c t\xf9ng c\u1ee7a l\xe0ng, c\u1ee7a h\u1ecd,\u2026",null,B.i,B.j,null)
B.RW=new A.h("      V\u1ea3i c\xf3 \u0111\u1ed9 r\u0169 v\xe0 \u0111\u1ed9 b\xf3ng r\u1ea5t cao n\xean t\u1ea1o \u0111\u01b0\u1ee3c nh\u1eefng \u0111i\u1ec3m nh\u1ea5n cho trang ph\u1ee5c. V\u1ea3i voan c\xf2n c\xf3 tr\u1ecdng l\u01b0\u1ee3ng nh\u1eb9 khi\u1ebfn ng\u01b0\u1eddi m\u1eb7c c\u1ea3m th\u1ea5y d\u1ec5 ch\u1ecbu v\xf4 c\xf9ng. M\xe0u s\u1eafc c\u0169ng r\u1ea5t phong ph\xfa, tha h\u1ed3 cho c\xe1c b\u1ea1n l\u1ef1a ch\u1ecdn.",null,B.i,B.j,null)
B.RX=new A.h('      L\u1ec5 h\u1ed9i \xe1o d\xe0i \u0111\u01b0\u1ee3c xem l\xe0 m\u1ed9t trong nh\u1eefng ch\u01b0\u01a1ng tr\xecnh "\u0111inh" nh\u1ea5t c\u1ee7a tu\u1ea7n l\u1ec5 Festival Hu\u1ebf khi\u1ebfn bao nhi\xeau du kh\xe1ch ph\u1ea3i sao xuy\u1ebfn tr\u01b0\u1edbc m\xe0n tr\xecnh di\u1ec5n trang ph\u1ee5c \xe1o d\xe0i do c\xe1c nh\xe0 thi\u1ebft k\u1ebf v\xe0 ng\u01b0\u1eddi m\u1eabu x\u1ee9 Hu\u1ebf t\u1ea1o n\xean.  ',null,B.aE,B.j,null)
