B.RY=new A.h("      L\u0103ng T\u1ef1 \u0110\u1ee9c (Khi\xeam L\u0103ng) bao g\u1ed3m khu t\u1ea9m \u0111i\u1ec7n v\xe0 khu l\u0103ng t\u1ea9m v\u1edbi t\u1ed5ng di\u1ec7n t\xedch h\u01a1n 12 ha. L\u1ed1i ki\u1ebfn \u200b\u200btr\xfac \u0111\u1ed9c \u0111\xe1o, tinh kh\xf4i ch\u1eafc ch\u1eafn s\u1ebd mang l\u1ea1i cho du kh\xe1ch nhi\u1ec1u tr\u1ea3i nghi\u1ec7m \u1ea5n t\u01b0\u1ee3ng. M\u1ed9t s\u1ed1 \u0111\u1ecba \u0111i\u1ec3m trong l\u0103ng b\u1ea1n n\xean tham quan nh\u01b0 Khi\xeam Cung M\xf4n, C\u1eeda V\u0169 Khi\xeam, \u0110i\u1ec7n L\u01b0\u01a1ng Khi\xeam, Minh Khi\xeam \u0110\u01b0\u1eddng, Chi Khi\xeam \u0110\u01b0\u1eddng, h\u1ed3 L\u01b0u Khi\xeam, Xung Khi\xeam T\u1ea1, D\u0169 Khi\xeam T\u1ea1, Hoa Khi\xeam cung, T\u0129nh Khi\xeam \u0111\u1ea3o .",null,B.i,B.j,null)
B.RZ=new A.h("     Ph\u1ee5 ki\u1ec7n \xe1o d\xe0i c\u1ed5 tr\xf2n",null,B.a5,B.j,null)
B.S_=new A.h("      \u0110\u1ed1i v\u1edbi nh\u1eefng b\u1ea1n \u01b0u \xe1i h\u01a1n \u0111\u01b0\u1ee3c s\u1edf h\u1eefu l\xe0n da tr\u1eafng th\xec c\xe1c b\u1ea1n n\xean ch\u1ecdn v\u1ea3i c\xf3 m\xe0u \u0111\u1ecf, xanh d\u01b0\u01a1ng, v\xe0ng\u2026 \u0110\xe2y l\xe0 c\xe1c m\xe0u s\u1eafc kh\xf4ng nh\u1eefng gi\xfap b\u1ea1n n\u1ed5i b\u1eadt h\u01a1n m\xe0 ch\xfang c\xf2n t\xf4n th\xeam cho l\xe0n da tr\u1eafng c\u1ee7a b\u1ea1n.",null,B.i,B.j,null)
B.S0=new A.h("      \u0110\u1ebfn th\u1eddi Nguy\u1ec5n, v\u1edbi t\u01b0 t\u01b0\u1edfng th\u1ed1ng nh\u1ea5t v\u1ec1 v\u0103n h\xf3a, Ho\xe0ng \u0111\u1ebf Minh M\u1ea1ng \u0111\xe3 quy\u1ebft \u0111\u1ecbnh ch\u1ecdn \xe1o ng\u0169 th\xe2n l\xe0m th\u01b0\u1eddng ph\u1ee5c c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t Nam, kh\xf4ng ph\xe2n bi\u1ec7t \u0111\u1eb3ng c\u1ea5p hay v\xf9ng mi\u1ec1n, v\xe0 quy\u1ebft li\u1ec7t th\u1ef1c hi\u1ec7n c\xf4ng cu\u1ed9c c\u1ea3i c\xe1ch \u0111\u1ec3 th\u1ed1ng nh\u1ea5t trang ph\u1ee5c trong to\xe0n qu\u1ed1c v\u1ed1n \u0111\xe3 \u0111\u01b0\u1ee3c \u0111\u1eb7t n\u1ec1n m\xf3ng t\u1eeb th\u1eddi ch\xfaa Nguy\u1ec5n Ph\xfac Kho\xe1t. T\u1eeb \u0111\xf3, chi\u1ebfc \xc1o d\xe0i ng\u0169 th\xe2n- \xe1o d\xe0i Hu\u1ebf \u0111\u01b0\u1ee3c ch\xfa tr\u1ecdng, tr\xe2n qu\xfd v\xe0 tr\u1edf th\xe0nh trang ph\u1ee5c ch\xednh c\u1ee7a ng\u01b0\u1eddi d\xe2n, k\u1ec3 c\u1ea3 nam v\xe0 n\u1eef, \u0111\u01b0\u1ee3c \xe1p d\u1ee5ng r\u1ed9ng r\xe3i, th\u1ed1ng nh\u1ea5t tr\xean ph\u1ea1m vi to\xe0n qu\u1ed1c. ",null,B.i,B.j,null)
