B.S4=new A.h("      V\u1ea3i l\u1ee5a r\u1ea5t d\u1ec5 b\u1ecb nh\u0103n k\u1ec3 c\u1ea3 trong khi s\u1eed d\u1ee5ng hay sau khi gi\u1eb7t. \u0110i\u1ec1u n\xe0y l\xe0m gi\u1ea3m \u0111i t\xednh th\u1ea9m m\u1ef9 c\u1ee7a t\xe0 \xe1o d\xe0i khi \u0111ang s\u1eed d\u1ee5ng. Ngo\xe0i ra v\u1ea3i c\xf3 gi\xe1 th\xe0nh kh\xe1 cao, n\xean kh\xf4ng ph\u1ea3i ai c\u0169ng c\xf3 th\u1ec3 l\u1ef1a ch\u1ecdn v\u1ea3i l\u1ee5a \u0111\u1ec3 may \xe1o d\xe0i.",null,B.i,B.j,null)
B.S5=new A.h("     6. V\u1ea3i th\u1ed5 c\u1ea9m",null,B.E,null,null)
B.S6=new A.h("      V\u1ea3i voan kh\xe1 m\u1ecfng d\u1ec5 \u0111\u1ec3 l\u1ed9 ph\u1ea7n c\u01a1 th\u1ec3 b\xean trong ra b\xean ngo\xe0i \xe1o. \u0110i\u1ec1u n\xe0y c\xf3 h\u01a1i ph\u1ea3n c\u1ea3m nh\u01b0ng s\u1ebd \u0111\u01b0\u1ee3c kh\u1eafc ph\u1ee5c b\u1edfi l\u1edbp v\u1ea3i l\xf3t b\xean trong. V\xe0 trong \u0111i\u1ec1u ki\u1ec7n nhi\u1ec7t \u0111\u1ed9 cao, v\u1ea3i d\u1ec5 b\u1ecb h\u01b0 b\u1ecfng.",null,B.i,B.j,null)
B.S7=new A.h("      \u0110\xe2y \u0111\u01b0\u1ee3c coi l\xe0 m\u1ed9t trong nh\u1eefng ng\xf4i tr\u01b0\u1eddng hi\xean \u0111\u1eb9p nh\u1ea5t Vi\u1ec7t Nam, v\u1edbi h\u01a1n 100 n\u0103m l\u1ecbch s\u1eed, mang \u0111\u1eadm d\u1ea5u \u1ea5n ki\u1ebfn \u200b\u200btr\xfac Ph\xe1p \u0111\u1ea7u th\u1ebf k\u1ef7 20. Khu\xf4n vi\xean r\u1ed9ng r\xe3i, tho\xe1ng m\xe1t, c\xf3 h\xe0ng r\u1ed9ng, m\xe1i ng\xf3i ,\u2026 c\u1eeda s\u1ed5 k\xednh ch\u1edbp, c\xf9ng v\u1edbi c\u1ed5ng v\xe0 t\u01b0\u1eddng r\xe0o m\xe0u \u0111\u1ecf t\u1ed1i. B\u1ed1i c\u1ea3nh r\u1ea5t \u0111\u1eb9p, d\xf9 \u0111\u1ee9ng \u1edf g\xf3c \u0111\u1ed9 n\xe0o b\u1ea1n c\u0169ng s\u1ebd c\xf3 \u0111\u01b0\u1ee3c b\u1ed9 \u1ea3nh \u1ea5n t\u01b0\u1ee3ng.",null,B.i,B.j,null)
B.S8=new A.h("      T\xfai x\xe1ch",null,B.a0,null,null)
