B.Sa=new A.h("      V\u1ea3i nhung c\xf3 \u0111\u1ed9 m\u1ec1m v\xe0 m\u1ecbn gi\xfap t\xe0 \xe1o d\xe0i t\u1ea1o ra \u0111\u01b0\u1ee3c n\xe9t \u0111\u1eb7c tr\u01b0ng ri\xeang. Kh\xf4ng nh\u1eefng th\u1ebf v\u1ea3i c\xf3 \u0111\u1ed9 b\u1ec1n r\u1ea5t cao, kh\xf4ng b\u1ecb nh\u0103n v\xe0 b\u1ec1 m\u1eb7t v\u1ea3i c\u0169ng r\u1ea5t th\xe2n thi\u1ec7n v\u1edbi l\xe0n da nh\u1ea1y c\u1ea3m. V\u1ea3i nhung \u0111\u01b0\u1ee3c d\u1ec7t v\u1edbi hai m\u1eb7t ho\xe0n to\xe0n kh\xe1c nhau, l\u1edbp b\xean trong th\u01b0\u1eddng l\xe0 l\u1edbp v\u1ea3i tr\u01a1n n\xean khi m\u1eb7c v\xe0o ng\u01b0\u1eddi, \xe1o d\xe0i kh\xf4ng g\xe2y ra s\u1ef1 kh\xf3 ch\u1ecbu.",null,B.i,B.j,null)
B.Sb=new A.h("      Nhi\u1ec1u ng\u01b0\u1eddi cho r\u1eb1ng vi\u1ec7c thay \u0111\u1ed5i vi\u1ec1n c\u1ed5 hay \u0111\u1ed5i v\u1ecb tr\xed n\xfat \xe1o th\xec n\xf3 tr\u1edf th\xe0nh \xe1o Nh\u1eadt B\xecnh c\xe1ch t\xe2n. Nh\u01b0ng kh\xf4ng c\xf3 b\u1ea5t k\u1ef3 quy ch\u1ebf r\xe0ng bu\u1ed9c n\xe0o v\u1ec1 s\u1ed1 l\u01b0\u1ee3ng, v\u1ecb tr\xed n\xfat, \u0111\u1ed9 d\xe0i \xe1o,\u2026",null,B.i,B.j,null)
B.Sc=new A.h("     N\xe9t \u0111\u1eb9p h\u1ecdc \u0111\u01b0\u1eddng trong t\xe0 \xe1o d\xe0i tr\u1eafng: ",null,B.E,null,null)
B.Sd=new A.h("\xc1o d\xe0i ng\u0169 th\xe2n: Ngu\u1ed3n g\u1ed1c v\xe0 \xfd ngh\u0129a c\u1ee7a \xe1o ng\u0169 th\xe2n",null,B.aT,null,null)
B.Se=new A.h("      C\xe1c ph\u1ee5 ki\u1ec7n \u0111i k\xe8m b\u1ed9 trang ph\u1ee5c d\xe0nh cho cung t\u1ea7n nh\u1ecb giai l\xe0 1 chi\u1ebfc m\u0169 Ng\u0169 ph\u01b0\u1ee3ng Kim \u01b0\u1edbc ph\xe1t, 10 c\xe2y tr\xe2m hoa. ",null,B.i,B.j,null)
