B.Sh=new A.h('      Tu\u1ea7n l\u1ec5 \xc1o d\xe0i c\u1ed9ng \u0111\u1ed3ng Hu\u1ebf c\xf2n c\xf3 ho\u1ea1t \u0111\u1ed9ng c\u1ed9ng \u0111\u1ed3ng v\u1edbi ch\u1ee7 \u0111\u1ec1 \u201c\xc1o d\xe0i v\xe0 kh\xf4ng gian thao di\u1ec5n\u201d nh\u01b0 t\u1ed5 ch\u1ee9c kh\xf4ng gian tr\u01b0ng b\xe0y, thao di\u1ec5n ngh\u1ec1 may \xc1o d\xe0i, ngh\u1ec1 n\xf3n l\xe1 Hu\u1ebf ; Ch\u01b0\u01a1ng tr\xecnh ngh\u1ec7 thu\u1eadt \u201c\xc1o d\xe0i v\xe0 d\xe2n gian \u0111\u1ea5t B\u1eafc\u201d; T\u1ecda \u0111\xe0m v\u1edbi ch\u1ee7 \u0111\u1ec1 "\xc1o d\xe0i v\xe0 gi\u1edbi tr\u1ebb" d\xe0nh cho c\xe1c b\u1ea1n h\u1ecdc sinh, sinh vi\xean nh\u1eb1m truy\u1ec1n c\u1ea3m h\u1ee9ng v\xe0 \u0111\u1ecbnh h\u01b0\u1edbng cho gi\u1edbi tr\u1ebb; T\u1ed5 ch\u1ee9c Cu\u1ed9c thi t\xecm hi\u1ec3u \u201c\xc1o d\xe0i Hu\u1ebf\u201d ; T\u1ed5 ch\u1ee9c ch\u01b0\u01a1ng tr\xecnh \u201c\xc1o d\xe0i v\xe0 di s\u1ea3n\u201d t\u1ea1i Qu\u1ed1c T\u1eed Gi\xe1m Hu\u1ebf.',null,B.i,B.j,null)
B.Si=new A.h("      Ng\xe0y nay, v\u1edbi s\u1ee9c s\xe1ng t\u1ea1o c\u1ee7a con ng\u01b0\u1eddi v\xe0 s\u1ef1 ph\xe1t tri\u1ec3n c\u1ee7a c\xf4ng ngh\u1ec7 m\xe1y m\xf3c m\xe0 ch\xfang ta c\xf3 th\u1ec3 s\u1eed d\u1ee5ng nhi\u1ec1u lo\u1ea1i v\u1ea3i h\u01a1n \u0111\u1ec3 may \xe1o Nh\u1eadt B\xecnh. C\xf3 th\u1ec3 k\u1ec3 t\xean m\u1ed9t s\u1ed1 nh\u01b0 l\u1ee5a, g\u1ea5m,\u2026l\xe0 nh\u1eefng ch\u1ea5t li\u1ec7u l\xean form \u0111\u1eb9p, tho\u1ea3i m\xe1i v\xe0 d\u1ec5 s\u1eed d\u1ee5ng. ",null,B.i,B.j,null)
B.Sj=new A.h("      V\u1ea3i \u0111\u0169i \u0111\u01b0\u1ee3c d\u1ec7t t\u1eeb s\u1ee3i th\xf4 c\u1ee7a k\xe9n t\u01a1 t\u1eb1m, n\xean n\xf3 c\u0169ng \u0111\u01b0\u1ee3c th\u1eeba h\u01b0\u1edfng m\u1ed9t s\u1ed1 \u01b0u \u0111i\u1ec3m t\u1ed1t c\u1ee7a v\u1ea3i l\u1ee5a t\u01a1 t\u1eb1m. V\u1ea3i \u0111\u0169i c\xf3 tr\u1ecdng l\u01b0\u1ee3ng nh\u1eb9 v\xe0 b\u1ec1 m\u1eb7t h\u01a1i th\xf4 r\xe1p, tuy nhi\xean ch\xednh v\xec nh\u1eefng l\u1ee3i th\u1ebf n\xe0y m\xe0 t\xe0 \xe1o d\xe0i tr\u1edf n\xean \u0111\u1ed9c \u0111\xe1o v\xe0 chi\u1ebfm \u0111\u01b0\u1ee3c nhi\u1ec1u t\xecnh c\u1ea3m h\u01a1n t\u1eeb ng\u01b0\u1eddi s\u1eed d\u1ee5ng.",null,B.i,null,null)
B.Sk=new A.h("      Nh\xe0 may \xe1o d\xe0i Minh T\xe2n l\xe0 th\u01b0\u01a1ng hi\u1ec7u may \xe1o d\xe0i \u0111\u1eb9p n\u1ed5i ti\u1ebfng l\xe2u \u0111\u1eddi \u1edf Hu\u1ebf. Nh\xe0 may \xe1o d\xe0i Minh T\xe2n chuy\xean may \xe1o d\xe0i th\u1eddi trang; t\u1eeb \xe1o d\xe0i h\u1ecdc sinh, \xe1o d\xe0i c\xf4ng s\u1edf \u0111\u1ebfn \xe1o d\xe0i m\u1eb7c trong c\xe1c bu\u1ed5i l\u1ec5 long tr\u1ecdng nh\u01b0 \u0111\xe1m h\u1ecfi, \u0111\xe1m c\u01b0\u1edbi, d\u1ea1 h\u1ed9i... ",null,B.i,null,null)
B.Sl=new A.h("      - B\u1ea1n ch\u1ec9 c\u1ea7n th\xeam m\u1ed9t s\u1ed1 ph\u1ee5 ki\u1ec7n \xe1o d\xe0i nh\u01b0 b\u0103ng \u0111\xf4, t\xfai x\xe1ch ho\u1eb7c balo, c\xf9ng \u0111\xf4i d\xe9p sandal v\xf4 c\xf9ng nh\u1eb9 nh\xe0ng.",null,B.i,B.j,null)
B.Sm=new A.h("      V\u1ea3i \xe1o d\xe0i tuy\u1ebft m\u01b0a c\xf3 kh\u1ea3 n\u0103ng th\u1ea5m h\xfat m\u1ed3 h\xf4i kh\xe1 t\u1ed1t, \u0111\u1ed9 tho\xe1ng kh\xed kh\xe1 cao v\xe0 c\xf2n c\xf3 s\u1ef1 \u0111\xe0n h\u1ed3i co gi\xe3n. Kh\xf4ng nh\u1eefng v\u1eady, ch\u1ea5t li\u1ec7u Polyester c\xf3 trong v\u1ea3i c\xf2n gi\xfap cho v\u1ea3i tuy\u1ebft m\u01b0a gi\u1eefa \u0111\u01b0\u1ee3c phom d\xe1ng \xe1o d\xe0i chu\u1ea9n h\u01a1n v\xe0 h\u1ea1n ch\u1ebf \u0111\u01b0\u1ee3c s\u1ef1 nh\u0103n nh\xfam sau m\u1ed7i l\u1ea7n gi\u1eb7t hay s\u1eed d\u1ee5ng.",null,B.i,B.j,null)
B.Sn=new A.h("      V\u1ea3i g\u1ea5m c\xf3 \u0111\u1ed9 b\u1ec1n r\u1ea5t cao v\xec \u0111\u01b0\u1ee3c d\u1ec7t r\u1ea5t ch\u1eb7t ch\u1ebd g\u1ed3m nhi\u1ec1u s\u1ee3i v\u1ea3i li\xean k\u1ebft v\u1edbi nhau. N\xean m\u1ecdi ng\u01b0\u1eddi c\xf3 th\u1ec3 y\xean t\xe2m s\u1eed d\u1ee5ng v\u1ea3i g\u1ea5m \u0111\u1ec3 may \xe1o d\xe0i. Ngo\xe0i ra b\u1ec1 m\u1eb7t c\u1ee7a v\u1ea3i c\u0169ng ko d\u1ec5 b\u1ecb s\u1eddn hay \u0111\u1ed5 l\xf4ng gi\xfap cho \xe1o d\xe0i tr\xf4ng lu\xf4n m\u1edbi.",null,B.i,B.j,null)
B.So=new A.h("      C\u0169ng l\xe0 \u0111\u1ec1 t\xe0i r\u1ed3ng nh\u01b0ng r\u1ed3ng tr\xean \xe1o vua th\xec c\xf3 5 m\xf3ng; c\xf2n r\u1ed3ng tr\xean \xe1o c\u1ee7a ho\xe0ng th\xe1i t\u1eed ch\u1ec9 l\xe0 r\u1ed3ng m\u1eb7t n\u1ea1, kh\xf4ng \u0111\u01b0\u1ee3c trang tr\xed phi long hay h\u1ed3i long tri\u1ec1u nh\u1eadt v\xe0 ch\u1ec9 c\xf3 4 m\xf3ng. V\xe0 n\u1ebfu tr\xean \xe1o vua, h\u1eadu trang tr\xed nh\u1eefng con r\u1ed3ng c\xf3 d\xe1ng v\u1ebb uy nghi, \u0111\u01b0\u1eddng b\u1ec7 th\xec tr\xean \xe1o m\u0169 c\u1ee7a ho\xe0ng th\xe2n, t\xf4n t\u01b0\u1edbc ch\u1ec9 l\xe0 nh\u1eefng con m\xe3ng, con giao (c\xe1c h\xf3a th\xe2n \u1edf th\u1ee9 b\u1eadc th\u1ea5p h\u01a1n c\u1ee7a r\u1ed3ng). Tr\xean \xe1o m\xe3o c\u1ee7a ho\xe0ng th\xe1i h\u1eadu v\xe0 ho\xe0ng h\u1eadu trang tr\xed \u0111\u1ed3 \xe1n hoa v\u0103n \u0111o\xe0n ph\u01b0\u1ee3ng (\u0111\u1ed3 \xe1n chim ph\u01b0\u1ee3ng m\xfaa l\u01b0\u1ee3n trong h\xecnh tr\xf2n), v\u1edbi nh\u1eefng n\xe9t d\u1ec7t, \u0111\u01b0\u1eddng th\xeau r\u1ea5t s\u1ed1ng \u0111\u1ed9ng v\xe0 c\xf4ng phu th\xec tr\xean \xe1o c\u1ee7a c\xf4ng ch\xfaa v\xe0 cung giai h\xecnh chim ph\u01b0\u1ee3ng \u0111\xe3 \u0111\u01b0\u1ee3c gi\u1ea3n l\u01b0\u1ee3c, v\xe0 c\xe1ch \u0111i\u1ec7u th\xe0nh chim loan, s\u1ed1 \u0111\u1ed3 tr\xe2n b\u1ea3o \u0111\xednh k\xe8m c\u0169ng \xedt h\u01a1n.",null,B.i,B.j,null)
B.Sp=new A.h("      - M\u1ed9t v\xe0i n\u0103m g\u1ea7n \u0111\xe2y, ph\u1ee5 ki\u1ec7n \u0111i k\xe8m \xe1o d\xe0i \u0111\u01b0\u1ee3c \u01b0a chu\u1ed9ng nhi\u1ec1u nh\u1ea5t l\xe0 v\xf2ng c\u1ed5 ng\u1ecdc trai. m\u1eb7c d\xf9 kh\xe1 \u0111\u01a1n \u0111i\u1ec7u nh\u01b0ng v\u1eabn th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 qu\xfd ph\xe1i, sang tr\u1ecdng v\xe0 quy\u1ec1n l\u1ef1c nh\u01b0 m\u1ed9t qu\xfd c\xf4 th\u1eddi x\u01b0a.",null,B.i,B.j,null)
B.Sq=new A.h("\xc1o \u0111o\xe0n ph\u01b0\u1ee3ng nh\u1eadt b\xecnh c\u1ee7a ho\xe0ng h\u1eadu, m\u1eb7c l\xfac thi\u1ebft th\u01b0\u1eddng tri\u1ec1u.",null,B.v,null,null)
B.Sr=new A.h("      Nh\u1eafc \u0111\u1ebfn n\xf3n l\xe0, ng\u01b0\u1eddi ta s\u1ebd li\xean t\u01b0\u1edfng ngay \u0111\u1ebfn s\u1ef1 duy\xean d\xe1ng c\u1ee7a ng\u01b0\u1eddi ph\u1ee5 n\u1eef Vi\u1ec7t Nam. H\xecnh \u1ea3nh \u0111\xe3 in s\xe2u v\xe0o t\xe2m tr\xed c\u1ee7a m\u1ed7i ng\u01b0\u1eddi d\xe2n Vi\u1ec7t, v\xec th\u1ebf ph\u1ee5 ki\u1ec7n \u0111i k\xe8m \xe1o d\xe0i kh\xf4ng th\u1ec3 kh\xf4ng nh\u1eafc \u0111\u1ebfn n\xf3n l\xe1.",null,B.i,B.j,null)
B.Ss=new A.h("      Tr\xean tay \xe1o c\xf2n c\xf3 d\u1ea3i m\xe0u ng\u0169 s\u1eafc: l\u1ee5c, xanh, v\xe0ng, \u0111\u1ecf, tr\u1eafng t\u01b0\u1ee3ng tr\u01b0ng cho \u0111\u1ecba v\u1ecb ng\u01b0\u1eddi m\u1eb7c. Tuy nhi\xean, quy ch\u1ebf tay \xe1o d\u1ea3i m\xe0u n\xe0y th\xec kh\xf4ng \xe1p d\u1ee5ng tr\xean lo\u1ea1i \xe1o d\xe0i Nh\u1eadt B\xecnh c\u1ee7a b\u1eadc Ho\xe0ng H\u1eadu. Ch\xfang ch\u1ec9 \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng cho trang ph\u1ee5c c\u1ee7a c\xe1c c\xf4ng ch\xfaa, c\xe1c cung t\u1ea7n t\u1ee9 giai, cung t\u1ea7n nh\u1ecb giai,\u2026",null,B.i,B.j,null)
B.St=new A.h("      Kh\xf4ng ch\u1ec9 l\xe0 \u0111\u1ecba \u0111i\u1ec3m \u0111\u01b0\u1ee3c ch\u1ecdn \u0111\u1ec3 quay MV \u201cB\xean nhau tr\u1ecdn \u0111\u1eddi\u201d H\xf2a Minzy c\xf2n h\u1edbp h\u1ed3n du kh\xe1ch theo l\u1ed1i ki\u1ebfn \u200b\u200btr\xfac \xc1 \u2013 \xc2u nguy nga, tr\xe1ng l\u1ec7. Cung An \u0110\u1ecbnh g\u1ed3m 3 c\xf4ng tr\xecnh ch\xednh g\u1ed3m c\u1ed5ng ch\xednh, \u0111\xecnh Trung L\u1eadp v\xe0 l\u1ea7u Kh\u1ea3i T\u01b0\u1eddng. Tr\u1ea3i qua bao th\u0103ng tr\u1ea7m c\u1ee7a th\u1eddi gian, cung An \u0110\u1ecbnh v\u1eabn gi\u1eef nguy\xean gi\xe1 tr\u1ecb ki\u1ebfn \u200b\u200btr\xfac v\xe0 l\u1ecbch s\u1eed, \u0111\u1ec3 l\u1ea1i cho du kh\xe1ch nh\u1eefng \u1ea5n t\u01b0\u1ee3ng kh\xf3 qu\xean.",null,B.i,B.j,null)
B.Su=new A.h("      Nh\u1eefng ti\u1ec7m may n\u1ed5i ti\u1ebfng c\u1ee7a Hu\u1ebf t\u1eeb x\u01b0a \u0111\u1ebfn nay:",null,B.aE,B.j,null)
B.Sv=new A.h("      N\u0103m 1744, sau khi x\u01b0ng V\u01b0\u01a1ng \u1edf ph\u1ee7 ch\xednh Ph\xfa Xu\xe2n, ch\xfaa Nguy\u1ec5n Ph\xfac Kho\xe1t \u0111\xe3 ban h\xe0nh nhi\u1ec1u ch\xednh s\xe1ch c\u1ea3i c\xe1ch, t\u1ed5 ch\u1ee9c l\u1ea1i b\u1ed9 m\xe1y ch\xednh quy\u1ec1n, \u0111\u1ecbnh ch\u1ebf c\u1ea3 Y quan v\xe0 L\u1ec5 nh\u1ea1c, x\xe2y d\u1ef1ng h\xecnh \u1ea3nh m\u1ed9t tri\u1ec1u \u0111\u1ea1i \u0111\u1ed9c l\u1eadp, t\u1ef1 ch\u1ee7 ho\xe0n to\xe0n.  Kh\xf4ng ch\u1ec9 c\u1ea3i c\xe1ch tri\u1ec1u ph\u1ee5c cho \u0111\u1ed9i ng\u0169 quan l\u1ea1i, qu\xfd t\u1ed9c, Ch\xfaa c\xf2n \u0111\u1ecbnh ch\u1ebf th\u01b0\u1eddng ph\u1ee5c, quy\u1ebft \u0111\u1ecbnh s\u1eed d\u1ee5ng b\u1ed9 \u201cqu\u1ea7n ch\xe2n \xe1o ch\xedt\u201d- t\u1ee9c b\u1ed9 \xe1o ng\u0169 th\xe2n tay ch\u1ebdn v\xe0 qu\u1ea7n hai \u1ed1ng l\xe0m trang ph\u1ee5c chung cho d\xe2n ch\xfang \u0110\xe0ng Trong. R\u1ea5t nhanh sau \u0111\xf3, lo\u1ea1i trang ph\u1ee5c n\xe0y \u0111\xe3 ph\u1ed5 bi\u1ebfn trong to\xe0n x\u1ee9. ",null,B.i,B.j,null)
B.Sw=new A.h("\xc1o Nh\u1eadt B\xecnh",null,B.cz,null,null)
B.Sx=new A.h("Vua H\xe0m Nghi mang \xe1o d\xe0i, n\u0103m 1899 ",null,B.v,B.G,null)
B.Sy=new A.h("      V\xf2ng tay, \u0111\u1ed3ng h\u1ed3",null,B.a0,null,null)
B.Sz=new A.h("     4. V\u1ea3i nhung",null,B.E,null,null)
B.SA=new A.h("      \u0110\u1ee9ng \u0111\u1ea7u trong danh s\xe1ch ph\u1ea3i k\u1ec3 \u0111\u1ebfn ch\u1ea5t li\u1ec7u chiffon, v\u1edbi \u0111\u1ed9 m\u1ec1m m\u1ea1i m\xe0 chiffon mang l\u1ea1i gi\xfap t\xe0 \xe1o d\xe0i th\xeam th\u01b0\u1edbt tha, uy\u1ec3n chuy\u1ec3n. Kh\xf4ng nh\u1eefng v\u1eady c\xf2n gi\xfap cho ch\u1ecb em tr\u1edf n\xean \u0111\u1eb1m th\u1eafm v\xe0 d\u1ecbu d\xe0ng.",null,B.i,null,null)
B.SB=new A.h("      \xc1o ng\u0169 th\xe2n l\xe0 m\u1ed9t lo\u1ea1i trang ph\u1ee5c truy\u1ec1n th\u1ed1ng c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t m\xecnh \u0111\u01b0\u1ee3c ra \u0111\u1eddi v\xe0o n\u0103m 1744 t\u1ea1i Hu\u1ebf, sau cu\u1ed9c c\u1ea3i c\xe1ch trang ph\u1ee5c \u0110\xe0ng Trong c\u1ee7a ch\xfaa Nguy\u1ec5n Ph\xfac Kho\xe1t. S\u1edf d\u0129 c\xf3 t\xean g\u1ecdi \xe1o d\xe0i ng\u0169 th\xe2n l\xe0 b\u1edfi lo\u1ea1i trang ph\u1ee5c n\xe0y \u0111\u01b0\u1ee3c gh\xe9p t\u1eeb 5 th\xe2n (5 v\u1ea1t) v\u1edbi 2 th\xe2n tr\u01b0\u1edbc, 2 th\xe2n sau \u0111\u01b0\u1ee3c \u0111\u1ed1i nhau \u1edf tr\u01b0\u1edbc ng\u1ef1c v\xe0 sau l\u01b0ng, th\xe2n th\u1ee9 5 \u1edf ph\xeda tr\u01b0\u1edbc n\u1eb1m b\xean ph\u1ea3i, \u1edf trong th\xe2n th\u1ee9 nh\u1ea5t.     ",null,B.i,B.j,null)
B.SD=new A.h("     N\xean m\u1eb7c \xe1o d\xe0i trong d\u1ecbp n\xe0o? ",null,B.E,null,null)
B.SE=new A.h("      Ngo\xe0i ra, t\u1ea1i Hu\u1ebf c\xf2n c\xf3 c\xe1c nh\xe0 may kh\xe1c, c\xf3 th\u1ec3 k\u1ec3 \u0111\u1ebfn nh\u01b0 Nh\xe0 may Chi Silk (18 Nguy\u1ec5n Sinh Cung), Nh\xe0 may Minh Ti\u1ebfn (31 H\xe0 N\u1ed9i), Nh\xe0 may Tu\u1ea5n (02 B\xe0 Tri\u1ec7u), Nh\xe0 may Anh B\u1ea3o (64 A L\xea L\u1ee3i), Nh\xe0 may Thanh Ch\xe2u (156 Phan \u0110\u0103ng L\u01b0u), Nh\xe0 may Ph\u01b0\u01a1ng Hoa(57 Mai Th\xfac Loan), Nh\xe0 may Xu\xe2n Thi (72 Phan \u0110\u0103ng L\u01b0u), Nh\xe0 may Th\xf9y Trang (85 Mai Th\xfac Loan), Nh\xe0 may Cu\u1ed9c (50 B\u1ea1ch \u0110\u1eb1ng)...",null,B.i,null,null)
B.SF=new A.h("      N\u1ebfu \xe1o d\xe0i c\u1ed5 thuy\u1ec1n sinh ra l\xe0 \u0111\u1ec3 d\xe0nh cho nh\u1eefng nh\u1eefng c\xf3 th\xe2n m\xecnh m\u0169m m\u0129m th\xec \xe1o d\xe0i c\u1ed5 tr\xf2n l\u1ea1i th\xedch h\u1ee3p v\u1edbi ng\u01b0\u1eddi c\xf3 th\xe2n h\xecnh m\u1ea3nh mai. Ph\u1ee5 ki\u1ec7n \xe1o d\xe0i c\u1ed5 tr\xf2n c\u0169ng kh\xe1 \u0111\u01a1n gi\u1ea3n, b\u1ea1n ho\xe0n to\xe0n c\xf3 th\u1ec3 l\u1ef1a ch\u1ecdn m\u1ea5n \u0111\u1ed9i \u0111\u1ea7u c\xf3 m\xe0u s\u1eafc ph\xf9 h\u1ee3p.",null,B.i,B.j,null)
B.SG=new A.h("Ca s\u0129 Nguy\u1ec5n \u0110\u1ee9c Trung di\u1ec7n \xe1o d\xe0i \u0111\xf3n T\u1ebft d\xe2n t\u1ed9c",null,B.v,B.G,null)
B.SH=new A.h("      \xc1o Nh\u1eadt B\xecnh ph\xe2n theo th\u1ee9 b\u1eadc",null,B.a5,null,null)
B.SI=new A.h("      C\xf2n v\u1ec1 m\u0169 th\xec g\u1ed3m c\xf3 1 chi\u1ebfc Tam ph\u01b0\u01a1ng Kim \u01b0\u1edbc ph\xe1t, 8 c\xe2y tr\xe2m hoa.",null,B.i,B.j,null)
B.SJ=new A.h('      Tr\xean \xe1o m\xe3o c\u1ee7a c\xe1c vua h\u1eadu tri\u1ec1u Nguy\u1ec5n th\u01b0\u1eddng \u0111\xednh v\xe0ng b\u1ea1c, tr\xe2n ch\xe2u, kim c\u01b0\u01a1ng... \u0111\u1ec3 t\u0103ng th\xeam gi\xe1 tr\u1ecb v\xe0 uy nghi. Theo s\xe1ch " Kh\xe2m \u0111\u1ecbnh \xd0\u1ea1i Nam h\u1ed9i \u0111i\u1ec3n s\u1ef1 l\u1ec7", tr\xean chi\u1ebfc m\u0169 vua \u0111\u1ed9i l\xfac thi\u1ebft \u0111\u1ea1i tri\u1ec1u c\xf3 \u0111\xednh 31 h\xecnh r\u1ed3ng l\xe0m b\u1eb1ng v\xe0ng t\u1ed1t; 30 \u0111\xf3a hoa vu\xf4ng c\xf3 kh\u1ea3m ng\u1ecdc, \u0111\xednh th\xeam 140 h\u1ea1t kim c\u01b0\u01a1ng v\xe0 tr\xe2n ch\xe2u. M\u0169 c\u1ee7a ho\xe0ng h\u1eadu c\xf3 9 con r\u1ed3ng, 9 con ph\u01b0\u1ee3ng b\u1eb1ng v\xe0ng t\u1ed1t, 9 mi\u1ebfng b\u1ed3n khoan b\u1eb1ng b\u1ea1c, 4 c\xe1i tr\xe2m b\u1eb1ng b\u1ea1c c\xf3 g\u1eafn 198 h\u1ea1t tr\xe2n ch\xe2u v\xe0 231 h\u1ea1t pha l\xea. Kh\u0103n b\u1ecbt tr\xe1n th\xec l\xe0m b\u1eb1ng \u0111o\u1ea1n b\xe1t ti (v\u1ea3i \u0111o\u1ea1n d\u1ec7t t\u1eeb t\u01a1 xe 8 s\u1ee3i) m\xe0u thi\xean thanh, b\xean trong l\xf3t l\u0129nh \u0111\u1ea1i t\xe0o m\xe0u v\xe0ng, trang s\u1ee9c 4 c\xe1i khuy\xean v\xe0ng t\u1ed1t v\xe0 4 s\u1ee3i d\xe2y t\u01a1. T\u1ea5t c\u1ea3 \xe1o m\u0169, xi\xeam y, h\xe0i \u1ee7ng c\u1ee7a vua h\u1eadu cho \u0111\u1ebfn phi t\u1ea7n, cung giai, t\xf9y theo th\u1ee9 b\u1eadc m\xe0 \u0111\xednh v\xe0ng b\u1ea1c, tr\xe2n ch\xe2u nhi\u1ec1u hay \xedt nh\u01b0ng c\xe1i n\xe0o c\u0169ng c\xf3.',null,B.i,B.j,null)
B.SK=new A.h("Ho\xe0ng h\u1eadu Nam Ph\u01b0\u01a1ng (v\u1ee3 vua B\u1ea3o \u0110\u1ea1i) trong trang ph\u1ee5c th\u01b0\u1eddng tri\u1ec1u.",null,B.v,null,null)
B.SL=new A.h("     M\u1eb7c \xe1o d\xe0i v\xe0o nh\u1eefng ng\xe0y l\u1ec5 t\u1ed1t nghi\u1ec7p trung h\u1ecdc, \u0111\u1ea1i h\u1ecdc, ch\u1ee5p \u1ea3nh k\u1ef7 y\u1ebfu:",null,B.E,null,null)
B.SM=new A.h("      M\u1ed9t s\u1ed1 b\u1ee9c h\u1ecda l\u01b0u l\u1ea1i cho th\u1ea5y, v\u1ec1 hoa v\u0103n tr\xean \xe1o Nh\u1eadt B\xecnh th\xec ch\u1ee7 y\u1ebfu l\xe0 d\u1ea1ng h\xecnh tr\xf2n kh\xe9p k\xedn. V\xe0 b\xean trong h\xecnh tr\xf2n c\xf3 th\xeau c\xe1c h\xecnh \u1ea3nh ph\u01b0\u1ee3ng \u1ed5, loan \u1ed5. Nh\u1eefng hoa v\u0103n ph\u1ee5 c\u0169ng phong ph\xfa h\u01a1n. ",null,B.i,null,null)
B.SN=new A.h("      \xc1o d\xe0i l\xe0 th\u01b0\u1edbc \u0111o u\u1ed1n n\u1eafn ng\u01b0\u1eddi con g\xe1i",null,B.i4,null,null)
